INSERT INTO `oc_category_description` (`category_id`, `language_id`, `name`, `description`, `meta_title`, `meta_description`, `meta_keyword`, `meta_h1`) VALUES
(191, 1, 'Ель', '&lt;h2&gt;Живая новогодняя ель с доставкой домой&lt;/h2&gt;\r\n\r\n&lt;p&gt;Живая елочка, купленная к новогодним праздникам, подарит ребенку волшебную сказку и новогоднюю ночь, где царит счастье и родительская любовь. Спустя даже много лет Ваши дети не забудут празднование Нового года и Рождества в своем детстве, и будут с теплотой и благодарностью вспоминать сказочную атмосферу новогодних каникул.&lt;/p&gt;\r\n\r\n&lt;p&gt;Натуральная елка – это не просто символ новогодних празднований, хвоя – действенное лекарство от множества заболеваний. Наши предки в домах, где находились тяжелобольные люди, засыпали пол иголками ели, а ее горящими ветвями окуривали избы. Эфирные масла хвои уничтожают стафилококк, который вызывает большинство бронхо-легочных заболеваний. Таким образом, для людей, длительное время страдающих от кашля или простуды, натуральная, пахнущая елочка подарит не только ощущение праздника, но и станет целительным лекарством.&lt;/p&gt;\r\n\r\n&lt;p&gt;Преимущества живой лесной красавицы:&lt;/p&gt;\r\n\r\n&lt;ul&gt;\r\n	&lt;li&gt;благоприятное воздействие на нервную систему за счет разливающегося аромата хвои и мандарин;&lt;/li&gt;\r\n	&lt;li&gt;создание волшебной атмосферы домашнего уюта;&lt;/li&gt;\r\n	&lt;li&gt;установка елки не только в жилых домах, но и в общественных местах, торговых центрах и т.д.;&lt;/li&gt;\r\n	&lt;li&gt;отличное дополнение к новогодней атрибутике и созданному интерьеру.&lt;/li&gt;\r\n&lt;/ul&gt;\r\n\r\n&lt;p&gt;Наличие в доме натуральной елки (или пихты, живой сосны) улучшает и поднимает настроение каждого члена семьи.&lt;/p&gt;\r\n\r\n&lt;h2&gt;Доступные цены на ели в Москве&lt;/h2&gt;\r\n\r\n&lt;p&gt;В каталоге нашего интернет-магазина имеются как живые ели в горшках, так и срезанные елочки. После обращения к нам, Вам больше не нужно будет бегать по елочным рынкам в поиске лесной красавицы, а затем приобретать дерево сомнительного качества. Наши ели имеют безупречный внешний вид и доступную цену.&lt;/p&gt;\r\n\r\n&lt;p&gt;Заказать ели у нас можно оптом, или в розницу с доставкой на дом или в офис по невысокой цене. Мы доставим хвойное дерево на следующий день по оформления заказа или в любое другое удобное для Вас время. Благодаря собственному питомнику и наличию склада готового товара с надлежащими условиями хранения, мы можем продавать ели в широком ассортименте.&lt;/p&gt;\r\n\r\n&lt;h2&gt;Как приобрести елку в Москве в Елки.ру?&lt;/h2&gt;\r\n\r\n&lt;p&gt;Для покупки ели с доставкой в Москву или Московскую область, предлагаем использовать онлайн-заказ. Для этого требуется положить товар, который Вам понравился, в «корзину» и заполнить специальную форму. Тогда наш менеджер позвонит Вам, чтобы обговорить все условия покупки и доставки. Мы принимаем заказы и по телефону или электронной почте. При нажатии кнопки «заказать звонок», наш менеджер-консультант самостоятельно с Вами свяжется.&lt;/p&gt;\r\n\r\n&lt;p&gt;Наш коллектив желает Вам счастливого Нового года и Рождества!&lt;/p&gt;\r\n', '', '', '', ''),
(202, 1, 'Пихта', '&lt;h2&gt;Яркий атрибут праздника – новогодняя пихта&lt;/h2&gt;\r\n\r\n&lt;p&gt;И снова на календаре зима. А значит, скоро-скоро самый любимый праздник детворы и взрослых – Новый год. Подготовка к веселому мероприятию занимает много времени и сил. И как же хочется в суматохе не забыть ни о чем. Пихта на Новый год и Рождество – необычное решение, которое постепенно входит в «моду». Характерный аромат и пушистые веточки делают ее достойной альтернативой привычным праздничным деревьям.&lt;/p&gt;\r\n\r\n&lt;p&gt;Пихта Фразера – вечнозеленое растение небольшого размера. Крона состоит из сильных ветвей, растущих вверх. Направление роста способствует созданию традиционной конической формы. Для достижения гармоничного результата садовники периодически подрезают дерево. Иголки небольшие – 2-2,5 сантиметра в длину. Благодаря насыщенному цвету хвойное дерево выступает хорошим решением для оформления помещения к зимним праздникам.&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;Пихта Фразера почти не осыпается. Она будет радовать внешним видом до конца января. Для жителей Америки она остается популярным новогодним деревом. Более того, к праздникам даже в Белом доме с ее помощью оформляются кабинеты.&lt;/p&gt;\r\n\r\n&lt;h2&gt;Пихта в Москве: отличное качество по хорошей цене&lt;/h2&gt;\r\n\r\n&lt;p&gt;Широкий ассортимент хвойных деревьев, представленных на сайте elki.sale, радует своим разнообразием. Елки, сосны, пихты и другие породы представителей флоры предлагаются в отличном качестве по приемлемым ценам.&lt;/p&gt;\r\n\r\n&lt;p&gt;Свежесрезанная пихта Фразера – традиционный атрибут Рождества. Купить ее можно при посещении нашего интернет-магазина. Цена деревца зависит от высоты.&lt;/p&gt;\r\n\r\n&lt;ul&gt;\r\n	&lt;li&gt;Небольшая елочка (высота до 1,5 метров) стоит около 6500 рублей.&lt;/li&gt;\r\n	&lt;li&gt;За высокую зеленую красавицу (до 3,75 метра) придется отдать приблизительно 45000 рублей.&lt;/li&gt;\r\n&lt;/ul&gt;\r\n\r\n&lt;p&gt;Компания не занимается массовой продажей пихт. Заинтересованным покупателям предлагаются деревья, прошедшие тщательный отбор. Выращивание в европейских питомниках гарантирует точность соблюдения необходимой технологии.&lt;/p&gt;\r\n\r\n&lt;h2&gt;Купить пихту на сайте elki.sale в Москве&lt;/h2&gt;\r\n\r\n&lt;p&gt;Решить вопрос можно при личном обращении к менеджеру или заполнении формы на сайте. Таким же образом можно купить сосну или елочку. Продажа осуществляется в розницу и оптовыми партиями. Доставка по предварительному согласованию. Пихта Фразера с яркой кроной и пушистыми веточками – отличное решение для оформления домашнего или офисного помещения к новогодним праздникам.&lt;/p&gt;\r\n\r\n&lt;p&gt;Наши сотрудники желают вам ярких праздников!&lt;/p&gt;\r\n', '', '', '', ''),
(205, 1, 'Подставки под елку', '&lt;h2&gt;Подставки под елку&lt;/h2&gt;\r\n\r\n&lt;p&gt;Любимые праздники всех детей и взрослых – Новый Год и Рождество. Подготовка торжества, покупка подарков и елки – это очень важно, но нужно не забыть приобрести и елочную подставку. Данный предмет обеспечит устойчивость новогоднему дереву.&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;Подставка играет декоративную функцию. Поможет продлить жизнь лесной красавицы.&amp;nbsp;Огромный&amp;nbsp;выбор&amp;nbsp;конструкций&amp;nbsp;представлен&amp;nbsp;в&amp;nbsp;каталоге&amp;nbsp;магазина&amp;nbsp;Elki.sale. Они играют роль крепления.&amp;nbsp;Изготавливаются&amp;nbsp;из различных материалов. Конструкция&amp;nbsp;выдерживает&amp;nbsp;значительные нагрузки.&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;Виды изделий под натуральную елку:&lt;/p&gt;\r\n\r\n&lt;ul&gt;\r\n	&lt;li&gt;металлическая – ствол дерева устанавливается в полный&amp;nbsp;цилиндр. Предмет&amp;nbsp;удерживается опорными ножками;&lt;/li&gt;\r\n	&lt;li&gt;изделие из пластика «Питер» – две поставки в виде емкости для жидкости и фурнитуры для креплений, надолго обеспечит свежесть растений высотой 1,5-3 метра;&lt;/li&gt;\r\n	&lt;li&gt;кованные – изделия привлекательного внешнего&amp;nbsp;вида. Конструкция обеспечивает устойчивость дерева.;&lt;/li&gt;\r\n	&lt;li&gt;подставка «Космос» – изготовлена из полиамида, состоит из резервуара для воды или песка на объем 4,5 литра. Изделие подойдет для хвойных растений высотой 3 метра;&lt;/li&gt;\r\n	&lt;li&gt;изделие «Krinner» – подставка немецкого производителя. Монтаж новогоднего дерева осуществляется на функциональную и практичную конструкцию.&amp;nbsp; &amp;nbsp;&lt;/li&gt;\r\n&lt;/ul&gt;\r\n\r\n&lt;p&gt;Специальные навыки монтажа подставок не нужны.&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;h2&gt;Стоимость подставок для елки&lt;/h2&gt;\r\n\r\n&lt;p&gt;Точная цена&amp;nbsp;конструкций под ель в Москве указана&amp;nbsp;в каталоге товара интернет-магазина Elki.Sale. Дополнительную информацию по изделиям предоставит менеджер. Стоимость подставок не ударит по семейному бюджету. Конфигурация современных моделей соответствует качеству, долговечности, практичности. Декоративная форма изделий понравится каждому. Качественные системы крепежей удержат лесную красавицу в вертикальном положении.&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;h2&gt;Купить подставку для ели&lt;/h2&gt;\r\n\r\n&lt;p&gt;В интернет-магазине оформить заказ очень просто. Потенциальный покупатель может выбрать изделие онлайн. Заказать подставку можно по форме на сайте. Оформить заказ поможет консультант интернет-магазина.&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;В ассортименте магазина покупатель найдет подставки, живые деревья в горшках или срезы. К преимуществам наших услуг относятся:&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;ul&gt;\r\n	&lt;li&gt;отлаженная система доставки;&lt;/li&gt;\r\n	&lt;li&gt;доступные цены;&lt;/li&gt;\r\n	&lt;li&gt;большой опыт работы.&amp;nbsp;&lt;/li&gt;\r\n&lt;/ul&gt;\r\n\r\n&lt;p&gt;Магазин Elki.sale получил положительные отзывы от благодарных клиентов и зарекомендовал себя надежным продавцом товара высокого качества.&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;Счастливого Нового Года и Рождества!&lt;/p&gt;\r\n', '', '', '', ''),
(209, 1, 'Живая ель в горшке', '&lt;h1&gt;Продажа и доставка живых елок в Московской области&lt;/h1&gt;\r\n\r\n&lt;p&gt;В преддверии Нового года и Рождества в квартиры и дома устанавливают традиционный символ праздников – лесную ель. Хвойный запах, который распространяет лесная красавица, создает ощущение настоящего новогоднего торжества. Поэтому его так любят взрослые и дети. Вы решили установить дома живую елку? Садовый центр рекомендует приобрести дерево в горшке.&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;h2&gt;Ассортимент деревьев от магазина Elki.sale&lt;/h2&gt;\r\n\r\n&lt;p&gt;Интернет-магазин Elki.sale предлагает купить несколько видов новогодних красавиц в горшке:&lt;/p&gt;\r\n\r\n&lt;ul&gt;\r\n	&lt;li&gt;ель голубая – благородный окрас, короткая пышная хвоя, красивая форма, обязательно привлекут внимание покупателей;&lt;/li&gt;\r\n	&lt;li&gt;ель датская – растение, которое приобрели у коллег из Дании и благополучно разводим в своих питомниках, с сильным запахом хвои и густым лапками;&lt;/li&gt;\r\n	&lt;li&gt;ель русская – классический вид, распространен в наших лесах, молодое дерево с густой ярко-зеленой хвоей.&amp;nbsp;&lt;/li&gt;\r\n&lt;/ul&gt;\r\n\r\n&lt;h2&gt;Почему лучше покупать елки в горшках?&amp;nbsp;&lt;/h2&gt;\r\n\r\n&lt;p&gt;Массовая вырубка лесных красавиц к Новому году нещадно разрушает экологию. У нас покупатели смогут приобрести живые ели, и при этом не навредить чистоте окружающей среды. Такое мнение бытует среди производителей искусственных елей. Материал изготовления синтетических изделий – полихлорвинил. Научным путем доказано, что эксплуатация таких товаров вызывает выделение токсических веществ. Токсины оказывают негативное влияние на состояние здоровья.&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;Аргументы, которые говорят в пользу покупки зеленых растений в горшках:&lt;/p&gt;\r\n\r\n&lt;ul&gt;\r\n	&lt;li&gt;современные питомники выращивают плантации новогодних деревьев много лет;&lt;/li&gt;\r\n	&lt;li&gt;производство экологически безопасно;&lt;/li&gt;\r\n	&lt;li&gt;живое дерево будет издавать приятный хвойный запах и радовать зелеными хвоинками все новогодние праздники;&lt;/li&gt;\r\n	&lt;li&gt;ель из горшка можно высадить в открытый грунт на даче или во дворе;&lt;/li&gt;\r\n	&lt;li&gt;возможность сохранить частичку природы, и водить хороводы вокруг хвойной красавицы еще много лет;&lt;/li&gt;\r\n	&lt;li&gt;дерево не осыпается и не оставляет мусора;&lt;/li&gt;\r\n	&lt;li&gt;реализация товара проводится в устойчивых горшках без специальной подставки;&lt;/li&gt;\r\n	&lt;li&gt;растущее растение радует, создает атмосферу настоящего праздника;&lt;/li&gt;\r\n	&lt;li&gt;сочетание запаха хвои и мандарин подарит ощущение новогодней сказки;&lt;/li&gt;\r\n	&lt;li&gt;живое дерево выделяет природные фитонциды. Вещества повышают самочувствие и укрепляют иммунитет зимой;&lt;/li&gt;\r\n	&lt;li&gt;ель органично впишется в интерьер помещения;&lt;/li&gt;\r\n	&lt;li&gt;дерево в горшке можно использовать, как украшение торговых залов, уличных кафе, дворов, улиц, домов;&lt;/li&gt;\r\n	&lt;li&gt;за растением в горшке очень просто ухаживают: достаточно, увлажнять почву и применять специальные стимуляторы роста, минеральные удобрения.&amp;nbsp;&lt;/li&gt;\r\n&lt;/ul&gt;\r\n\r\n&lt;h2&gt;Как купить ель на сайте Elki.sale?&amp;nbsp;&lt;/h2&gt;\r\n\r\n&lt;p&gt;Хотите порадовать малышей? Не знаете где выгодно купить новогоднее дерево? Каталог интернет-магазина Elki.sale содержит список хвойных растений любого размера и вида. На сайте проводится консультация и продажа товаров. Покупатель может заказать доставку елей в вазонах по Москве и Московской области. Продукция проходит процедуру сертификации. Реализуется по доступным ценам.&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;Магазин организовал оптовую и розничную продажу деревьев в горшках. Наши специалисты подскажут, как выбрать новогодний подарок. Флористы могут провести демонтаж и вывоз горшков после окончания торжества.&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;Мы занимаемся продажей живых и срезанных елок. Наш товар выращен на базе собственного питомника.&amp;nbsp;&lt;/p&gt;\r\n', '', '', '', ''),
(211, 1, 'Пакеты для утилизации ёлок', '&lt;h2&gt;Пакет для утилизации елки: практичное решение&lt;/h2&gt;\r\n\r\n&lt;p&gt;Елочка – традиционный атрибут новогодних праздников. Зеленая красавица создает необыкновенную атмосферу в помещении, дарит массу положительных впечатлений. Но празднование заканчивается. Последствия их также традиционные: возле мусорных контейнеров наблюдается большое количество новогодних деревьев. Ели и сосны, не так давно приносившие радость, теперь вызывают грусть и раздражение, как и пространство рядом с ними, обильно усыпанное осыпавшейся хвоей.&lt;/p&gt;\r\n\r\n&lt;p&gt;Избежать печального развития событий поможет мешок из полиэтилена. Его преимущества:&lt;/p&gt;\r\n\r\n&lt;ul&gt;\r\n	&lt;li&gt;облегчает уборку мусора, оставшегося после зимних праздничных мероприятий;&lt;/li&gt;\r\n	&lt;li&gt;новогоднее деревце «транспортируется» в контейнер, не оставляя после себя «дорожки» из осыпавшихся иголочек.&lt;/li&gt;\r\n&lt;/ul&gt;\r\n\r\n&lt;p&gt;Конечно, можно купить искусственную елку или сосну, которую не надо выбрасывать. Но именно живое деревце наполняет помещение характерным смолистым ароматом, избавляющим воздух от вредных микробов. Только настоящая елочка или сосна подарит праздничное ощущение, успокоит нервную систему. С помощью полиэтиленового мешка выкинуть деревце не составит проблем.&lt;/p&gt;\r\n\r\n&lt;h2&gt;Как заказать пакет для утилизации елки&lt;/h2&gt;\r\n\r\n&lt;p&gt;Посещение сайта elki.sale поможет купить прочный полиэтиленовый мешок по доступной цене. Его наличие поможет утилизировать елочку без сложностей. Вариант заказа выбирает клиент. Звонок менеджеру, заполнение формы на сайте, заказ обратного звонка. Демократичная ценовая политика позволяет недорого купить пакеты. Доступна услуга доставки по Москве. Курьер привезет заказ по указанному адресу. Дата доставки предварительно согласовывается.&lt;/p&gt;\r\n\r\n&lt;p&gt;Посещение нашего ресурса позволит создать дома непередаваемую новогоднюю атмосферу. А после праздников убрать елку без грязи и мусора.&lt;/p&gt;\r\n', '', '', '', ''),
(212, 1, 'Лапник пихты', '', 'Лапник пихты | Купить живой лапник в Москве с доставкой', 'Лапник пихты  - купить в интернет-магазине ELKI.ONE с доставкой на дом. Гарантия качества! Быстрая доставка! Успей заказать до Нового года!\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n', '', ''),
(215, 1, 'Живая сосна срезанная', '&lt;h2&gt;Натуральная сосна к Новому году с доставкой&lt;/h2&gt;\r\n\r\n&lt;p&gt;Постепенно возвращается верность старинному русскому обычаю — ставить в доме на новогодние праздники натуральную, живую лесную красавицу. Сосна издает характерный хвойный аромат, который с детства ассоциируется у нас с новогодними чудесами. Ни одна, даже самая красивая синтетическая елка не наполнит ваш дом, офис или городскую квартиру этим узнаваемым запахом Нового года.&lt;/p&gt;\r\n\r\n&lt;p&gt;Ареал произрастания сосны тянется от зоны Заполярья до экватора. Это вечнозеленое дерево с двух-, трех-, или пятихвойными пучками иголок, длина которых достигает 7 см.&lt;/p&gt;\r\n\r\n&lt;p&gt;Во второй половине декабря начинается праздничный ажиотаж и суета в поисках подходящей мохнатой красавицы. Чтобы не тратить время на беготню по «елочным базарам» и сохранить хорошее настроение, воспользуйтесь услугами нашего интернет-магазина.&lt;/p&gt;\r\n\r\n&lt;h2&gt;Преимущества и цены на живые сосны в Москве&lt;/h2&gt;\r\n\r\n&lt;p&gt;Сосны, как и другие новогодние деревья из нашего каталога, привлекут ваше внимание доступными ценами в сочетании с отменным качеством. Вы получите пышное, красивое лесное растение нужной высоты.&lt;/p&gt;\r\n\r\n&lt;p&gt;Причины, по которым стоит купить новогоднюю живую сосну.&lt;/p&gt;\r\n\r\n&lt;ol&gt;\r\n	&lt;li&gt;Это экологически безопасный продукт, не вызывающий аллергии.&lt;/li&gt;\r\n	&lt;li&gt;Летучие вещества — фитонциды, выделяемые сосной, благоприятно воздействуют на слизистые оболочки органов дыхания, очищают воздух от бактерий и микробов (очень полезно астматикам).&lt;/li&gt;\r\n	&lt;li&gt;Иголки прочно «сидят» на ветках, не осыпаются.&lt;/li&gt;\r\n	&lt;li&gt;По окончании новогодних праздников сосновые иголки, ветки, кору, можно использовать для приготовления целебных отваров, ванночек для ног.&lt;/li&gt;\r\n	&lt;li&gt;По древнему преданию, живая сосна приносит в дом богатство, благополучие и привлекает удачу.&lt;/li&gt;\r\n&lt;/ol&gt;\r\n\r\n&lt;p&gt;Перед тем, как отправиться к вам, все деревья проходят тщательный отбор и проверку на соответствие форм ствола и веток, прочность крепления хвои.&lt;/p&gt;\r\n\r\n&lt;p&gt;Цена живой сосны зависит от размеров, окончательную стоимость уточняйте у менеджера.&lt;/p&gt;\r\n\r\n&lt;h2&gt;Где купить живую сосну в Москве&lt;/h2&gt;\r\n\r\n&lt;p&gt;В нашем магазине вы можете купить живую сосну и заказать доставку по нужному адресу. Для этого свяжитесь с менеджером в онлайн-чате, позвоните по указанному телефону или отправьте сообщение.&lt;/p&gt;\r\n\r\n&lt;p&gt;При необходимости, оказываем услуги по установке живых новогодних деревьев. Для оптовых покупателей действуют дополнительные скидки.&lt;/p&gt;\r\n', '', '', '', ''),
