INSERT INTO `oc_information_description` (`information_id`, `language_id`, `title`, `description`, `meta_title`, `meta_description`, `meta_keyword`, `meta_h1`) VALUES
(5, 1, 'Условия соглашения', '&lt;p&gt;\r\n	Условия соглашения&lt;/p&gt;\r\n', '', '', '', ''),
(3, 1, 'Политика безопасности', '&lt;p&gt;\r\n	Политика безопасности&lt;/p&gt;\r\n', '', '', '', ''),
(5, 2, 'Terms &amp; Conditions', '&lt;p&gt;Terms &amp;amp; Conditions&lt;br&gt;&lt;/p&gt;', '', '', '', ''),
(3, 2, 'Privacy Policy', '&lt;p&gt;Privacy Policy&lt;br&gt;&lt;/p&gt;', '', '', '', ''),
(10, 1, 'Елки оптом', '&lt;p&gt;Елки оптом&lt;br&gt;&lt;/p&gt;', '', '', '', ''),
(4, 1, 'О компании', '&lt;p&gt;Мы самостоятельно выращиваем деревья: не рубим лесную елку, т.к. она не красивая и несимметричная! Наши деревья растут в питомнике, где им достаточно места и света для идеального роста. Работаем с 2005 года. В 2016 году на столичном рынке по разведению и продаже елей мы стали лучшей компанией. У нас можно подобрать дерево на любой вкус, различных форм и размеров.&amp;nbsp;&lt;/p&gt;&lt;p&gt;Покупка красавицы-ели к новогодним праздникам через сайт проста. Вам больше не требуется искать стихийно образующиеся рынки, спешить и беспокоиться о том, как довезти дерево домой. Наш интернет-магазин обеспечит доставку елочки точно в срок!&lt;/p&gt;\r\n', '', '', '', ''),
(6, 1, 'Доставка', '&lt;div class=&quot;delivery-article&quot;&gt;\r\n  &lt;p&gt;\r\n    У нас можно приобрести новогодние елки с доставкой на дом или в офис по Москве в пределах МКАД и столичной области. Доставка выбранного дерева происходит на следующий день после оформления заказа или в удобное для Вас время. \r\n    Предварительно стоит согласовать условия доставки с нашим менеджером по номеру &lt;a href=&quot;tel:+74959919120&quot;&gt;+7 (495) 991-91-20&lt;/a&gt;. \r\n    Курьеры работают ежедневно с 8:00 до 24:00.\r\n    Помимо этого можно лично посетить наш склад, чтобы выбрать новогоднее дерево надлежащего размера и качества, и самостоятельно доставить домой.\r\n  &lt;/p&gt;\r\n  &lt;p&gt;\r\n    Покупка красавицы-ели к новогодним праздникам через сайт проста. \r\n    Вам больше не требуется искать стихийно образующиеся рынки, спешить и беспокоиться о том, как довезти дерево домой.\r\n    Наш интернет-магазин обеспечит доставку елочки точно в срок!\r\n  &lt;/p&gt;\r\n&lt;/div&gt;', '', '', '', ''),
(8, 1, 'Где купить', '&lt;p&gt;Доставка елок по Москве и области начинается уже в конце ноября. В начале декабря склад открывается для самовывоза, а с 20 декабря выбрать елку можно и на наших базарах!&amp;nbsp;&lt;/p&gt;', '', '', '', ''),
(7, 1, 'Как заказать', '&lt;div class=&quot;delivery-article&quot;&gt;\r\n  &lt;p&gt;\r\n    У нас можно приобрести новогодние елки с доставкой на дом или в офис по Москве в пределах МКАД и столичной области. Доставка выбранного\r\n    дерева происходит на следующий день после оформления заказа или в удобное для Вас время. Предварительно стоит согласовать условия\r\n    доставки с нашим менеджером по номеру &lt;a href=&quot;tel:+74959919120&quot;&gt;+7 (495) 991-91-20&lt;/a&gt;. Курьеры работают ежедневно с 8:00 до 24:00.\r\n  &lt;/p&gt;\r\n  &lt;p&gt;\r\n    Помимо этого можно лично посетить наш склад, чтобы выбрать новогоднее дерево надлежащего размера и качества, и самостоятельно доставить домой.\r\n  &lt;/p&gt;\r\n&lt;/div&gt;', '', '', '', '');
