(1, 3, 'Localcopy OCMOD Install Fix', 'localcopy-oc3', 'opencart3x.ru', '1.0', 'https://opencart3x.ru', '<?xml version=\"1.0\" encoding=\"utf-8\"?>\n<modification>\n  <name>Localcopy OCMOD Install Fix</name>\n  <code>localcopy-oc3</code>\n  <version>1.0</version>\n  <author>opencart3x.ru</author>\n  <link>https://opencart3x.ru</link>\n\n  <file path=\"admin/controller/marketplace/install.php\">\n	<operation>\n      <search>\n        <![CDATA[if ($safe) {]]>\n      </search>\n      <add position=\"before\">\n        <![CDATA[		\n		    $safe = true;\n		    ]]>\n      </add>\n    </operation>\n    <operation>\n      <search>\n        <![CDATA[if (is_dir($file) && !is_dir($path)) {]]>\n      </search>\n      <add position=\"before\">\n        <![CDATA[		\n			  if ($path == \'\') {\n  				$app_root = explode(\'/\',DIR_APPLICATION);\n  				unset($app_root[count($app_root)-2]);\n  				$app_root = implode(\'/\',$app_root);\n  				$path = $app_root . $destination;\n			  }\n		    ]]>\n      </add>\n    </operation>\n  </file> \n</modification>\n', 1, '2019-08-31 22:16:22'),
(2, 6, 'Gallery_Album', 'gallery_album12', 'Letscms', '1.0', 'http://www.letscms.com', '<?xml version=\"1.0\" encoding=\"utf-8\"?>\n<modification>\n  <name>Gallery_Album</name>\n  <code>gallery_album12</code>\n  <version>1.0</version>\n  <author>Letscms</author>\n  <link>http://www.letscms.com</link>\n  \n  \n  <file path=\"admin/controller/common/column_left.php\" error=\"skip\">\n        <operation error=\"skip\" info=\"add left position\">\n            <search><![CDATA[if ($catalog) {]]></search>\n            <add position=\"before\"><![CDATA[\n            if($this->config->get(\'module_gallery_album_status\')){\n                if ($this->user->hasPermission(\'access\', \'extension/module/gallery_album\')) {   \n            $catalog[] = array(\n              \'name\'     => $this->language->get(\'text_gallery_album\'),\n              \'href\'     => $this->url->link(\'catalog/gallery_album\', \'user_token=\' . $this->session->data[\'user_token\'], true),\n              \'children\' => array()   \n            );          \n          }\n      }\n      ]]></add>\n        </operation>\n    </file>\n    <file path=\"catalog/view/theme/default/template/common/header.twig\" error=\"skip\">\n        <operation error=\"skip\">\n            <search><![CDATA[\n        <link href=\"catalog/view/javascript/bootstrap/css/bootstrap.min.css\" rel=\"stylesheet\" media=\"screen\" />\n                ]]></search>\n            <add position=\"before\"><![CDATA[\n            <link href=\"catalog/view/theme/default/stylesheet/lightbox.css\" rel=\"stylesheet\" media=\"screen\" />\n             <link href=\"catalog/view/theme/default/stylesheet/lightbox.css\" rel=\"stylesheet\" media=\"screen\" />\n              <link href=\"catalog/view/theme/default/stylesheet/thumbnail-gallery.css\" rel=\"stylesheet\" media=\"screen\" />\n            <script src=\"catalog/view/javascript/blightbox.js\" type=\"text/javascript\"></script>\n            <link href=\"catalog/view/theme/default/stylesheet/magnific-popup.css\" rel=\"stylesheet\" media=\"screen\" />\n             <script src=\"catalog/view/javascript/jquery.magnific-popup.js\" type=\"text/javascript\"></script>\n             <script src=\"catalog/view/javascript/lightbox.js\" type=\"text/javascript\"></script>\n             <script src=\"catalog/view/javascript/imagelightbox.js\" type=\"text/javascript\"></script>\n             \n            ]]></add>\n        </operation>\n    </file>\n    \n    <file path=\"admin/language/en-gb/common/column_left.php\" error=\"skip\">\n        <operation error=\"skip\" info=\"add left position\">\n            <search><![CDATA[$_[\'text_information\']          = \'Information\';]]></search>\n            <add position=\"before\"><![CDATA[\n      $_[\'text_gallery_album\']               = \'Gallery Album\';\n      ]]></add>\n        </operation>\n    </file>\n  \n  <file path=\"admin/model/setting/store.php\" error=\"skip\">\n        <operation error=\"skip\">\n            <search><![CDATA[public function getTotalStoresByOrderStatusId($order_status_id) {]]></search>\n            <add position=\"before\"><![CDATA[\n      public function getTotalStoresByGalleryAlbumId($gallery_album_id) {\n    $account_query = $this->db->query(\"SELECT COUNT(*) AS total FROM \" . DB_PREFIX . \"setting WHERE `key` = \'config_account_id\' AND `value` = \'\" . (int)$gallery_album_id . \"\' AND store_id != \'0\'\");\n\n    $checkout_query = $this->db->query(\"SELECT COUNT(*) AS total FROM \" . DB_PREFIX . \"setting WHERE `key` = \'config_checkout_id\' AND `value` = \'\" . (int)$gallery_album_id . \"\' AND store_id != \'0\'\");\n\n    return ($account_query->row[\'total\'] + $checkout_query->row[\'total\']);\n  }\n      ]]></add>\n        </operation>\n    </file>\n    <file path=\"catalog/controller/startup/seo_url.php\" error=\"skip\">\n        <operation error=\"skip\">\n            <search ><![CDATA[\n             if ($url[0] == \'product_id\') { \n              ]]></search>\n            <add position=\"before\"><![CDATA[ \n          if ($url[0] == \'gallery_album_id\') {\n            $this->request->get[\'gallery_album_id\'] = $url[1];\n          }\n            \n      ]]></add>\n        </operation>\n\n        <operation error=\"skip\">\n            <search><![CDATA[\n             if ($query->row[\'query\'] && $url[0] != \'information_id\' && $url[0] != \'manufacturer_id\' && $url[0] != \'category_id\' && $url[0] != \'product_id\') {\n              ]]></search>\n            <add position=\"replace\"><![CDATA[if ($query->row[\'query\'] && $url[0] != \'information_id\' && $url[0] != \'manufacturer_id\' && $url[0] != \'category_id\' && $url[0] != \'product_id\'  && $url[0] != \'gallery_album_id\') {]]></add>\n        </operation>\n\n\n        <operation error=\"skip\">\n            <search><![CDATA[\n             $this->request->get[\'route\'] = \'information/information\';\n              ]]></search>\n            <add position=\"replace\"><![CDATA[\n            }elseif (isset($this->request->get[\'gallery_album_id\'])) {\n          $this->request->get[\'route\'] = \'product/gallery_album/info\';\n      ]]></add>\n        </operation>\n       \n          <operation error=\"skip\">\n            <search><![CDATA[\n            if (($data[\'route\'] == \'product/product\' && $key == \'product_id\') || (($data[\'route\'] == \'product/manufacturer/info\' || $data[\'route\'] == \'product/product\') && $key == \'manufacturer_id\') || ($data[\'route\'] == \'information/information\' && $key == \'information_id\')) {\n              ]]></search>\n            <add position=\"replace\"><![CDATA[\n            if (($data[\'route\'] == \'product/product\' && $key == \'product_id\') || (($data[\'route\'] == \'product/manufacturer/info\' || $data[\'route\'] == \'product/product\') && $key == \'manufacturer_id\') || ($data[\'route\'] == \'information/information\' && $key == \'information_id\') || ($data[\'route\'] == \'product/gallery_album/info\' && $key == \'gallery_album_id\')) {\n      ]]></add>\n        </operation>\n\n    </file>\n    <file path=\"catalog/controller/common/footer.php\" error=\"skip\">\n        <operation error=\"skip\" info=\"add left position\">\n            <search><![CDATA[ \n              $data[\'newsletter\'] = $this->url->link(\'account/newsletter\', \'\', true);\n                ]]></search>\n            <add position=\"before\"><![CDATA[\n               $data[\'gallery_album\'] = $this->url->link(\'product/gallery_album\', \'\', true);\n      ]]></add>\n        </operation>\n         <operation error=\"skip\" info=\"add left position\">\n            <search><![CDATA[ \n              $data[\'contact\'] = $this->url->link(\'information/contact\');\n                ]]></search>\n            <add position=\"before\"><![CDATA[\n               $data[\'module_status\']=$this->config->get(\'module_gallery_album_status\');\n      ]]></add>\n        </operation>\n    </file>\n     <file path=\"catalog/view/theme/default/template/common/footer.twig\" error=\"skip\">\n        <operation error=\"skip\" info=\"add left position\">\n            <search><![CDATA[ \n               <li><a href=\"{{ contact }}\">{{ text_contact }}</a></li>\n                ]]></search>\n            <add position=\"before\"><![CDATA[\n              {% if module_status %}\n               <li><a href=\"{{ gallery_album }}\">{{ text_gallery }}</a></li>\n               {%endif%}\n              \n      ]]></add>\n        </operation>\n    </file>\n     <file path=\"catalog/language/en-gb/common/footer.php\" error=\"skip\">\n        <operation error=\"skip\" info=\"add left position\">\n            <search><![CDATA[ \n              $_[\'text_newsletter\']   = \'Newsletter\';\n                ]]></search>\n            <add position=\"before\"><![CDATA[\n              $_[\'text_gallery\']   = \'Gallery\';\n      ]]></add>\n        </operation>\n    </file>\n</modification>', 1, '2019-09-05 15:43:12'),
(3, 7, 'Упрощенный заказ [Custom Quick Checkout]', 'quickcheckout_oc3', 'opencart3x.ru', '1.9', 'https://opencart3x.ru', '<?xml version=\"1.0\" encoding=\"UTF-8\"?>\n<modification>\n	<name>Упрощенный заказ [Custom Quick Checkout]</name>\n	<code>quickcheckout_oc3</code>\n	<version>1.9</version>\n	<author>opencart3x.ru</author>\n	<link>https://opencart3x.ru</link>\n	<file path=\"catalog/controller/checkout/cart.php\">\n		<operation>\n			<search><![CDATA[public function index() {]]></search>\n			<add position=\"after\"><![CDATA[		\n			if ($this->cart->hasProducts() && $this->config->get(\'quickcheckout_skip_cart\')){\n				$this->response->redirect($this->url->link(\'extension/quickcheckout/checkout\'));\n			}\n            ]]></add>\n		</operation>\n	</file>\n  	<file path=\"catalog/model/setting/extension.php\">\n		<operation>\n			<search trim=\"true\" index=\"0\"><![CDATA[\n				SELECT * FROM \" . DB_PREFIX . \"extension WHERE `type` =\n			]]></search>\n			<add position=\"after\" trim=\"false\" offset=\"0\"><![CDATA[\n				if ($type == \'payment\' && isset($this->session->data[\'shipping_method\'][\'code\']) && $this->config->get(\'quickcheckout_shipping_reload\')) {\n					$payments = $query->rows;\n\n					$rules = array();\n\n					foreach ($this->config->get(\'quickcheckout_payment2shipping_shippings\') as $shippings) {\n						if (strpos($this->session->data[\'shipping_method\'][\'code\'], $shippings[\'shipping\']) === 0) {\n							$rules[] = $shippings[\'payment\'];\n						}\n					}\n\n					if (!empty($rules)) {\n						foreach ($payments as $idx => $payment) {\n							if (!in_array($payment[\'code\'], $rules)) {\n								unset($payments[$idx]);\n							}\n						}\n\n						$query->rows = $payments;\n					}\n\n					//echo \'<pre>\'.__METHOD__.\' [\'.__LINE__.\']: \'; print_r($rules); echo \'</pre>\';\n					//echo \'<pre>\'.__METHOD__.\' [\'.__LINE__.\']: \'; print_r($this->session->data[\'shipping_method\']); echo \'</pre>\';\n					//echo \'<pre>\'.__METHOD__.\' [\'.__LINE__.\']: \'; print_r($query->rows); echo \'</pre>\';\n				}\n			]]></add>\n		</operation>\n	</file>\n</modification>', 1, '2019-09-06 15:08:08'),
(18, 14, 'Sla SEO Pro 3020', 'sla_seo_pro_modification', 'SlaSoft', '1.01 beta', '', '<?xml version=\"1.0\" encoding=\"utf-8\"?>\r\n<modification>\r\n  <name>Sla SEO Pro 3020</name>\r\n  <code>sla_seo_pro_modification</code>\r\n  <version>1.01 beta</version>\r\n  <author>SlaSoft</author>\r\n  <link></link>\r\n\r\n  <file path=\"admin/controller/catalog/product.php\">\r\n    <operation>\r\n      <search><![CDATA[$data[\'breadcrumbs\'] = array();]]></search>\r\n      <add position=\"before\"><![CDATA[\r\n			$data[\'entry_main_category\'] = $this->language->get(\'entry_main_category\');\r\n			]]></add>\r\n    </operation>\r\n    <operation>\r\n      <search><![CDATA[// Filters]]></search>\r\n      <add position=\"before\"><![CDATA[\r\n			if (isset($this->request->post[\'main_category_id\'])) {\r\n				$data[\'main_category_id\'] = $this->request->post[\'main_category_id\'];\r\n			} elseif (isset($product_info)) {\r\n				$data[\'main_category_id\'] = $this->model_catalog_product->getProductMainCategoryId($this->request->get[\'product_id\']);\r\n			} else {\r\n				$data[\'main_category_id\'] = 0;\r\n			}\r\n		]]></add>\r\n    </operation>\r\n  </file>\r\n  <file path=\"admin/language/en-gb/catalog/product.php\">\r\n    <operation>\r\n      <search><![CDATA[// Entry]]></search>\r\n      <add position=\"after\"><![CDATA[$_[\'entry_main_category\']	= \'Main category:\';]]></add>\r\n    </operation>\r\n  </file>\r\n  <file path=\"admin/language/ru-ru/catalog/product.php\">\r\n    <operation>\r\n      <search><![CDATA[// Entry]]></search>\r\n      <add position=\"after\"><![CDATA[$_[\'entry_main_category\']	= \'Главная категория:\';]]></add>\r\n    </operation>\r\n  </file>\r\n  <file path=\"admin/model/catalog/product.php\">\r\n    <operation>\r\n      <search><![CDATA[if (isset($data[\'product_related\'])) {]]></search>\r\n      <add position=\"before\"><![CDATA[\r\n			if(isset($data[\'main_category_id\']) && $data[\'main_category_id\'] > 0) {\r\n				$this->db->query(\"DELETE FROM \" . DB_PREFIX . \"product_to_category WHERE product_id = \'\" . (int)$product_id . \"\' AND category_id = \'\" . (int)$data[\'main_category_id\'] . \"\'\");\r\n				$this->db->query(\"INSERT INTO \" . DB_PREFIX . \"product_to_category SET product_id = \'\" . (int)$product_id . \"\', category_id = \'\" . (int)$data[\'main_category_id\'] . \"\', main_category = 1\");\r\n			} elseif(isset($data[\'product_category\'][0])) {\r\n				$this->db->query(\"UPDATE \" . DB_PREFIX . \"product_to_category SET main_category = 1 WHERE product_id = \'\" . (int)$product_id . \"\' AND category_id = \'\" . (int)$data[\'product_category\'][0] . \"\'\");\r\n			}\r\n			]]></add>\r\n    </operation>\r\n    <operation>\r\n      <search><![CDATA[public function getProductRelated($product_id) {]]></search>\r\n      <add position=\"before\"><![CDATA[\r\n      \r\n			/*\r\n			  public function getProductMainCategoryId($product_id) {\r\n				$query = $this->db->query(\"SELECT category_id FROM \" . DB_PREFIX . \"product_to_category WHERE product_id = \'\" . (int)$product_id . \"\' AND main_category = \'1\' LIMIT 1\");\r\n				return ($query->num_rows ? (int)$query->row[\'category_id\'] : 0);\r\n			}\r\n			*/\r\n			\r\n			]]></add>\r\n    </operation>\r\n    <operation>\r\n      <search><![CDATA[$this->getProductCategories($product_id)]]></search>\r\n      <add position=\"before\"><![CDATA[\r\n			$data[\'main_category_id\'] = $this->getProductMainCategoryId($this->request->get[\'product_id\']);\r\n			]]></add>\r\n    </operation>\r\n  </file>\r\n  <file path=\"admin/view/template/catalog/product_form.twig\">\r\n    <operation>\r\n      <search><![CDATA[<label class=\"col-sm-2 control-label\" for=\"input-category\"><span data-toggle=\"tooltip\" title=\"{{ help_category }}\">{{ entry_category }}</span></label>]]></search>\r\n      <add position=\"before\" offset=\"1\"><![CDATA[\r\n			<div class=\"form-group\">\r\n				<label class=\"col-sm-2 control-label\" for=\"input-category\">{{ entry_main_category }}</label>\r\n				<div class=\"col-sm-10\">\r\n					<select id=\"main_category_id\" name=\"main_category_id\" class=\"form-control\">\r\n						<option value=\"0\" selected=\"selected\">{{ text_none }}</option>\r\n						{% for category in product_categories %}\r\n							{% if (category.category_id == main_category_id) %}\r\n								<option value=\"{{ category.category_id }}\" selected=\"selected\">{{ category.name }}</option>\r\n							{% else %}\r\n								<option value=\"{{ category.category_id }}\">{{ category.name }}</option>\r\n							{% endif %}\r\n						{% endfor %}\r\n					</select>\r\n				</div>\r\n			</div>\r\n			]]></add>\r\n    </operation>\r\n    <operation>\r\n      <search><![CDATA[$(\'#product-category\').append(\'<div id=\"product-category\' + item[\'value\'] + \'\"><i class=\"fa fa-minus-circle\"></i> \' + item[\'label\'] + \'<input type=\"hidden\" name=\"product_category[]\" value=\"\' + item[\'value\'] + \'\" /></div>\');]]></search>\r\n      <add position=\"after\"><![CDATA[\r\n			if ($(\'#main_category_id option[value=\"\' + item[\'value\'] + \'\"]\').length == 0) {\r\n				$(\'#main_category_id\').append(\'<option value=\"\' + item[\'value\'] + \'\">\' + item[\'label\'] + \'</option>\');\r\n			}\r\n			]]></add>\r\n    </operation>\r\n    <operation>\r\n      <search><![CDATA[$(\'#product-category\').delegate(\'.fa-minus-circle\', \'click\', function() {]]></search>\r\n      <add position=\"after\"><![CDATA[\r\n			var category_id = $(this).parent().find(\'input[name=\"product_category\\\\[\\\\]\"]\').val();\r\n			$(\'#main_category_id option[value=\"\' + category_id + \'\"]\').remove();\r\n			]]></add>\r\n    </operation>\r\n  </file>\r\n</modification>', 1, '2019-12-01 12:11:35');
