INSERT INTO `oc_product_description` (`product_id`, `language_id`, `name`, `description`, `tag`, `meta_title`, `meta_description`, `meta_keyword`, `meta_h1`) VALUES
(214, 1, 'Живая русская ель срезанная', '&lt;h2&gt;Описание и характеристики:&lt;/h2&gt;&lt;p&gt;Натуральная русская ель из питомника, срезанная специально под заказ. Размер ели – 1,0 - 1,025 м, цена – всего 1 100 рублей! Приемлемая стоимость дерева, приятный равномерный цвет и строгость линий!&lt;/p&gt;&lt;h2&gt;Преимущества:&lt;/h2&gt;&lt;ul&gt;&lt;li&gt;Красивая пирамидальная крона, точность форм и равномерное расположение ветвей;&lt;/li&gt;&lt;li&gt;Хвоя средней жесткости, которая прочно держится и не осыпается;&lt;/li&gt;&lt;li&gt;Приятный лесной, свежий аромат с терпкими нотками;&lt;/li&gt;&lt;li&gt;Идеальный размер для удобного размещения в небольших комнатах и кабинетах;&lt;/li&gt;&lt;li&gt;Сертифицированная продукция с гарантией качества!&lt;/li&gt;&lt;/ul&gt;&lt;h2&gt;Размещение:&lt;/h2&gt;&lt;p&gt;Эргономичный размер елки исключает специальные сложные требования по установке. Достаточно пластиковой или стальной подставки, ПВХ контейнера под небольшое новогоднее дерево.&lt;/p&gt;&lt;h2&gt;Применение:&lt;/h2&gt;&lt;p&gt;Великолепное украшение кабинета, зала, гостиной, холла для того чтобы отпраздновать Новый год и Рождество. Вы можете купить сразу несколько елок для оформления входной группы, вестибюлей торгового или развлекательного комплекса.&lt;/p&gt;&lt;p&gt;Интернет-магазин Елки Сэйл обращает ваше внимание на тот факт, что компания реализует живые ели оптом и в розницу. Доставка по Москве и Области, а также возможность самовывоза!&lt;/p&gt;', '1-1.25м', '', '', '', ''),
(116, 1, 'Живая датская ель в горшке', '&lt;h2&gt;Описание и характеристики:&lt;/h2&gt;&lt;p&gt;Живая датская ель в горшке – компактная красавица для украшения любой комнаты на новогодние праздники!&lt;/p&gt;&lt;p&gt;Миниатюрное пышное растение, жесткая хвоя изумрудно-зеленого окраса, пышное и ровнорастущее дерево без дефектов. Размер датской ели – 0,6 - 0,8 м!&lt;/p&gt;&lt;h2&gt;Преимущества:&lt;/h2&gt;&lt;ul&gt;&lt;li&gt;Компактное растение, которое можно разместить где угодно в комнате или кабинете;&lt;/li&gt;&lt;li&gt;Высокая эстетическая ценность – пышность, цвет, правильная форма, невероятный аромат;&lt;/li&gt;&lt;li&gt;Предлагаем купить елки из специализированного питомника;&lt;/li&gt;&lt;li&gt;Сертификаты качества в наличии!&lt;/li&gt;&lt;/ul&gt;&lt;h2&gt;Размещение:&lt;/h2&gt;&lt;p&gt;Растение небольшого размера легко помещается на любом предмете мебели в необходимом помещении. Елку или несколько зеленых деревьев можно использовать и в качестве оформления входной группы на Новый год и Рождество. Для установки не требуется дополнительная подставка!&lt;/p&gt;&lt;h2&gt;Применение:&lt;/h2&gt;&lt;p&gt;Новогодняя ель используется для украшения помещений и открытых зон, по возможности, дополняется игрушками и гирляндами. Имеется возможность последующей посадки растения на участке около дома, офисного центра, развлекательного комплекса!&lt;/p&gt;&lt;p&gt;Наш интернет-магазин предлагает елки и пихты в любом количестве, оптом и в розницу, с доставкой по Москве и области. Рекомендуем только лучшие экземпляры по умеренной цене!&lt;/p&gt;', '0.6-0.8м', '', '', '', ''),
(117, 1, 'Живая голубая ель в горшке', '&lt;h2&gt;Описание и характеристики:&lt;/h2&gt;&lt;p&gt;Голубая ель на Новый год и Рождество – это новинка для многих из нас. Поэтому компания Елки Сэйл предлагает сделать правильный выбор и впервые отпраздновать новогодние праздники с голубой елкой, пусть даже небольшой величины.&lt;/p&gt;&lt;p&gt;Прекрасное растение с удивительным внешним видом, уникальной хвоей и невероятным ароматом. Пышное и миниатюрное дерево, размером всего 0,6 - 0,8 м, но на многие годы вперед!&lt;/p&gt;&lt;h2&gt;Преимущества:&lt;/h2&gt;&lt;ul&gt;&lt;li&gt;Голубая елка в горшке – приобретение не только на ближайшие праздники, но и на будущие годы;&lt;/li&gt;&lt;li&gt;Прекрасные эстетические показатели, а также повышенная долговечность и сроки эксплуатации;&lt;/li&gt;&lt;li&gt;Выращивание в экологически чистой обстановке;&lt;/li&gt;&lt;li&gt;Сертификат качества, а также возможность заказать растения оптом и в розницу с доставкой!&lt;/li&gt;&lt;/ul&gt;&lt;h2&gt;Размещение:&lt;/h2&gt;&lt;p&gt;Живая елка небольшого размера украсит каминную полку, барную стойку заведения, запросто поместится на столе или тумбе. Подходит для оформления любого внутреннего помещения без использования подставки!&lt;/p&gt;&lt;h2&gt;Применение:&lt;/h2&gt;&lt;p&gt;Исключительно в декоративных целях на новогодние праздники, а также для украшения собственного ландшафта впоследствии!&lt;/p&gt;&lt;p&gt;Наш интернет-магазин в Москве рекомендует рассмотреть ассортимент, и купить голубую ель в кадке. Цена достаточно умеренная для данного растения!&lt;/p&gt;', '0.6-0.8м', '', '', '', ''),
(208, 1, 'Живая пихта Фразера срезанная', '&lt;h2&gt;Описание и характеристики:&lt;/h2&gt;&lt;p&gt;Стройная, но одновременно очень пышная срезанная пихта на Новый год и Рождество. Умеренная длина хвои, отсутствие внешних дефектов, равномерный цвет с лоском, оптимальная величина для установки в закрытых помещениях.&lt;/p&gt;&lt;p&gt;Размер пихты Фразера – 2,0 - 2,25 м, цена на уровне регионального рынка!&lt;/p&gt;&lt;h2&gt;Преимущества:&lt;/h2&gt;&lt;ul&gt;&lt;li&gt;Елки Сэйл презентует один из лучших образцов новогоднего дерева;&lt;/li&gt;&lt;li&gt;Поразительная красота и правильная конусообразная форма;&lt;/li&gt;&lt;li&gt;Исключение осыпания хвои и сломов ветвей;&lt;/li&gt;&lt;li&gt;Легкий аромат леса, продолжительный срок эксплуатации;&lt;/li&gt;&lt;li&gt;Для возможности экономии средств предусмотрен самовывоз со склада;&lt;/li&gt;&lt;li&gt;Бережная доставка по Москве!&lt;/li&gt;&lt;/ul&gt;&lt;h2&gt;Размещение:&lt;/h2&gt;&lt;p&gt;Где и как установить пихту? Для этого подходит любая свободная зона в помещении, которая позволит разместить более чем двухметровое растение с соответствующим диаметром пышной кроны. Для надежности установки рекомендуется кованая подставка!&lt;/p&gt;&lt;h2&gt;Применение:&lt;/h2&gt;&lt;p&gt;Свежесрезанное дерево станет символом новогодних праздников, особенно если украсить пихту декоративным диодным освещением.&lt;/p&gt;&lt;p&gt;Наш интернет-магазин предлагает серьезный ассортимент видов и размеров деревьев, из которого вы можете выбрать и купить лучшие экземпляры оптом и в розницу!&lt;/p&gt;', '2-2.25м', '', '', '', ''),
(206, 1, 'Живая русская ель срезанная', '&lt;h2&gt;Описание и характеристики:&lt;/h2&gt;&lt;p&gt;Великолепная живая елка с пирамидальной кроной и равномерным окрасом, мелкой хвоей средней жесткости. Предлагается пышное новогоднее дерево, размер которого в пределах 1,25 - 1,5 м. Купить елку можно по цене всего в 1 300 рублей!&lt;/p&gt;&lt;h2&gt;Преимущества:&lt;/h2&gt;&lt;ul&gt;&lt;li&gt;Небольшой размер, который исключает неудобства при размещении;&lt;/li&gt;&lt;li&gt;Крона правильной формы, в которой нет физических дефектов;&lt;/li&gt;&lt;li&gt;Длительный срок эксплуатации растения с использованием специальных жидкостей, минимизирующий потерю хвои;&lt;/li&gt;&lt;li&gt;Насыщенный равномерный окрас и приятный аромат с самой первой минуты помещения в закрытое пространство;&lt;/li&gt;&lt;li&gt;Сертифицированная продукция из лесопитомника!&lt;/li&gt;&lt;/ul&gt;&lt;h2&gt;Размещение:&lt;/h2&gt;&lt;p&gt;Установка натуральной елки в горшок, ведро, контейнер, помещение на стальную или пластиковую подставку с устройством на полу, тумбе, столе или табурете.&lt;/p&gt;&lt;h2&gt;Применение:&lt;/h2&gt;&lt;p&gt;Русская елка классически применяется для декоративного оформления помещения празднования Нового года и Рождества. Является неотъемлемым предметом декора комнаты, кабинета, холла, вестибюля.&lt;/p&gt;&lt;p&gt;Интернет-магазин Ески Сэйл рекомендует внимательно отнестись к ассортименту, в котором также имеются датские ели. Предлагается доставка по Москве, самовывоз, опт и розница!&lt;/p&gt;', '1.25-1.5м', '', '', '', ''),
(207, 1, 'Подставки для елки с водой', '&lt;p&gt;Срезанное новогоднее дерево, будь то &lt;a href=&quot;/sosna/zhivaya-sosna-srezannaya/&quot;&gt;сосна&lt;/a&gt;, русская или &lt;a href=&quot;/el/zhivaya-srezannaya/datskaya-srezannaya/&quot;&gt;датская ель&lt;/a&gt;, требует надежной установки на месте оформления и украшения. Часто для этого используются деревянные или стальные крестовины, но если подобного крепления в доме не имеется, мы рекомендуем обратить внимание на специальные пластмассовые поставки в ассортименте под разный размер елки или сосны, а также диаметр ствола!&lt;/p&gt;&lt;h2&gt;Пластиковая подставка под елку &quot;Krinner&quot;&lt;/h2&gt;&lt;p&gt;Интернет-магазин Елки Сэйл акцентирует внимание на удобстве и надежности, а также невысокой стоимости продукции:&lt;/p&gt;&lt;ul&gt;&lt;li&gt;Пластиковая подставка по приемлемой цене, долговечная и надежная;&lt;/li&gt;&lt;li&gt;Предназначена для установки срезанных живых сосен и елок средней величины;&lt;/li&gt;&lt;li&gt;Удобное использование – стоит только нажать на педаль, установить ствол в фиксатор, и пружинный механизм с лапками зажмет ствол дерева в подставке;&lt;/li&gt;&lt;li&gt;Внутри имеется и резервуар для воды с наполнителем, подпитывающим елку на протяжении длительного срока, чтобы она оставалась свежей и зеленой!&lt;/li&gt;&lt;/ul&gt;&lt;p&gt;Купить подставки для елок по приемлемой стоимости вы всегда можете у нас. Обеспечим своевременную доставку по Москве и региону, чтобы Новый год и Рождество прошли без негативных эмоций!&lt;/p&gt;', '', '', '', '', ''),
(108, 1, 'Живая пихта Фразера в горшке', '&lt;h2&gt;Описание и характеристики:&lt;/h2&gt;&lt;p&gt;Живая пихта Фразера – одно из лучших новогодних растений. Компактное, очень пышное, оптимально сложенное, приятного цвета со стойким ароматом, равномерным покрытием хвоей, со стойким цветом и природными оттенками. Размер пихты – 1,25 - 1,5 м.&lt;/p&gt;&lt;h2&gt;Преимущества:&lt;/h2&gt;&lt;ul&gt;&lt;li&gt;Компактный размер и приемлемая цена – отличное сочетание;&lt;/li&gt;&lt;li&gt;Большой выбор новогодних деревьев разных видов, если вы хотите взять несколько елок, срезанных или в горшке;&lt;/li&gt;&lt;li&gt;Каждая елка и пихта Фразера строго из лесопитомника;&lt;/li&gt;&lt;li&gt;Реализация оптом и в розницу, доставка и самовывоз;&lt;/li&gt;&lt;li&gt;Каждое дерево правильной формы, без дефектов, с натуральной пышностью и покрытием хвоей!&lt;/li&gt;&lt;/ul&gt;&lt;h2&gt;Размещение:&lt;/h2&gt;&lt;p&gt;Пихта устанавливается в жилых, административных зданиях, холлах развлекательных комплексов на подставки или в контейнер, применяется для оформления внутренних помещений, но также используется на улице.&lt;/p&gt;&lt;h2&gt;Применение:&lt;/h2&gt;&lt;p&gt;Пихта Фразера – один из лучших вариантов оформления в самостоятельном виде или общей композиции с другими хвойными, с украшением фонариками, игрушками, светодиодными гирляндами. Возможность посадки в грунт по окончанию праздников!&lt;/p&gt;&lt;p&gt;Елки Сэйл – интернет-магазин в Москве, который предлагает купить пихты, сосны и ели на Новый год и Рождество. Звоните и оформляйте заказ!&lt;/p&gt;', '1.25-1.5м', '', '', '', ''),
(239, 1, 'Живая русская ель срезанная', '&lt;h2&gt;Описание и характеристики:&lt;/h2&gt;&lt;p&gt;Срезанная живая русская ель правильной формы. Пышная, с равнонаправленными ветками и хвоей средней жесткости. Размер елки – 3,5 - 3,75 м. Лучшая цена в Москве для данной величины новогоднего дерева!&lt;/p&gt;&lt;h2&gt;Преимущества:&lt;/h2&gt;&lt;ul&gt;&lt;li&gt;Приемлемая стоимость;&lt;/li&gt;&lt;li&gt;Великолепное сочетание роста и пышности;&lt;/li&gt;&lt;li&gt;Всегда только свежесрезанные деревья, которые подготавливаются к отправке после оформления заказа;&lt;/li&gt;&lt;li&gt;Доставка по Москве и области;&lt;/li&gt;&lt;li&gt;Возможность сэкономить деньги, если вы можете самостоятельно приехать за елкой на склад компании;&lt;/li&gt;&lt;li&gt;Продукция из экологически чистого лесопитомника!&lt;/li&gt;&lt;/ul&gt;&lt;h2&gt;Размещение:&lt;/h2&gt;&lt;p&gt;Ель большого размера устанавливается в объемных помещениях развлекательных и торговых комплексов, вестибюлях коммерческих структур и административных зданий, а также на открытых площадках, на территории скверов. Для надежного размещения необходима стальная или кованая подставка, а также дополнительные крепления ствола и верхушки!&lt;/p&gt;&lt;h2&gt;Применение:&lt;/h2&gt;&lt;p&gt;Елки Сэйл реализует высокие свежесрезанные русские ели в ассортименте. Интернет-магазин предлагает купить ели от 1,0 м до 6,0 м оптом и в розницу. Большой выбор продукции организован для возможности приобретения елей под Новый год и Рождество покупателями с любыми требованиями!&lt;/p&gt;', '3.5-3.75м', '', '', '', ''),
(209, 1, 'Живая сосна обыкновенная срезанная', '&lt;h2&gt;Описание и характеристики:&lt;/h2&gt;&lt;p&gt;Живая новогодняя сосна средней величины. Ровный ствол и равномерное распределение веток по стволу. Яркий зеленый цвет и хвоя, которая длительное время не осыпается, не меняет оттенок, не высыхает.&lt;/p&gt;&lt;p&gt;Размер дерева для украшения залов под Новый год и Рождество – 1,75 - 2,0 м, цена умеренная, всего 2 100 рублей!&lt;/p&gt;&lt;h2&gt;Преимущества:&lt;/h2&gt;&lt;ul&gt;&lt;li&gt;Только свежие деревья, которые выращиваются строго на территории питомника, подготавливаются к отправке и сопровождаются необходимой документацией;&lt;/li&gt;&lt;li&gt;Яркий цвет и стойкий аромат, что наполняет помещение практически сразу;&lt;/li&gt;&lt;li&gt;Равномерная хвоя, которая не подсыхает и не осыпается с веток;&lt;/li&gt;&lt;li&gt;Доставка от 1 шт. по Москве, а также региону, возможен опт и розница!&lt;/li&gt;&lt;/ul&gt;&lt;h2&gt;Размещение:&lt;/h2&gt;&lt;p&gt;Срезанная сосна данного размера устанавливается в подставку из пластика или ковки, которую также можно заказать в нашем интернет-магазине. Растение прекрасно вписывается в жилые помещения, офисы, холлы различных учреждений.&lt;/p&gt;&lt;h2&gt;Применение:&lt;/h2&gt;&lt;p&gt;Новогоднее дерево используется для классического оформление закрытых зон празднования, а также площадок на улице, во дворе!&lt;/p&gt;&lt;p&gt;Мы предлагает купить елки и сосны по приемлемой стоимости. Выбор практически неограничен!&lt;/p&gt;', '1.75-2м', '', '', '', ''),
(111, 1, 'Живая европейская ель в горшке', '&lt;h2&gt;Описание и характеристики:&lt;/h2&gt;&lt;p&gt;Прекрасный экземпляр к Новому году и Рождеству! Красивая европейская ель в горшке с мелкой и ароматной хвоей, насыщенным зеленым цветом и правильной конусообразной формой, размером 1,0 - 1,25 метра. Цена ориентирована на возможности покупателя!&lt;/p&gt;&lt;h2&gt;Преимущества:&lt;/h2&gt;&lt;ul&gt;&lt;li&gt;Главное преимущество живой ели – ее натуральность и аромат;&lt;/li&gt;&lt;li&gt;Каждое дерево выращивается в питомнике на протяжении нескольких лет;&lt;/li&gt;&lt;li&gt;Новогодняя елка правильной формы, свежая и без залысин, с максимальным исключением пожелтевших и сухих фрагментов;&lt;/li&gt;&lt;li&gt;Доставка по Москве и региону!&lt;/li&gt;&lt;/ul&gt;&lt;h2&gt;Размещение:&lt;/h2&gt;&lt;p&gt;Невысокая елка данного размера устанавливается в жилых помещениях, кабинетах и кафе. Удобно располагается на столе, табурете или специальном прочном каркасе из дерева, пластика, стали!&lt;/p&gt;&lt;h2&gt;Применение:&lt;/h2&gt;&lt;p&gt;Компактное растение для украшений праздничных залов и небольших комнат. Хорошо смотрится в групповом оформлении, украшается гирляндами и игрушками!&lt;/p&gt;&lt;p&gt;Елки Сэйл – праздничный интернет-магазин, предлагающий елки, сосны и пихты оптом и в розницу. Выбирайте понравившееся растение, срезанное или в кадке, и заказывайте доставку по столице и области уже сегодня! Купить елку можно по звонку!&lt;/p&gt;', '1-1.25м', '', '', '', ''),
(101, 1, 'Живая норвежская ель в горшке', '&lt;h2&gt;Описание и характеристики:&lt;/h2&gt;  &lt;p&gt;Живая норвежская ель в горшке позволит ярко и оригинально встретить Новый год и Рождество. Это хвойное дерево выращивается в питомниках Европы с применением новейших технологий. Густая крона достигается благодаря регулярной стрижке. &lt;/p&gt;  &lt;p&gt;Хвоя имеет темно-зеленый цвет с легким оттенком оливы и желтоватыми вкраплениями. Подобно другим живым новогодним деревьям источает ярко-выраженный смолистый запах.&lt;/p&gt;  &lt;h2&gt;Преимущества:&lt;/h2&gt;  &lt;ul&gt;   &lt;li&gt;идеально ровный ствол;&lt;/li&gt;   &lt;li&gt;правильное расположение ветвей;&lt;/li&gt;   &lt;li&gt;выраженный хвойный аромат;&lt;/li&gt;   &lt;li&gt;не требует подставки;&lt;/li&gt;   &lt;li&gt;не нуждается в утилизации (высаживается в открытый грунт);&lt;/li&gt;   &lt;li&gt;имеет сертификат качества;&lt;/li&gt;   &lt;li&gt;можно заказать оптом и в розницу.&lt;/li&gt; &lt;/ul&gt;  &lt;h2&gt;Размещение&lt;/h2&gt;  &lt;p&gt;Если купить живую норвежскую ель в горшке небольшого размера, то ею можно украсить барную стойку, каминную полку, стол шефа, тумбочку сотрудника и другие элементы мебели.&lt;/p&gt;  &lt;h2&gt;Применение:&lt;/h2&gt;  &lt;p&gt;Это идеальный вариант для новогоднего оформления любых помещений без использования подставки. Применяется в декоративных целях с возможностью пересадки на участок за городом или территорию у дома. &lt;/p&gt;  &lt;p&gt;Заказывайте новогодние деревья в Москве по доступной цене в нашем интернет-магазине. Доставка строго из питомника.  &lt;/p&gt;', '1-1.25м', '', '', '', ''),
(104, 1, 'Живая голубая ель срезанная', '&lt;h2&gt;Описание и характеристики&lt;/h2&gt;&lt;p&gt;Живая голубая ель срезанная – это отличное решение для создания в доме праздничной атмосферы в канун Нового года и Рождества. Наши хвойные деревья имеют идеальное качество, оптимальные размеры и приемлемые цены.&lt;/p&gt;&lt;h2&gt;Преимущества:&lt;/h2&gt;&lt;ul&gt;&lt;li&gt;густая хвоя приятной голубоватой или серебристой окраски;&lt;/li&gt;&lt;li&gt;симметричная форма кроны является хорошим фоном для новогодних украшений;&lt;/li&gt;&lt;li&gt;выраженный запах смолы наполняет помещение полезными для здоровья эфирными маслами;&lt;/li&gt;&lt;li&gt;долго сохраняет хвою при установке в специальную подставку с водой;&lt;/li&gt;&lt;li&gt;имеет сертификаты качества;&lt;/li&gt;&lt;li&gt;налаженная доставка по Москве и области.&lt;/li&gt;&lt;/ul&gt;&lt;h2&gt;Размещение&lt;/h2&gt;&lt;p&gt;Если купить живую голубую ель срезанную 1.75-2.00 м, то ею можно украсить домашнюю обстановку, офисное помещение, торговый центр и другие общественные места. Держать дерево лучше подальше от отопительных приборов. &lt;/p&gt;&lt;h2&gt;Применение&lt;/h2&gt;&lt;p&gt;Нравятся живые голубые ели? Интернет-магазин Elki.sale – это отличное место для их покупки. Наши деревья выращены в специализированных питомниках, поэтому имеют безупречный внешний вид. Свежесрезанная елка подарит взрослым и детям массу позитивных эмоций и обеспечит приятное времяпрепровождение во время рождественских каникул.&lt;/p&gt;', '1.75-2м', '', '', '', ''),
(105, 1, 'Живая голубая ель срезанная', '&lt;h2&gt;Описание и характеристики&lt;/h2&gt;&lt;p&gt;Живая голубая ель срезанная на Новый год и Рождество – это главный атрибут зимних праздников. Елка, попадая в дом, наполняет воздух природным хвойным ароматом, который имеет в своем составе полезные эфирные масла и фитонциды. Пышная хвоя имеет серебристый, сизый или голубоватый оттенок. &lt;/p&gt;&lt;h2&gt;Преимущества:&lt;/h2&gt;&lt;ul&gt;&lt;li&gt;экологически чистые новогоднего дерева выращено в лучших питомниках страны;&lt;/li&gt;&lt;li&gt;вещества, присутствующие в хвойном аромате, очищают воздух от патогенных бактерий;&lt;/li&gt;&lt;li&gt;пушистая крона станет красивым фоном для шаров, мишуры и других новогодних украшений;&lt;/li&gt;&lt;li&gt;на деревьях нет никаких прорех, залысин и других физических дефектов. &lt;/li&gt;&lt;/ul&gt;&lt;h2&gt;Размещение&lt;/h2&gt;&lt;p&gt;Чтобы установить живую голубую ель срезанную в помещении, потребуется специальная подставка – пластиковая или кованая. Лесная красавица размером 1.5-1.75 м отлично впишется в жилое помещение, торговый и выставочный комплекс, супермаркет, холл офиса, вестибюль учреждения. &lt;/p&gt;&lt;h2&gt;Применение:&lt;/h2&gt;&lt;p&gt;Традиционно елка является элементом декоративного оформления пространства к встрече Нового года. Купить голубую елку отличного качества по доступной цене можно в интернет-магазине Elki.sale с доставкой по Москве. Живая елка наполнит территорию бодрящим запахом, окунет всех в атмосферу праздника и позитива. &lt;/p&gt;', '1.5-1.75м', '', '', '', ''),
(106, 1, 'Живая канадская сосна срезанная', '&lt;p&gt;Каждый раз незадолго до наступления Нового года, наши соотечественники решают вопрос, какое дерево купить в качестве главного атрибута праздника. Несмотря на то, что приоритеты могут меняться, живая канадская сосна срезанная всегда пользуется повышенным спросом среди жителей Москвы. Такая популярность обеспечивается отличными характеристиками, которыми обладает это новогоднее дерево.&lt;/p&gt;&lt;h2&gt;Преимущества:&lt;/h2&gt;&lt;ul&gt;&lt;li&gt;повышенная стойкость;&lt;/li&gt;&lt;li&gt;очень пушистая крона;&lt;/li&gt;&lt;li&gt;сильно выраженный смолистый запах;&lt;/li&gt;&lt;li&gt;ярко-изумрудный цвет хвои;&lt;/li&gt;&lt;li&gt;длинные иголки мягкой фактуры;&lt;/li&gt;&lt;li&gt;правильная цилиндрическая форма кроны.&lt;/li&gt;&lt;/ul&gt;&lt;h2&gt;Размещение:&lt;/h2&gt;&lt;p&gt;Чтобы живая канадская сосна срезанная без хлопот перенесла Новый год и Рождество, установите ее в специальную емкость с водой подальше от отопительных приборов. Дерево размером 1.25-1.5 м – идеальный вариант для размещения на барной и административной стойке, каминной полке, тумбочке и других предметах мебели.&lt;/p&gt;&lt;h2&gt;Применение:&lt;/h2&gt;&lt;p&gt;Эта заморская гостья понравится тем, кто в качестве новогоднего атрибута предпочитает сосну. Не упустите и вы свой шанс зарядиться позитивом на Новый год!&lt;/p&gt;&lt;p&gt;Купить канадскую сосну по доступной цене можно в интернет-магазине Elki.sale. Доставка самовывозом или курьером компании.&lt;/p&gt;', '1.25-1.5м', '', '', '', ''),
(107, 1, 'Живая норвежская ель в горшке', '&lt;h2&gt;Описание и характеристики:&lt;/h2&gt;  &lt;p&gt;Если вы мечтаете весело и ярко встретить Новый год, то можно купить живую норвежскую ель в горшке. Бродящий хвойный запах, красивая пушистая крона – новогоднее дерево идеального качества! &lt;/p&gt;  &lt;p&gt;Это разновидность ели обыкновенной только улучшенной селекционерами. Сорт подходит для суровых российских зим, поэтому после праздников норвежскую елку можно высадить в грунт. У нее большие шансы прижиться на приусадебном участке.&lt;/p&gt;  &lt;h2&gt;Преимущества:&lt;/h2&gt;  &lt;ul&gt;   &lt;li&gt;правильная конусовидная форма кроны;&lt;/li&gt;   &lt;li&gt;яркий изумрудный оттенок хвои;&lt;/li&gt;   &lt;li&gt;очень пушистые равномерно расположенные ветки;&lt;/li&gt;   &lt;li&gt;приятный запах смолы;&lt;/li&gt;   &lt;li&gt;небольшие иголки.&lt;/li&gt; &lt;/ul&gt;  &lt;h2&gt;Размещение:&lt;/h2&gt;  &lt;p&gt;Живая норвежская ель в горшке устанавливается без подставки. Ее можно разместить как на полу, так и предметах мебели. Дерево среднего размера подходит для новогоднего оформления общественных заведений, кабинетов, холлов, квартир и домов.&lt;/p&gt;  &lt;h2&gt;Применение:&lt;/h2&gt;  &lt;p&gt;Поставьте норвежскую ель в горшке в двадцатых числах декабря, и она идеально справится с ролью главного украшения праздника вплоть до Рождества.&lt;/p&gt;  &lt;p&gt;Наш интернет-магазин в Москве реализует ели, пихты, сосны высокого качества по приемлемой цене с удобной доставкой на дом или в офис.&lt;/p&gt;', '1.25-1.5м', '', '', '', ''),
(118, 1, 'Живая датская ель срезанная', '&lt;h2&gt;Описание и характеристики:&lt;/h2&gt;&lt;p&gt;Красивая новогодняя елка конусовидной формы, изумрудно-зеленая с приятным, слегка терпким ароматом, который еще более дополнит праздничную обстановку в доме! Размер живой елки – 0,8-1 м.&lt;/p&gt;&lt;h2&gt;Преимущества:&lt;/h2&gt;&lt;ul&gt;&lt;li&gt;Короткие и не очень колючие иглы, что снижает опасность пораниться;&lt;/li&gt;&lt;li&gt;Иголки крепко держатся даже в момент подсыхания растения, не осыпаются и не становятся мусором;&lt;/li&gt;&lt;li&gt;Приятный аромат, который сразу наполняет все помещение;&lt;/li&gt;&lt;li&gt;Растение очень пышное, все елки выращены по определенному стандарту, что исключает возможность сложных дефектов формы!&lt;/li&gt;&lt;/ul&gt;&lt;h2&gt;Размещение:&lt;/h2&gt;&lt;p&gt;Живая датская ель срезанная очень удобна для размещения в любой комнате или праздничном зале. Может устанавливаться на специальную подставку, в ведро, контейнер, ящик с песком, сварную стальную крестовину. Компактная праздничная ель помещается на столе, тумбе, широкой каминной полке, подвешивается в контейнере или размещается на полу.&lt;/p&gt;&lt;h2&gt;Применение:&lt;/h2&gt;&lt;p&gt;Покупая натуральную елку на Новый год и Рождество, вы получаете не просто праздничное дерево, но и элемент украшения интерьера на период празднования. Она отлично смотрится с игрушками, серпантином, гирляндами.&lt;/p&gt;&lt;p&gt;Наш интернет-магазин предлагает купить елку с доставкой по Москве. Только качественная продукция, цена которой приемлема для каждого нашего покупателя! Заказ оптом и в розницу!&lt;/p&gt;', '0.8-1м', '', '', '', ''),
(236, 1, 'Живая пихта Фразера срезанная', '&lt;h2&gt;Описание и характеристики:&lt;/h2&gt;&lt;p&gt;Срезанная пихта размером 3,25 - 3,5 м – высокое и стройное растение, выделяющееся среди других конкурентов на Новый год и Рождество своей элегантностью.&lt;/p&gt;&lt;p&gt;Великолепная структура разветвления, строгость конусообразной формы и безукоризненное покрытие изумрудно-зеленой хвоей!&lt;/p&gt;&lt;h2&gt;Преимущества:&lt;/h2&gt;&lt;ul&gt;&lt;li&gt;Интернет-магазин предлагает только свежие пихты, ели и сосны;&lt;/li&gt;&lt;li&gt;Доставка прямиком из экологически чистого питомника;&lt;/li&gt;&lt;li&gt;Развозка по Москве и области, возможность сотрудничества – опт и розница;&lt;/li&gt;&lt;li&gt;Растения идеальной формы, без физических дефектов;&lt;/li&gt;&lt;li&gt;Вся продукция сертифицирована!&lt;/li&gt;&lt;/ul&gt;&lt;h2&gt;Размещение:&lt;/h2&gt;&lt;p&gt;Величина пихты более трех метров диктует правила размещения и установки. Только объемные помещения в соответствии с размером и диаметром: актовые залы, холлы, вестибюли, или же установка на открытых площадках посредством надежного закрепления ствола дерева в стальную конструкцию!&lt;/p&gt;&lt;h2&gt;Применение:&lt;/h2&gt;&lt;p&gt;Пихта Фразера используется в качестве красивого и действительно достойного украшения любого новогоднего праздника!&lt;/p&gt;&lt;p&gt;Елки Сэйл предлагает выбрать живую ель или пихту, а также оформить заказ заранее, чтобы не забыть купить основной символ празднования Нового года, не дождаться наступления времени ажиотажа и повышения цены!&lt;/p&gt;', '3.25-3.5м', '', '', '', ''),
(120, 1, 'Живая норвежская ель в горшке', '&lt;h2&gt;Описание и характеристики:&lt;/h2&gt;  &lt;p&gt;В преддверии Нового года и Рождества вопрос, какую елку купить, становиться самым актуальным. Каждый хочет, чтобы новогоднее деревце было красивым, пушистым, необычным. Именно эти характеристики присущи живой норвежской ели в горшке, которая станет достойным украшением дома, офиса, общественного заведения.&lt;/p&gt;  &lt;h2&gt;Преимущества:&lt;/h2&gt;  &lt;ul&gt;   &lt;li&gt;живое хвойное дерево источает ярко выраженный бодрящий аромат;&lt;/li&gt;   &lt;li&gt;пушистая крона имеет приятный изумрудный отлив;&lt;/li&gt;   &lt;li&gt;растение с хорошо развитой корневой системой имеет большие шансы прижиться на приусадебном участке;&lt;/li&gt;   &lt;li&gt;доставка деревьев по Москве строго из питомника с наличием сертификата качества.&lt;/li&gt; &lt;/ul&gt;  &lt;h2&gt;Размещение:&lt;/h2&gt;  &lt;p&gt;Живую норвежскую ель в горшке размером 1.5-1.75 м можно установить на полу холла или гостиной подальше от радиаторов отопления. Своевременный полив убережет дерево от преждевременной потери иголок. Дерево используется без подставки.&lt;/p&gt;  &lt;h2&gt;Применение:&lt;/h2&gt;  &lt;p&gt;Норвежская елочка легко создаст приятную атмосферу волшебства и зарядит отличным настроением детей и взрослых на все новогодние праздники.&lt;/p&gt;  &lt;p&gt;В нашем интернет-магазине огромный выбор живых елей, сосен, пихт разного размера по доступной цене. &lt;/p&gt;', '1.5-1.75м', '', '', '', ''),
(121, 1, 'Живая канадская сосна срезанная', '&lt;h2&gt;Описание и характеристики:&lt;/h2&gt;&lt;p&gt;Живая канадская сосна срезанная позволит привнести в дом праздничную атмосферу, наполненную счастьем и волшебством. Эта ароматная и очень пушистая лесная гостья украшает на Рождество дома людей по всему миру. Свежесрезанная сосна способна простоять в специальной емкости с водой вплоть до окончания новогодних праздников, радуя хозяев своим прекрасным внешним видом.&lt;/p&gt;&lt;h2&gt;Преимущества:&lt;/h2&gt;&lt;ul&gt;&lt;li&gt;мягкие длинные иголки ярко-зеленого цвета густо посажены на веточках, закрывающих весь ствол;&lt;/li&gt;&lt;li&gt;форма в виде правильного конуса с округлой верхушкой;&lt;/li&gt;&lt;li&gt;приятный запах смолы, богатый на полезные для здоровья фитонциды;&lt;/li&gt;&lt;li&gt;имеет сертификаты качества;&lt;/li&gt;&lt;li&gt;реализуется с доставкой по Москве.&lt;/li&gt;&lt;/ul&gt;&lt;h2&gt;Размещение:&lt;/h2&gt;&lt;p&gt;Для сосны канадской не нужно тщательно подбирать место размещения в помещении. Небольшое новогоднее дерево размером 1.5-1.7 м можно купить для установки в офисе, квартире, коттедже, на даче.&lt;/p&gt;&lt;h2&gt;Применение:&lt;/h2&gt;&lt;p&gt;Живая канадская сосна срезанная не нуждается в богатом убранстве. Даже без новогодних игрушек и мишуры на веточках дерево подарит праздничное настроение и подготовит всех обитателей дома для прекрасной встречи Нового года.&lt;/p&gt;&lt;p&gt;Чтобы оформить заказ новогоднего дерева в нашем интернет-магазине, позвоните по телефону или закажите обратный звонок.&lt;/p&gt;', '1.5-1.75м', '', '', '', ''),
(242, 1, 'Живая русская ель срезанная', '&lt;h2&gt;Описание и характеристики:&lt;/h2&gt;&lt;p&gt;Уникальное хвойное дерево для того чтобы отметить Новый год и Рождество с настоящим символом данных праздников – живой русское елью.&lt;/p&gt;&lt;p&gt;Свежесрезанная натуральная елка размером 4,5 - 5,0 м станет украшение открытой площадки или большого холла. Пышная, ярко-зеленая, с мягкой хвоей и красивой кроной ель, купить которую можно всего за 14 800 рублей!&lt;/p&gt;&lt;h2&gt;Преимущества:&lt;/h2&gt;&lt;ul&gt;&lt;li&gt;Правильная форма дерева, равнорастущие вверх ветки, а также короткая мягкая хвоя;&lt;/li&gt;&lt;li&gt;Насыщенный цвет с отливом и блеском;&lt;/li&gt;&lt;li&gt;Терпкий лесной аромат;&lt;/li&gt;&lt;li&gt;Приемлемая цена на новогоднее дерево данного размера;&lt;/li&gt;&lt;li&gt;Срез только после вашего заказа – ель свежая и без подсохших фрагментов;&lt;/li&gt;&lt;li&gt;Сертификат в комплекте!&lt;/li&gt;&lt;/ul&gt;&lt;h2&gt;Размещение:&lt;/h2&gt;&lt;p&gt;Срезанная ель подходит для установки в вестибюлях и холлах, праздничных залах, которые позволяют принять на своей площади дерево такой величины. Для установки потребуется пластиковая, стальная или кованая подставка!&lt;/p&gt;&lt;h2&gt;Применение:&lt;/h2&gt;&lt;p&gt;Русская ель используется в качестве декоративного украшения открытых и закрытых территорий на новогодние праздники.&lt;/p&gt;&lt;p&gt;Елки Сэйл – интернет-магазин, предоставляющий большой ассортимент елок и сосен оптом и в розницу. Только лучшие предложения, а также доставка по Москве и области!&lt;/p&gt;', '4.5-5м', '', '', '', ''),
(123, 1, 'Живая европейская ель в горшке', '&lt;h2&gt;Описание и характеристики:&lt;/h2&gt;&lt;p&gt;Живая европейская ель специально для вашего дома, под Новый год и Рождество! Красивое новогоднее растение с правильной, ровной формой ствола и конусообразной кроной, раскидными ветвями с равномерным покрытием изумрудного цвета хвоей. Размер елки – 1,25 - 1,5 м!&lt;/p&gt;&lt;h2&gt;Преимущества:&lt;/h2&gt;&lt;ul&gt;&lt;li&gt;Компактный размер елки для украшения небольших жилых помещений;&lt;/li&gt;&lt;li&gt;Великолепное построение ветвей на стволе – перпендикулярно и ниспадая;&lt;/li&gt;&lt;li&gt;Новогоднее дерево пышное и зеленое, без дефектов – качество тщательно проверяется при отправке;&lt;/li&gt;&lt;li&gt;Экологическое выращивание в лесопитомнике;&lt;/li&gt;&lt;li&gt;Сертификат качества и соответствия к каждому растению, доставка по Москве!&lt;/li&gt;&lt;/ul&gt;&lt;h2&gt;Размещение:&lt;/h2&gt;&lt;p&gt;Небольшая елка размером до полутора метров – оптимальна для размещения в помещениях площадью в 10-12 квадратных метров. &lt;/p&gt;&lt;h2&gt;Применение:&lt;/h2&gt;&lt;p&gt;Европейская ель – классическое растение для украшения любой внутренней зоны празднования. Сочетается с любым типом гирлянд и игрушек, выступает основным элементом при оформлении входной зоны.&lt;/p&gt;&lt;p&gt;Елки Сэйл предлагает купить новогодние деревья по лучшей цене. Опт и розница от нашего интернет-магазина, а также доставка по области!&lt;/p&gt;', '1.25-1.5м', '', '', '', ''),
(202, 1, 'Подставки для елки с водой', '&lt;p&gt;Если вы покупаете &lt;a href=&quot;/el/zhivaya-srezannaya/&quot;&gt;высокую ель&lt;/a&gt; или пихту, вам следует задуматься о ее безопасном размещении и установке в помещении. Новогоднее дерево должно быть не только праздничным, но и максимально безопасным, чтобы не нанести вреда окружающим его людям.&lt;/p&gt;&lt;p&gt;Наш интернет-магазин предлагает купить лучшие елки и сосны в Москве и области, а также рекомендует выбрать пластмассовую подставку &quot;Питер большая&quot; для их установки!&lt;/p&gt;&lt;h2&gt;Пластиковая подставка под елку: преимущества&lt;/h2&gt;&lt;p&gt;В чем положительные особенности данной подставки?&lt;/p&gt;&lt;ul&gt;&lt;li&gt;Она прекрасно подходит для елок и &lt;a href=&quot;/sosna/zhivaya-sosna-srezannaya/&quot;&gt;сосен среднего размера и выше&lt;/a&gt;, размещаемых в квартирах и домах;&lt;/li&gt;&lt;li&gt;Большая площадь опирания, что исключает опрокидывание растения набок;&lt;/li&gt;&lt;li&gt;Пластиковая подставка оснащена надежными фиксаторами ствола, а также резервуаром, наполняемым жидкостью для подпитки дерева и увеличения срока его эксплуатации;&lt;/li&gt;&lt;li&gt;Подставка изготовлена из качественного пластика, что обеспечивает продолжительный срок службы!&lt;/li&gt;&lt;/ul&gt;&lt;p&gt;Елки Сэйл – это живые и срезанные елки из лесопитомника на Новый год и Рождество. Лучшие цены и быстрая доставка по региону, а также консультации специалистов по любой продукции, приобретаемой у нас. Звоните и оформляйте заказ!&lt;/p&gt;', '', '', '', '', ''),
(203, 1, 'Живая пихта Фразера срезанная', '&lt;h2&gt;Описание и характеристики:&lt;/h2&gt;&lt;p&gt;Срезанная пихта повышенной пышности хвои, равномерным покрытием иголками, а также конусообразной кроной.&lt;/p&gt;&lt;p&gt;Ствол ровный, окрас зеленый без вкрапления грязных оттенков. Размер предложенного новогоднего дерева – 1,75 - 2,0 м, цена в нашем интернет-магазине – 9 500 рублей!&lt;/p&gt;&lt;h2&gt;Преимущества:&lt;/h2&gt;&lt;ul&gt;&lt;li&gt;Великолепное растение для оформления помещений на Новый год и Рождество;&lt;/li&gt;&lt;li&gt;Возможность использования растения данного размера в любом закрытом помещении, а также на улице, в виду украшения для празднования частных территорий;&lt;/li&gt;&lt;li&gt;Экологически чистая продукция, что подтверждают сертификаты;&lt;/li&gt;&lt;li&gt;Доставка по Москве, самовывоз, реализация оптом и в розницу!&lt;/li&gt;&lt;/ul&gt;&lt;h2&gt;Размещение:&lt;/h2&gt;&lt;p&gt;Двухметровая пихта Фразера устанавливается в комнатах, кабинетах, ресторанах, торговых комплексах. Безопасное размещение требует использования подставок для деревьев соответствующих параметров. Предлагаем пластиковые и кованые подставки!&lt;/p&gt;&lt;h2&gt;Применение:&lt;/h2&gt;&lt;p&gt;Ель, сосна или пихта – обязательный атрибут оформления праздничного помещения. Дополнительно применяется украшение световой декорацией, игрушками.&lt;/p&gt;&lt;p&gt;Предлагаем купить пихты по лучшей цене в регионе! Для заказа достаточно позвонить по указанным контактам!&lt;/p&gt;', '1.75-2м', '', '', '', ''),
(204, 1, 'Живая сосна обыкновенная срезанная', '&lt;h2&gt;Описание и характеристики:&lt;/h2&gt;&lt;p&gt;Живая срезанная сосна среднего размера для оформления зон празднования новогодних праздников! Ровная, свежая, с неосыпающейся хвоей, ярко-зеленая и ароматная.&lt;/p&gt;&lt;p&gt;Размер сосны обыкновенной – 1,5 - 1,75 м, цена – 1 700 рублей!&lt;/p&gt;&lt;h2&gt;Преимущества:&lt;/h2&gt;&lt;ul&gt;&lt;li&gt;Ровный ствол и равномерно сложенная конусообразная крона, которая при большем росте дерева может быть и более округлой;&lt;/li&gt;&lt;li&gt;Размер дерева средний – идеально для помещений площадью 15-20 квадратных метров;&lt;/li&gt;&lt;li&gt;Яркий зеленый окрас, привычный цвет, классическое дерево для Нового года и Рождества;&lt;/li&gt;&lt;li&gt;Приятный аромат, который отдает осенним хвойным лесом;&lt;/li&gt;&lt;li&gt;Длинные иглы парами, крепко посаженные, не желтеют и не осыпаются;&lt;/li&gt;&lt;li&gt;Каждая сосна и елка из нашего интернет-магазина сертифицирована!&lt;/li&gt;&lt;/ul&gt;&lt;h2&gt;Размещение:&lt;/h2&gt;&lt;p&gt;Сосна устанавливается на деревянную, стальную или пластиковую крестовину, крепление с фиксаторами, в ящик или контейнер. Соответствует требованиям новогоднего оформления внутренних помещений!&lt;/p&gt;&lt;h2&gt;Применение:&lt;/h2&gt;&lt;p&gt;У нас вы можете купить сосну для праздничного украшения помещений и открытых зон. Новогодние деревья идеально сочетаются с иллюминацией и праздничными игрушками. Доставка по Москве оптом и в розницу!&lt;/p&gt;', '1.5-1.75м', '', '', '', ''),
(205, 1, 'Живая русская ель в горшке', '&lt;h2&gt;Описание и характеристики:&lt;/h2&gt;&lt;p&gt;Невысокая живая ель в горшке – прекрасный символ новогодних праздников! Русская елка имеет следующие особенности: пышная хвоя, пряморастущие вверх ветви, насыщенная окраска, приятный хвойный аромат. Размер дерева на Новый год и Рождество – 1,0 - 1,25 м, цена умеренная для столичного рынка.&lt;/p&gt;&lt;h2&gt;Преимущества:&lt;/h2&gt;&lt;ul&gt;&lt;li&gt;Живое растение из лесопитомника;&lt;/li&gt;&lt;li&gt;Продолжительный срок эксплуатации, при пересадке в грунт – десятки лет;&lt;/li&gt;&lt;li&gt;Возможность задействовать растение в ландшафтном дизайне;&lt;/li&gt;&lt;li&gt;Стройное и красивое дерево с неосыпающейся хвоей;&lt;/li&gt;&lt;li&gt;Доставка от одной елки по всей Москве и региону, хорошие ценовые предложения для опта и розницы!&lt;/li&gt;&lt;/ul&gt;&lt;h2&gt;Размещение:&lt;/h2&gt;&lt;p&gt;Русская елка в горшке устанавливается на полу или основании – стол, тумба, полка. Данный размер не требует дополнительного закрепления. Возможно размещение в жилых комнатах, торговых залах, кабинетов административных, муниципальных организаций, холлах и вестибюлях.&lt;/p&gt;&lt;h2&gt;Применение:&lt;/h2&gt;&lt;p&gt;В качестве новогоднего растения с украшениями и иллюминацией, для улучшения оформления ландшафта!&lt;/p&gt;&lt;p&gt;Наш интернет-магазин рекомендует купить русскую ель в горшке. Данное растение многие годы будет радовать вас, а также сэкономит расходы в будущем!&lt;/p&gt;', '1-1.25м', '', '', '', ''),
(128, 1, 'Живая голубая ель в горшке', '&lt;h2&gt;Описание и характеристики:&lt;/h2&gt;&lt;p&gt;Голубая елка – оригинальное хвойное дерево на новогодние праздники. Раскидная конусообразная форма, правильное формирование ветвей и побегов, идеальный равномерный окрас и колючая жесткая хвоя!&lt;/p&gt;&lt;p&gt;Размер предложенного образца – 1,0 - 1,25 м, цена – 6 200 рублей!&lt;/p&gt;&lt;h2&gt;Преимущества:&lt;/h2&gt;&lt;ul&gt;&lt;li&gt;Дерево на Новый год и Рождество, которое не придется выносить и выбрасывать впоследствии;&lt;/li&gt;&lt;li&gt;Прекрасный внешний вид, хвоя, которая плавно меняет окрас в процессе взросления растения, от голубого до зеленого, и даже сизого и белого цвета;&lt;/li&gt;&lt;li&gt;Приятный аромат в помещении, лесной и терпкий;&lt;/li&gt;&lt;li&gt;Отличное предложение от интернет-магазина Елки Сэйл – все популярные размеры, а также доставка по Москве!&lt;/li&gt;&lt;/ul&gt;&lt;h2&gt;Размещение:&lt;/h2&gt;&lt;p&gt;Декоративное растение небольшой величины в собственной кадке устанавливается на пол или небольшую подставку, возможно, тумбу или стол. Подходит для украшения квартир и домов, кафе и ресторанов!&lt;/p&gt;&lt;h2&gt;Применение:&lt;/h2&gt;&lt;p&gt;Растение используется в роли основного символа зимних праздников, а также в ландшафтном дизайне по их окончанию!&lt;/p&gt;&lt;p&gt;Мы предлагаем хвойные деревья оптом и в розницу, купить которые можно по действительно приемлемой стоимости с отправкой по адресу в тот же день!&lt;/p&gt;', '1-1.25м', '', '', '', ''),
(129, 1, 'Живая датская ель в горшке', '&lt;h2&gt;Описание и характеристики:&lt;/h2&gt;&lt;p&gt;Живая датская елка в горшке размером 1,0 - 1,25 м – красивое новогоднее растение с особенными характеристиками: короткая жесткая хвоя, густое покрытие каждой веточки, ровный ствол и очень опрятный внешний вид в целом. Цена елки на Новый год и Рождество – 7 500 рублей!&lt;/p&gt;&lt;h2&gt;Преимущества:&lt;/h2&gt;&lt;ul&gt;&lt;li&gt;Живое растение в горшке не выбрасывается после праздников, а остается с вами на всю жизнь;&lt;/li&gt;&lt;li&gt;Датская елка – удивительно милое и симпатичное вечнозеленое растение;&lt;/li&gt;&lt;li&gt;Пышное, густо покрытое хвоей, ароматное и стройное новогоднее дерево;&lt;/li&gt;&lt;li&gt;Поставки напрямую из питомника!&lt;/li&gt;&lt;/ul&gt;&lt;h2&gt;Размещение:&lt;/h2&gt;&lt;p&gt;Найти место маленькой елке очень просто – любая зона украшения помещения. Также можно использовать и на открытых уличных площадках.&lt;/p&gt;&lt;p&gt;Елке в горшке не требуется дополнительное основание для установки.&lt;/p&gt;&lt;h2&gt;Применение:&lt;/h2&gt;&lt;p&gt;Живые ели применяются в качестве центрального украшения праздничного зала, входной группы, скверов. При этом елка в горшке может быть высажена на участке или перенесена в контейнер размером побольше.&lt;/p&gt;&lt;p&gt;Интернет-магазин Елки Сэйл, в котором вы можете купить елки и пихты, предлагает выбрать именно растение в горшке. Возможен заказ оптом и в розницу с быстрой доставкой по Москве!&lt;/p&gt;', '1-1.25м', '', '', '', ''),
(235, 1, 'Живая русская ель срезанная', '&lt;h2&gt;Описание и характеристики:&lt;/h2&gt;&lt;p&gt;Натуральная русская ель размером практически в 3 этажа! Величественное новогоднее растение пирамидальной формы и равным расположением идентичных по размеру ветвей. Насыщенный зеленый цвет и элегантная пышность.&lt;/p&gt;&lt;p&gt;Размер елки – 9,0 - 10,0 м, купить елку можно по звонку!&lt;/p&gt;&lt;h2&gt;Преимущества:&lt;/h2&gt;&lt;ul&gt;&lt;li&gt;Выращивание елок и сосен для нашего интернет-магазина только с учетом всех требований, в природном питомнике;&lt;/li&gt;&lt;li&gt;Получения для реализации только тех образцов, которые полностью соответствуют требованиям рынка;&lt;/li&gt;&lt;li&gt;Красивое и видное растение для Нового года и Рождества, которое украсит место массового празднования;&lt;/li&gt;&lt;li&gt;Великолепный равномерный зеленый цвет и хвоя, которая долго не осыпается;&lt;/li&gt;&lt;li&gt;В комплекте все необходимые документы!&lt;/li&gt;&lt;/ul&gt;&lt;h2&gt;Размещение:&lt;/h2&gt;&lt;p&gt;Русскую ель данного размера сложно установить в холле или вестибюле, хотя, если это позволяют сделать параметры зала, это выполнимо. Чаще, десятиметровые елки украшают парки и скверы, закрытые частные территории!&lt;/p&gt;&lt;p&gt;Установка с учетом размера, на стальной каркас повышенной устойчивости и надежности!&lt;/p&gt;&lt;h2&gt;Применение:&lt;/h2&gt;&lt;p&gt;Вечнозеленое дерево используется для оформления открытых участков под новогодние праздники. Прекрасно сочетается с декоративной иллюминацией!&lt;/p&gt;&lt;p&gt;Елки Сэйл – единственный поставщик, способный организовать доставку по Москве елок подобных размеров. Обращайтесь, цена на наши предложения всегда на приемлемом уровне, независимо от опта и розницы!&lt;/p&gt;', '9-10м', '', '', '', ''),
(131, 1, 'Живая датская ель срезанная', '&lt;h2&gt;Описание и характеристики:&lt;/h2&gt;&lt;p&gt;Датская ель – искусственно выведенное новогоднее растение для покрытия повышенного спроса на компактные и красивые ели. Праздничное дерево отличается практически идеальной формой с идентичным размером веток и короткой хвоей. Размер срезанной елки – 1,25-1,5 м, невысокая цена.&lt;/p&gt;&lt;h2&gt;Преимущества:&lt;/h2&gt;&lt;ul&gt;&lt;li&gt;Яркий и насыщенный темно-зеленый цвет хвои с сильным отблеском;&lt;/li&gt;&lt;li&gt;Приятный и нежный аромат, наполняющий помещение весь период празднования;&lt;/li&gt;&lt;li&gt;Густая, правильной формы крона;&lt;/li&gt;&lt;li&gt;Средний размер елки, позволяющий установить праздничное дерево в помещении любой площади!&lt;/li&gt;&lt;/ul&gt;&lt;h2&gt;Размещение:&lt;/h2&gt;&lt;p&gt;Интернет-магазином предлагается специальная пластиковая подставка с фиксаторами, а также кованая подставка для елки. Кроме этого, вы можете установить дерево в контейнере, деревянном или фанерном ящике, на стальную крестовину в любом помещении, на полу или тумбе!&lt;/p&gt;&lt;h2&gt;Применение:&lt;/h2&gt;&lt;p&gt;Срезанные елки определяются только в качестве украшения помещений на Новый год и Рождество. У нас вы можете купить оптом и в розницу и елки в горшках!&lt;/p&gt;&lt;p&gt;Предлагаем только лучшую продукцию, свежий срез под требования заказчика, а также доставку елок по Москве. Выбирайте, звоните и заказывайте. Наши менеджеры ответят на все вопросы!&lt;/p&gt;', '1.25-1.5м', '', '', '', ''),
(132, 1, 'Живая канадская сосна срезанная', '&lt;h2&gt;Описание и характеристики:&lt;/h2&gt;&lt;p&gt;Канадская сосна – это исключительное хвойное дерево, завораживающее своей красотой и ароматом. Если вы хотите купить на Новый год и Рождество что-то необыкновенное, то именно живая канадская сосна срезанная подарит вам те потрясающие и яркие эмоции, которые знакомы всем нам с детства. Ее красота – это не только природная особенность, но и кропотливый труд работников питомника.&lt;/p&gt;&lt;h2&gt;Преимущества:&lt;/h2&gt;&lt;ul&gt;&lt;li&gt;ярко-изумрудный цвет хвои придает новогоднему дереву неповторимый облик;&lt;/li&gt;&lt;li&gt;конусовидная густая крона с округлой верхушкой позволяет использовать минимум украшения; &lt;/li&gt;&lt;li&gt;за счет мягкой фактуры и крупному размеру опавшие иголки легко убираются с пола;&lt;/li&gt;&lt;li&gt;сосна долго радует своих хозяев прекрасным видом;&lt;/li&gt;&lt;li&gt;приятный хвойный аромат наполняет помещение сказочной атмосферой.&lt;/li&gt;&lt;/ul&gt;&lt;h2&gt;Размещение:&lt;/h2&gt;&lt;p&gt;Живую канадскую сосну срезанную можно разместить на полу жилого или офисного помещения, в холе торгового центра или гостиного дома. Чтобы сохранить свежесть, дерево лучше поставить в емкость с водой и подальше от отопительных приборов.&lt;/p&gt;&lt;h2&gt;Применение:&lt;/h2&gt;&lt;p&gt;Если купить живое дерево в нашем интернет-магазине, то появляется шанс иметь прекрасное настроение не только на сам праздник, но и вплоть до Рождества. Канадская сосна вам его гарантирует! &lt;/p&gt;&lt;p&gt;В нашем каталоге хвойные деревья разных видов, размеров, цены. Выбирайте подходящий вариант и заказывайте доставку по Москве или используйте самовывоз со склада.&lt;/p&gt;', '2-2.25м', '', '', '', ''),
(195, 1, 'Жидкость для елок Bona Forte', '&lt;p&gt;Жидкость для елок Bona Forte – это универсальное средство, способствующее продлению жизни новогодних елок, пихт, сосен. В ней содержится весь комплекс веществ, которые способствуют долгому сохранению свежего вида хвойных растений, препятствуют появлению неприятного запаха и осыпанию иголок.&lt;/p&gt;&lt;h2&gt;Преимущества:&lt;/h2&gt;&lt;ul&gt;&lt;li&gt;простое применение согласно инструкции: 2 колпачка жидкости разводится в 1.5 л чистой воды;&lt;/li&gt;&lt;li&gt;чтобы как можно раньше поселить в доме новогоднюю сказку, можно купить елку задолго до праздников;&lt;/li&gt;&lt;li&gt;имеет сертификаты качества;&lt;/li&gt;&lt;li&gt;доступная цена.&lt;/li&gt;&lt;/ul&gt;&lt;h2&gt;Размещение:&lt;/h2&gt;&lt;p&gt;Вода с разведенной жидкостью добавляется в подставку для новогоднего дерева. Это отличный вариант для поддержания внешнего вида елок, сосен, можжевельников, кедров, туй и прочих хвойных растений любого размера, не допуская их преждевременного старения. &lt;/p&gt;&lt;h2&gt;Применение:&lt;/h2&gt;&lt;p&gt;Применение жидкости для елок Bona Forte обеспечивает свежий вид срезанного хвойного дерева и веточек на Новый год и Рождество.  После праздников можно использовать для продления жизни свежесрезанных цветов и других растений в букетах. &lt;/p&gt;&lt;p&gt;Чтобы купить средство, позвоните менеджеру интернет-магазина Elki-sale по телефону или закажите обратный звонок. Доставка по Москве осуществляется вместе с деревом или самовывоз со склада. &lt;/p&gt;', '', '', '', '', '');
INSERT INTO `oc_product_description` (`product_id`, `language_id`, `name`, `description`, `tag`, `meta_title`, `meta_description`, `meta_keyword`, `meta_h1`) VALUES
(196, 1, 'Кованые подставки для елки', '&lt;p&gt;Приобретение новогодней елки требует не только внимания к самому праздничному дереву, но и его последующей установке. Она должна быть выполнена строго в соответствии с размерными параметрами и весом дерева, с использованием подставки для обеспечения безопасности. Поэтому наш интернет-магазин, который предлагает &lt;a href=&quot;/el/zhivaya-srezannaya/&quot;&gt;купить елки&lt;/a&gt;, сосны и &lt;a href=&quot;/pikhta/zhivaya-pikhta-srezannaya/&quot;&gt;пихты, живые и срезанные&lt;/a&gt;, рекомендует обратить внимание на специальные кованые подставки!&lt;/p&gt;&lt;h2&gt;Преимущества подставок для елок и сосен&lt;/h2&gt;&lt;p&gt;Некоторые небольшие экземпляры или елки в горшках и кадках не нуждаются в обязательном закреплении основания. Но крупные деревья, приобретаемые под Новый год и Рождество, обязательно!&lt;/p&gt;&lt;p&gt;Предлагаем металлические изделия для установки елок:&lt;/p&gt;&lt;ul&gt;&lt;li&gt;Долговечность. Подставка прослужит десятки лет с аккуратным ее использованием и хранением в сухом месте;&lt;/li&gt;&lt;li&gt;Надежность. Каждая кованая подставка из нашего магазина прошла проверку на прочность и выдержит необходимый вес новогоднего дерева. Более подробно по данному вопросу можно проконсультироваться в момент заказа;&lt;/li&gt;&lt;li&gt;Основание из ковки не только надежное и безопасное, но и обладает прекрасными внешними показателями, поэтому впишется в любой интерьер и праздничную обстановку!&lt;/li&gt;&lt;/ul&gt;&lt;p&gt;Елки Сэйл – красивые новогодние деревья и подставки под них по лучшей цене в Москве!&lt;/p&gt;', '', '', '', '', ''),
(197, 1, 'Подставки для елки с водой', '&lt;p&gt;Новогодние сборы часто приводят нас на рынок, где множество &lt;a href=&quot;/el/zhivaya-srezannaya/&quot;&gt;елок&lt;/a&gt; и сосен разного размера. Но беда в том, что не сертифицированная продукция напрямую из кузова грузовика – это не всегда опрятные елки необходимого нам качества. Поэтому покупатели все чаще обращаются в интернет-магазины, где можно выбрать елки и пихты для Нового года и Рождества напрямую из лесопитомника, а в идеальном случае, и с доставкой домой!&lt;/p&gt;&lt;p&gt;Елки Сэйл организован как раз для того, чтобы предложить вам &lt;a href=&quot;/sosna/zhivaya-sosna-srezannaya/&quot;&gt;свежесрезанные сосны&lt;/a&gt; и пихты, а также елки в горшках высокого качества без каких-либо дефектов. А в комплекте с новогодним деревом, еще и надежные подставки для установки дома или в офисе!&lt;/p&gt;&lt;h2&gt;Пластмассовая подставка под елку&lt;/h2&gt;&lt;p&gt;Сегодня мы рекомендуем выбрать и купить подставку под елку из представленных образцов. В нашем магазине вы можете найти недорогую модель пластмассовой подставки для елок среднего размера, оснащенную фиксаторами. В чем же ее преимущества?&lt;/p&gt;&lt;ul&gt;&lt;li&gt;Основание под елку или сосну стандартного размера;&lt;/li&gt;&lt;li&gt;Большая плоскость опирания гарантирует устойчивость и надежность;&lt;/li&gt;&lt;li&gt;Ствол дерева надежно фиксируется с помощью винтовых фиксаторов, а также подпитывается водой с наполнителем из специального резервуара;&lt;/li&gt;&lt;li&gt;Материал изготовления – пластик, а значит, это практически вечный аксессуар, который не испортится от перепадов температур или влажности.&lt;/li&gt;&lt;/ul&gt;&lt;p&gt;Выбирайте елки и подставки в Москве по лучшей цене от нашего магазина!&lt;/p&gt;', '', '', '', '', ''),
(198, 1, 'Живая пихта Фразера срезанная', '&lt;h2&gt;Описание и характеристики:&lt;/h2&gt;&lt;p&gt;Живая пихта Фразера – великолепное вечнозеленое растение, которое украсит ваш дом на Новый год и Рождество. Миниатюрное новогоднее дерево размером всего 1,25 - 1,5 метра, пышное и миловидное, станет лучшим символом для хорошего настроения.&lt;/p&gt;&lt;p&gt;Цена пихты составит всего 6 500 рублей!&lt;/p&gt;&lt;h2&gt;Преимущества:&lt;/h2&gt;&lt;ul&gt;&lt;li&gt;Пихта Фразера стройная, строгой правильной формы, пышная и полностью заполненная хвоей, без залысин, присущих многим другим новогодним деревьям;&lt;/li&gt;&lt;li&gt;Спил растения только по заказу, поэтому дерево будет свежим и привлекательным;&lt;/li&gt;&lt;li&gt;Мелкая хвоя дает приятный аромат, к тому же, не осыпается долгое время;&lt;/li&gt;&lt;li&gt;Елки Сэйл рекомендует предварительный заказ, предлагая доставку по Москве и региону!&lt;/li&gt;&lt;/ul&gt;&lt;h2&gt;Размещение:&lt;/h2&gt;&lt;p&gt;Компактное, эргономичное и действительно симпатичное растение может быть установлено в ящик или контейнер, наполненный песком. Также мы готовы предложить специальные подставки под пихты и елки!&lt;/p&gt;&lt;h2&gt;Применение:&lt;/h2&gt;&lt;p&gt;Дерево с повышенной декоративностью отлично впишется в общее оформление помещения перед праздниками.&lt;/p&gt;&lt;p&gt;Предлагаем выбрать и купить сосну, пихту или елку любого размера. Наш интернет-магазин обязательно выдаст сертификат качества при покупке оптом или в розницу!&lt;/p&gt;', '1.25-1.5м', '', '', '', ''),
(199, 1, 'Живая сосна обыкновенная срезанная', '&lt;h2&gt;Описание и характеристики:&lt;/h2&gt;&lt;p&gt;Кроме русских и датских елок, наш интернет-магазин предлагает срезанные сосны для празднования Нового года и Рождества. Это прекрасные пышные вечнозеленые растения с ровным стволом и длинной хвоей – классика украшения помещения на праздники!&lt;/p&gt;&lt;p&gt;Размер – 1,0 - 1,25 м, цена всего 1 100 рублей!&lt;/p&gt;&lt;h2&gt;Преимущества:&lt;/h2&gt;&lt;ul&gt;&lt;li&gt;Умеренная пышность, удобный компактный размер, конусовидная крона на ровном стволе;&lt;/li&gt;&lt;li&gt;Необычайно стойкий лесной аромат;&lt;/li&gt;&lt;li&gt;Увеличенный срок эксплуатации новогоднего дерева;&lt;/li&gt;&lt;li&gt;Прекрасное сочетание со всеми видами новогодних игрушек;&lt;/li&gt;&lt;li&gt;Доставка деревьев по Москве и области, а также опт и розница, сертификация продукции!&lt;/li&gt;&lt;/ul&gt;&lt;h2&gt;Размещение:&lt;/h2&gt;&lt;p&gt;Сосна обыкновенная может быть установлена на подставке, тумбочке, столе или табурете в любом помещении – жилые комнаты, офисные кабинеты, холлы кафе, отелей и гостиниц. Также сосны прекрасно вписываются в тематическое оформление входной группы.&lt;/p&gt;&lt;h2&gt;Применение:&lt;/h2&gt;&lt;p&gt;Живая сосна является прекрасным элементом украшения помещений для празднования новогодних дат!&lt;/p&gt;&lt;p&gt;Предлагаем купить сосны и ели небольшого размера в Елки Сэйл по действительно умеренной цене. Дополнительно можно заказать пластиковую или кованую подставку!&lt;/p&gt;', '1-1.25м', '', '', '', ''),
(200, 1, 'Живая русская ель срезанная', '&lt;h2&gt;Описание и характеристики:&lt;/h2&gt;&lt;p&gt;Небольшое пышное новогоднее растение для обеспечения декоративного оформления в небольших помещениях. Компактная русская елка размером всего 0,8 - 1,0 м по цене 900 рублей!&lt;/p&gt;&lt;h2&gt;Преимущества:&lt;/h2&gt;&lt;ul&gt;&lt;li&gt;Приемлемая стоимость декоративной русской ели, которая срезается только после заказа покупателем;&lt;/li&gt;&lt;li&gt;Высокие эстетические показатели – пышность, равномерное распределение хвои, правильная форма кроны, небольшой размер;&lt;/li&gt;&lt;li&gt;Приятный лесной аромат, который долго держится в помещении;&lt;/li&gt;&lt;li&gt;Возможность сэкономить на покупке, если заказать ель самовывозом!&lt;/li&gt;&lt;/ul&gt;&lt;h2&gt;Размещение:&lt;/h2&gt;&lt;p&gt;Небольшая живая елка устанавливается в ведро, контейнер, на пластиковое или металлическое основание в любом помещении. Прекрасно смотрится на полке, на столе или тумбочке! Также может стать элементом оформления офисных кабинетов, входной группы любого здания!&lt;/p&gt;&lt;h2&gt;Применение:&lt;/h2&gt;&lt;p&gt;Живая елка применяется в качестве элемента декоративного оформления помещений и открытых площадок на Новый Год и Рождество.&lt;/p&gt;&lt;p&gt;Наш интернет-магазин рекомендует недорогие живые ели оптом и в розницу. Возможна доставка по Москве или же самовывоз со склада компании! У нас вы можете купить и свежесрезанную датскую ель, если данное растение более соответствует вашим требованиям!&lt;/p&gt;', '0.8-1м', '', '', '', ''),
(201, 1, 'Живая пихта Фразера в горшке', '&lt;h2&gt;Описание и характеристики:&lt;/h2&gt;&lt;p&gt;Живая пихта размером 1,5 - 1,75 м в горшке. Новогоднее растение с отличными внешними характеристиками. Глубокий цвет, качественное покрытие ветвей хвоей, натуральный лесной аромат, растение строго без дефектов!&lt;/p&gt;&lt;h2&gt;Преимущества:&lt;/h2&gt;&lt;ul&gt;&lt;li&gt;Приемлемая цена на пихту Фразера;&lt;/li&gt;&lt;li&gt;Выращивание в лесопитомнике с гарантией экологической чистоты, что подтверждается сертификатом;&lt;/li&gt;&lt;li&gt;Доставка в горшке, что подразумевает возможность применения пихты в ландшафтном дизайне;&lt;/li&gt;&lt;li&gt;Опт и розница, поставки по Москве и региону;&lt;/li&gt;&lt;li&gt;Красивое растение, конусообразное и пышное, с неосыпающейся хвоей!&lt;/li&gt;&lt;/ul&gt;&lt;h2&gt;Размещение:&lt;/h2&gt;&lt;p&gt;Пихта в горшке может быть установлена в гостиной, холле частного дома, комнате квартиры. Также подходит для административных и офисных помещений. Установка с подставкой или без нее, в собственной кадке!&lt;/p&gt;&lt;h2&gt;Применение:&lt;/h2&gt;&lt;p&gt;Пихта применяется в качестве основного символа Нового года и Рождества, участвует в самостоятельном или групповом оформлении помещений. В будущем может занять место в ландшафтном дизайне, быть высажена в открытый грунт на участке.&lt;/p&gt;&lt;p&gt;Елки Сэйл рекомендует изучить предложение и купить именно растения в горшках, что позволяет не выбрасывать елки и пихты, а использовать их и в будущем. Наш интернет-магазин предоставляет лучший ассортимент видов и размеров. Звоните!&lt;/p&gt;', '1.5-1.75м', '', '', '', ''),
(140, 1, 'Живая датская ель в горшке', '&lt;h2&gt;Описание и характеристики:&lt;/h2&gt;&lt;p&gt;Небольшая живая ель в горшке – миниатюрные размеры, высокая степень пышности, равномерное распределение небольших веточек по стволу и густая хвоя средней жесткости. Размер – 0,8 - 1,0 м, цена всего 6 300 рублей!&lt;/p&gt;&lt;h2&gt;Преимущества:&lt;/h2&gt;&lt;ul&gt;&lt;li&gt;Елка в горшке – новогоднее растение, которое не завянет и не подсохнет, не пожелтеет и не облысеет в течении месяца;&lt;/li&gt;&lt;li&gt;Аромат держится постоянно, для чего достаточно размять несколько хвоинок;&lt;/li&gt;&lt;li&gt;Размер растения позволяет установить его в любой удобной зоне;&lt;/li&gt;&lt;li&gt;Дерево пышное, зеленое, очень красивое;&lt;/li&gt;&lt;li&gt;Предлагаются елки и пихты напрямую из лесопитомника!&lt;/li&gt;&lt;/ul&gt;&lt;h2&gt;Размещение:&lt;/h2&gt;&lt;p&gt;Установка производится без необходимости обязательного применения подставки, на стол, тумбу, каминную полку, в углу комнаты или кабинета, в качестве дополнительного элемента оформления входной группы!&lt;/p&gt;&lt;h2&gt;Применение:&lt;/h2&gt;&lt;p&gt;Официальное новогоднее украшение наряду с игрушками и гирляндами. Возможность высадить живое растение на собственном участке, или пересадить в горшок побольше, и оставить в помещении!&lt;/p&gt;&lt;p&gt;Елки Сэйл – интернет-магазин с лучшими предложениями растений на Новый год и Рождество. Рекомендуем купить датские елки с доставкой по Москве, независимо от опта или розницы!&lt;/p&gt;', '0.8-1м', '', '', '', ''),
(141, 1, 'Живая голубая ель в горшке', '&lt;h2&gt;Описание и характеристики:&lt;/h2&gt;&lt;p&gt;Живая ель на Новый год и Рождество должна быть красивой и необычной. Данным параметрам соответствует голубая елка в горшке – небольшой размер, возможность размещения в любой удобной зоне помещения, и даже на мебели, плюс ароматная короткая хвоя с приятным цветом.&lt;/p&gt;&lt;p&gt;Пышное дерево с отменными декоративными показателями, размер елки всего 0,8 - 1,0 м, цена – 5 400 рублей!&lt;/p&gt;&lt;h2&gt;Преимущества:&lt;/h2&gt;&lt;ul&gt;&lt;li&gt;Живое дерево в вашем доме на новогодние праздники;&lt;/li&gt;&lt;li&gt;Доставка растения строго из питомника, с обязательным наличием сертификата соответствия;&lt;/li&gt;&lt;li&gt;Опт и розница с лучшими условиями, отправка по любому адресу Москвы и области;&lt;/li&gt;&lt;li&gt;Красивая елка на праздник, а также для украшения участка по его завершению!&lt;/li&gt;&lt;/ul&gt;&lt;h2&gt;Размещение:&lt;/h2&gt;&lt;p&gt;Елка устанавливается без подставки, в своей кадке, на стол или тумбу, на пол, или основание с регулировкой высоты. Дерево подходит для кабинетов и холлов, кафе и других подобных заведений, а также для оформления территории празднования в доме или квартире!&lt;/p&gt;&lt;h2&gt;Применение:&lt;/h2&gt;&lt;p&gt;Ель используется как основное украшение помещения для проведения новогодних мероприятий!&lt;/p&gt;&lt;p&gt;Наш интернет-магазин поставляет растения только высокого качества. У нас вы можете купить ели, сосны и даже пихты Фразера!&lt;/p&gt;', '0.8-1м', '', '', '', ''),
(234, 1, 'Живая русская ель срезанная', '&lt;h2&gt;Описание и характеристики:&lt;/h2&gt;&lt;p&gt;Срезанная русская ель из экологически чистого лесопитомника. Великолепное высокорослое дерево размером 8,0 - 9,0 м, с пирамидальной кроной и равномерным покрытием зеленой хвоей! Цена новогоднего дерева полностью оправдана усилиями по его выращиванию, и остается вполне конкурентной для рынка!&lt;/p&gt;&lt;h2&gt;Преимущества:&lt;/h2&gt;&lt;ul&gt;&lt;li&gt;Живая натуральная елка, выращенная в питомнике;&lt;/li&gt;&lt;li&gt;Равномерный зеленый цвет с лоском, исключены подсохшие и пожелтевшие участки;&lt;/li&gt;&lt;li&gt;Елка для празднования Нового года и Рождества, которую можно установить на улице около дома, кафе, административного центра;&lt;/li&gt;&lt;li&gt;Доставка по Москве и Московской области;&lt;/li&gt;&lt;li&gt;Рекомендации специалистов по увеличению срока эксплуатации;&lt;/li&gt;&lt;li&gt;Все сопроводительные документы!&lt;/li&gt;&lt;/ul&gt;&lt;h2&gt;Размещение:&lt;/h2&gt;&lt;p&gt;Русская ель размещается на открытых площадках, а также холлах зданий и сооружений, которые соответствуют ее размерам.&lt;/p&gt;&lt;p&gt;Установка производится с учетом веса и величины, на стальную или кованую подставку, возможно, с дополнительным закреплением верхушки и середины ствола!&lt;/p&gt;&lt;h2&gt;Применение:&lt;/h2&gt;&lt;p&gt;Яркое и действительно видное украшения любой зоны празднования. Прекрасное сочетание со всеми видами и типоразмерами новогодних игрушек и аксессуаров.&lt;/p&gt;&lt;p&gt;Наш интернет-магазин всегда готов оказать помощь, если вы решили купить елку или сосну к Новому году. Реализация оптом и в розницу по лучшей стоимости в регионе!&lt;/p&gt;', '8-9м', '', '', '', ''),
(143, 1, 'Живая датская ель срезанная', '&lt;h2&gt;Описание и характеристики:&lt;/h2&gt;&lt;p&gt;Новогодняя датская ель отличается пышностью и равномерной окраской, ветвями одинакового размера и аккуратной формой. Это одно из лучших решений для украшения своего дома перед празднованием Нового Года и Рождества! Размер достаточно компактный – 1,0-1,25 м, приемлемая цена.&lt;/p&gt;&lt;h2&gt;Преимущества:&lt;/h2&gt;&lt;ul&gt;&lt;li&gt;Приятный природный аромат свежесрезанной елки;&lt;/li&gt;&lt;li&gt;Небольшой размер для удобства размещения в помещении;&lt;/li&gt;&lt;li&gt;Возможность установки в небольших комнатах и кабинетах;&lt;/li&gt;&lt;li&gt;Симметричные ветви с короткими иголками, о которые сложно пораниться;&lt;/li&gt;&lt;li&gt;Насыщенный, темно-зеленый цвет с ярким отливом.&lt;/li&gt;&lt;/ul&gt;&lt;h2&gt;Размещение:&lt;/h2&gt;&lt;p&gt;Дополнительным преимуществом является размещение срезанной елки, если она приобретается со специальной подставкой. Но можно использовать и стандартные крепления, деревянные или стальные.&lt;/p&gt;&lt;p&gt;Елка устанавливается в ведре с песком, деревянном ящике или пластиковом контейнере, может быть установлена в угол комнаты, на специальной тумбе или столе!&lt;/p&gt;&lt;h2&gt;Применение:&lt;/h2&gt;&lt;p&gt;Применяется натуральная елка в качестве праздничного украшения, отлично сочетается с другими новогодними аксессуарами!&lt;/p&gt;&lt;p&gt;Мы рекомендуем внимательно изучить каталог интернет-магазина, и купить елки оптом и в розницу, как более удобно. Предлагается доставка по Москве!&lt;/p&gt;', '1-1.25м', '', '', '', ''),
(144, 1, 'Живая норвежская ель в горшке', '&lt;h2&gt;Описание и характеристики:&lt;/h2&gt;  &lt;p&gt;Живая норвежская ель в горшке – идеальный вариант дерева для празднования Нового года и Рождества. Эта новогодняя красавица наполнит офис, дом, кафе, отель волшебным ароматом, который знаком каждому из нас с детства. Ее роскошная форма и пушистые веточки являются результатом долгого и кропотливого труда селекционеров. &lt;/p&gt;  &lt;h2&gt;Преимущества:&lt;/h2&gt;  &lt;ul&gt;   &lt;li&gt;яркий изумрудный оттенок хвои;&lt;/li&gt;   &lt;li&gt;безупречно ровный ствол;&lt;/li&gt;   &lt;li&gt;правильно расположенные веточки;&lt;/li&gt;   &lt;li&gt;фитонциды и эфирные масла хвои очищают воздух от бактерий;&lt;/li&gt;   &lt;li&gt;возможность пересадки после праздников в открытый грунт;&lt;/li&gt;   &lt;li&gt;оперативная доставка по указанному адресу в Москве и области.&lt;/li&gt; &lt;/ul&gt;  &lt;h2&gt;Размещение:&lt;/h2&gt;  &lt;p&gt;Живую норвежскую ель в горшке можно расположить на полу холла офиса или гостиной дома. Дерево в кадке с землей не нуждается в подставке. А после окончания новогодних праздников зеленую красавицу можно пересадить во двор, на приусадебный участок или поселить на балконе.&lt;/p&gt;  &lt;h2&gt;Применение:&lt;/h2&gt;  &lt;p&gt;Если купить и установить настоящую живую елку, пахнущую лесом, то можно обеспечить себе новогоднее настроение и при этом не навредить природе.&lt;/p&gt;  &lt;p&gt;Интернет-магазин Elki.sale предлагает широкий выбор елок, сосен, пихт различного размера. Цены доступны, качество отменное. &lt;/p&gt;', '1.75-2м', '', '', '', ''),
(145, 1, 'Живая канадская сосна срезанная', '&lt;h2&gt;Описание и характеристики:&lt;/h2&gt;&lt;p&gt;Родина сосны канадской – Северная Америка, однако в настоящее время она как главный новогодний символ используется в разных странах. Такая знаменитость обеспечивается тем, что живая канадская сосна срезанная обладает всеми необходимыми характеристиками, свойственными рождественскому дереву.&lt;/p&gt;&lt;h2&gt;Преимущества:&lt;/h2&gt;&lt;ul&gt;&lt;li&gt;очень густая и пушистая крона;&lt;/li&gt;&lt;li&gt;ярко-изумрудный цвет хвои;&lt;/li&gt;&lt;li&gt;тонкие, но прочные ветви;&lt;/li&gt;&lt;li&gt;потрясающий хвойный аромат богатый фитонцидами;&lt;/li&gt;&lt;li&gt;длинная иглица имеет мягкую фактуру;&lt;/li&gt;&lt;li&gt;свежесрезанная сосна долго не осыпается, сохраняя свой прекрасный вид.&lt;/li&gt;&lt;/ul&gt;&lt;h2&gt;Размещение:&lt;/h2&gt;&lt;p&gt;За счет своей природной красоты живая канадская сосна срезанная не требует большого количества новогоднего убранства. Дерево размером 1.75-2.0 м – идеальный вариант для встречи Нового года и Рождества в кругу семьи или для корпоративного праздника.&lt;/p&gt;&lt;h2&gt;Применение:&lt;/h2&gt;&lt;p&gt;Если поставить канадскую ель в специальную емкость, наполненную водой, то она идеально справится со своей ролью основного украшения торжества и сохранит свежий вид на протяжении всех новогодних праздников.&lt;/p&gt;&lt;p&gt;Купить красивое хвойное дерево любой высоты по доступной цене с доставкой по Москве можно в нашем интернет-магазине.&lt;/p&gt;', '1.75-2м', '', '', '', ''),
(241, 1, 'Живая русская ель срезанная', '&lt;h2&gt;Описание и характеристики:&lt;/h2&gt;&lt;p&gt;Наша компания предлагает ели и сосны высотой до 6 м. На данной странице виртуальной витрины интернет-магазина предложена срезанная русская ель размером 4,0 - 4,5 м. Цена новогодней елки на достаточно конкурентном уровне, учитывая усилия по выращиванию многолетнего дерева и ценность эстетических данных растения!&lt;/p&gt;&lt;h2&gt;Преимущества:&lt;/h2&gt;&lt;ul&gt;&lt;li&gt;Красивое вечнозеленое дерево большого размера, специально для оформления места празднования Нового года и Рождества;&lt;/li&gt;&lt;li&gt;Возможность максимально длительного сохранения внешних показателей с использованием специальных средств;&lt;/li&gt;&lt;li&gt;Хвоя русской елки короткая, средне-мягкая;&lt;/li&gt;&lt;li&gt;По заказу доставляются только лучшие экземпляры пирамидальной формы с равнорастущими ветвями;&lt;/li&gt;&lt;li&gt;При установке в помещении, оно насыщается натуральным лесным ароматом;&lt;/li&gt;&lt;li&gt;Продукция магазина сертифицирована, для заказчика предлагается опт и розница!&lt;/li&gt;&lt;/ul&gt;&lt;h2&gt;Размещение:&lt;/h2&gt;&lt;p&gt;Установка высокого новогоднего растения требует наличия надежного основания – пластиковой, кованой или стальной опоры. Помимо этого, может потребоваться крепление ствола посередине и самой верхушки!&lt;/p&gt;&lt;h2&gt;Применение:&lt;/h2&gt;&lt;p&gt;Вы можете купить русскую ель для украшения праздничного зала или установки в сквере, во дворе частной территории! Нами будет выполнена доставка по Москве и области!&lt;/p&gt;', '4-4.5м', '', '', '', ''),
(147, 1, 'Живая европейская ель в горшке', '&lt;h2&gt;Описание и характеристики:&lt;/h2&gt;&lt;p&gt;Роскошная елка в любой дом или кабинет, кафе или актовый зал. Небольшая, пышная, натуральная с глубоким цветом и приятным ароматом. Короткая колючая хвоя и равномерное ее распределение по ветвям. Размер елки – 1,5 - 1,75 м!&lt;/p&gt;&lt;h2&gt;Преимущества:&lt;/h2&gt;&lt;ul&gt;&lt;li&gt;Идеальный размер для любого помещения, лучшее предложение на рынке под Новый год и Рождество;&lt;/li&gt;&lt;li&gt;Актуальная цена – приемлемая и ниже чем у конкурентов;&lt;/li&gt;&lt;li&gt;Равномерное построение, крона правильной формы, дерево свежее и без дефектов;&lt;/li&gt;&lt;li&gt;Доставка оптом и в розницу по Москве;&lt;/li&gt;&lt;li&gt;Сертификат соответствия от интернет-магазина;&lt;/li&gt;&lt;li&gt;Дополнительные предложения: подставки, жидкости для елок!&lt;/li&gt;&lt;/ul&gt;&lt;h2&gt;Размещение:&lt;/h2&gt;&lt;p&gt;Елка среднего размера помещается в комнате с любой высотой потолков, что очень удобно.  Установка не требует наличия подставки с фиксаторами!&lt;/p&gt;&lt;h2&gt;Применение:&lt;/h2&gt;&lt;p&gt;Ель в горшке прекрасно подходит для украшения помещений, в которых будет происходить празднование. Применяется в качестве основного, центрального элемента группы оформления, независимо от размещения.&lt;/p&gt;&lt;p&gt;Мы предлагаем купить живые новогодние деревья по лучшей стоимости в регионе. Возможна доставка или самовывоз со склада!&lt;/p&gt;', '1.5-1.75м', '', '', '', ''),
