(194, 1, 'Живая русская ель в горшке', '&lt;h2&gt;Описание и характеристики:&lt;/h2&gt;&lt;p&gt;Елки Сэйл – интернет-магазин, который всегда предложит лучшие образцы новогодних деревьев к праздникам! На данной странице мы презентуем живую русскую ель в горшке размером 0,5 - 0,6 м. Прекрасное компактное растение насыщенного цвета с пышным покрытием хвоей каждой веточки. Вы оплачиваете цену один раз, и оставляете растение для празднования Нового года и Рождества навсегда!&lt;/p&gt;&lt;h2&gt;Преимущества:&lt;/h2&gt;&lt;ul&gt;&lt;li&gt;Приобретение не срезанного, а живого новогоднего дерева навсегда – елка простоит все праздники, но также станет украшением на следующий год, и на следующий...;&lt;/li&gt;&lt;li&gt;Образцы выращиваются строго в экологической зоне;&lt;/li&gt;&lt;li&gt;Продукция сертифицирована;&lt;/li&gt;&lt;li&gt;Магазином предложена доставка по Москве и области;&lt;/li&gt;&lt;li&gt;Возможно сотрудничество на постоянной основе, для чего предлагается опт и розница!&lt;/li&gt;&lt;/ul&gt;&lt;h2&gt;Размещение:&lt;/h2&gt;&lt;p&gt;Красивая русская елка небольшого размера в горшке устанавливается в любом удобном месте вашего кабинета или домашней комнаты. Приобретение подставки необязательно!&lt;/p&gt;&lt;h2&gt;Применение:&lt;/h2&gt;&lt;p&gt;Миниатюрная елочка после украшения и насыщения помещения ароматом хвои, станет заметным символом праздника. Используется не только в качестве новогоднего дерева, но и для украшения ландшафта.&lt;/p&gt;&lt;p&gt;У нас вы всегда можете купить не только елки, но также сосны и пихты. Обращайтесь!&lt;/p&gt;', '0.5-0.6м', '', '', '', ''),
(149, 1, 'Живая голубая ель в горшке', '&lt;h2&gt;Описание и характеристики:&lt;/h2&gt;&lt;p&gt;Голубая елка в горшке – прекрасный вариант приобретения новогоднего растения. Дерево с серо-коричневой корой, хвоей глубокого голубого окраса, правильным разветвлением и без физических дефектов.&lt;/p&gt;&lt;p&gt;Размер 1,25 - 1,5 м – удобный для установки в квартире или офисе!&lt;/p&gt;&lt;h2&gt;Преимущества:&lt;/h2&gt;&lt;ul&gt;&lt;li&gt;Елки Сэйл – хвойные деревья по лучшей цене в Москве и регионе;&lt;/li&gt;&lt;li&gt;Дерево подбирается строго по заказу покупателя, и привозится из экологически безопасного лесопитомника;&lt;/li&gt;&lt;li&gt;Только стройные деревья с правильным окрасом и без залысин;&lt;/li&gt;&lt;li&gt;Доставка оптом и в розницу по указанному адресу!&lt;/li&gt;&lt;/ul&gt;&lt;h2&gt;Размещение:&lt;/h2&gt;&lt;p&gt;Елка среднего размера не требует много площади, устанавливается в любом удобном месте на стол или регулируемую подставку. Подходит для украшения тематических заведений, офисов и отдельных кабинетов!&lt;/p&gt;&lt;h2&gt;Применение:&lt;/h2&gt;&lt;p&gt;Декоративное растение стоит использовать для оформления помещений, где вы будете праздновать Новый год и Рождество. Прекрасно смотрится и на улице с дополнительной иллюминацией, а по окончанию праздников, переносится на участок, высаживается в грунт!&lt;/p&gt;&lt;p&gt;Наш интернет-магазин готов проконсультировать вас по выбору елок и сосен, чтобы вы могли купить действительно необычное и статное новогоднее дерево к празднику!&lt;/p&gt;', '1.25-1.5м', '', '', '', ''),
(150, 1, 'Живая датская ель в горшке', '&lt;h2&gt;Описание и характеристики:&lt;/h2&gt;&lt;p&gt;Живая елка в горшке – лучшее решение для празднования Нового года и Рождества. Постоянный, неиссякаемый аромат и настроение, густая изумрудная хвоя новогоднего дерева, пышный и красивый символ праздника остаются с вами навсегда.&lt;/p&gt;&lt;p&gt;Размер ели – 1,25 - 1,5 м, цена приемлемая и вполне конкурентная!&lt;/p&gt;&lt;h2&gt;Преимущества:&lt;/h2&gt;&lt;oul&gt;&lt;li&gt;Живое растение, которое не выбрасывается после окончания праздничного отпуска;&lt;/li&gt;&lt;li&gt;Ровное, стройное и очаровательное по своим внешним показателям дерево компактного размера;&lt;/li&gt;&lt;li&gt;Неосыпающаяся хвоя и всегда приятный лесной аромат;&lt;/li&gt;&lt;li&gt;Быстрая доставка по Москве прямо из экологически безопасного питомника!&lt;/li&gt;&lt;h2&gt;Размещение:&lt;/h2&gt;&lt;p&gt;Датская елка средней величины устанавливается на пол в комнате или кабинете. Прекрасно сочетается с декором на открытых участках и в оформлении входной группы. Дополнительная подставка необязательна!&lt;/p&gt;&lt;h2&gt;Применение:&lt;/h2&gt;&lt;p&gt;Ель используется в качестве основного символа празднования. Рекомендуется украшение светодиодными гирляндами. Растение в горшке впоследствии высаживается на участке или переносится в более объемный контейнер.&lt;/p&gt;&lt;p&gt;Наш интернет-магазин готов предложить вам ели и сосны оптом и в розницу, срезанные и в горшках, купить которые вы можете по предварительному заказу!&lt;/p&gt;			&lt;/oul&gt;', '1.25-1.5м', '', '', '', ''),
(233, 1, 'Живая русская ель срезанная', '&lt;h2&gt;Описание и характеристики:&lt;/h2&gt;&lt;p&gt;Взрослое высокорослое новогоднее дерево, которое подарит наилучшее ощущение праздника! Срезанная русская ель с пирамидальной формой кроны, равномерно распределенными ветвями и короткой зеленой хвоей средней жесткости.&lt;/p&gt;&lt;p&gt;Размер русской ели – 5,5 - 6,0 м, цена растения - 29 800 рублей! &lt;/p&gt;&lt;h2&gt;Преимущества:&lt;/h2&gt;&lt;ul&gt;&lt;li&gt;Большой размер дерева, елка соответствует параметрам объемных помещений, может быть установлена на улице;&lt;/li&gt;&lt;li&gt;Правильная форма, равномерное распределение ветвей по стволу;&lt;/li&gt;&lt;li&gt;Красивый, насыщенный цвет;&lt;/li&gt;&lt;li&gt;Невероятный лесной аромат с легкой терпкостью;&lt;/li&gt;&lt;li&gt;Срез дерева производится только после подтверждения заказа – елка обязательно свежая, не подсохшая;&lt;/li&gt;&lt;li&gt;Предоставляется сертификат соответствия!&lt;/li&gt;&lt;/ul&gt;&lt;h2&gt;Размещение:&lt;/h2&gt;&lt;p&gt;Установка высокой русской елки возможна в любом месте, которое соответствует ее величине. Холлы, вестибюли административных и офисных зданий, скверы и парки. Необходимо надежное основание из стали или ковки, крепление ствола!&lt;/p&gt;&lt;h2&gt;Применение:&lt;/h2&gt;&lt;p&gt;Растение используется для украшения зон празднования Нового года и Рождества. Возможно оформлению любым типом новогодних игрушек!&lt;/p&gt;&lt;p&gt;Интернет-магазин сосен и елок предлагает купить данный великолепный образец с доставкой по Москве, а также региону. Мы реализуем срезанные елки оптом и в розницу!&lt;/p&gt;', '5.5-6м', '', '', '', ''),
(152, 1, 'Живая датская ель срезанная', '&lt;h2&gt;Описание и характеристики:&lt;/h2&gt;&lt;p&gt;Предлагаем выбрать из ассортимента интернет-магазина живую датскую ель, размер которой составляет 1,5 - 1,75 м. Это красивое и пышное дерево с кроной правильной формы, равномерным ярким цветом и отблеском!&lt;/p&gt;&lt;h2&gt;Преимущества:&lt;/h2&gt;&lt;ul&gt;&lt;li&gt;Датская ель – специально выведенное растение, которое помогает покрыть потребительский спрос. Вы не нарушаете природный баланс, а покупаете дерево, предназначенное для среза;&lt;/li&gt;&lt;li&gt;Идеальная форма, равномерный размер веток и небольшие колючки;&lt;/li&gt;&lt;li&gt;Выраженный аромат хвои, достаточно насыщенный;&lt;/li&gt;&lt;li&gt;Качественный цвет и оттенки, без подсохших фрагментов и желтизны;&lt;/li&gt;&lt;li&gt;Свежая ель не осыпается даже через неделю или две в помещении!&lt;/li&gt;&lt;/ul&gt;&lt;h2&gt;Размещение:&lt;/h2&gt;&lt;p&gt;Покупая новогоднюю елку на Новый год и Рождество, вы можете заказать в комплекте удобную подставку для дерева, пластиковую или кованую, и разместить растение в удобном для вас месте. Размер елки позволяет установить ее на стол или тумбу!&lt;/p&gt;&lt;h2&gt;Применение:&lt;/h2&gt;&lt;p&gt;Живая елка применяется в качестве декоративного праздничного украшения.&lt;/p&gt;&lt;p&gt;У нас вы можете купить растение любой высоты, заранее рассчитав удобные параметры для установки ели в комнате или кабинете, холле или гостиной. Только лучшие цены на опт и розницу, а также доставка по Москве!&lt;/p&gt;', '1.5-1.75м', '', '', '', ''),
(237, 1, 'Живая русская ель срезанная', '&lt;h2&gt;Описание и характеристики&lt;/h2&gt;&lt;p&gt;Живая русская ель срезанная – доступное по цене и самое популярное новогоднее дерево в нашей стране. Ее бодрящий запах и насыщенно-зеленый цвет хвои в канун Нового года и Рождества наполняет дома и офисы приятным ощущением сказки и подарков.&lt;/p&gt;&lt;h2&gt;Преимущества:&lt;/h2&gt;&lt;ul&gt;&lt;li&gt;достойный экземпляр, выращенный в экологически чистом питомнике;&lt;/li&gt;&lt;li&gt;крона имеет правильную пирамидальную форму без физических повреждений;&lt;/li&gt;&lt;li&gt;хвойный аромат леса в жилом помещении;&lt;/li&gt;&lt;li&gt;компактность за счет изящных веточек и коротких иголок;&lt;/li&gt;&lt;li&gt;наличие сертификатов качества;&lt;/li&gt;&lt;li&gt;можно заказать доставку новогодних деревьев в дома и офисы Москвы.&lt;/li&gt;&lt;/ul&gt;&lt;h2&gt;Размещение:&lt;/h2&gt;&lt;p&gt;Живую русскую ель срезанную, как и другие хвойные деревья, наряжают игрушками и мишурой в канун новогодних праздников. В качестве подставки можно использовать специальную емкость из пластмассы. В резервуар заливается вода, что обеспечивает сохранность дерева на длительное время.&lt;/p&gt;&lt;h2&gt;Применение:&lt;/h2&gt;&lt;p&gt;Купить русскую ель размером 3.0-3.5 м можно для установки в просторных помещениях. Ею украшают корпоративные праздники, холлы офисов и торговых центров, гостиные частных домов и коттеджей. &lt;/p&gt;&lt;p&gt;Интернет-магазин Elki.sale предлагает заказать сертифицированные хвойные деревья безупречного качества по доступной цене.&lt;/p&gt;', '3-3.5м', '', '', '', ''),
(238, 1, 'Живая пихта Фразера срезанная', '&lt;h2&gt;Описание и характеристики:&lt;/h2&gt;&lt;p&gt;Срезанная пихта размером 3,5 - 3,75 м – величественное и элегантное новогоднее дерево, отличающееся пышной и жесткой зеленой хвоей, направленными вверх равномерно расположенными ветвями, а также изумительной конической формой!&lt;/p&gt;&lt;h2&gt;Преимущества:&lt;/h2&gt;&lt;ul&gt;&lt;li&gt;Бережное выращивание на территории лесопитомника;&lt;/li&gt;&lt;li&gt;Пихты и елки любого размера и диаметра;&lt;/li&gt;&lt;li&gt;Растения без дефектов, залысин, сломов, пожелтевшей хвои;&lt;/li&gt;&lt;li&gt;Насыщенный и стойкий аромат леса после установки в помещении;&lt;/li&gt;&lt;li&gt;Сопровождение сертификатами соответствия;&lt;/li&gt;&lt;li&gt;Своевременная доставка по Москве и Московской области независимо от партии, оптом или в розницу!&lt;/li&gt;&lt;/ul&gt;&lt;h2&gt;Размещение:&lt;/h2&gt;&lt;p&gt;Практически четырехметровая пихта сложно устанавливается в помещениях. Поэтому размещается в скверах и на открытых площадках, выбирается специально организаторами массового празднования, корпоративных вечеринок. Основные требования установки объемного и тяжелого дерева – стальная подставка или еще более надежный металлический каркас с закреплением!&lt;/p&gt;&lt;h2&gt;Применение:&lt;/h2&gt;&lt;p&gt;Наш интернет-магазин готов оказать помощь по выбору пихты, сосны или елки. У нас вы всегда сможете купить лучшее праздничное дерево на Новый год и Рождество по цене, которая строго соответствует рынку!&lt;/p&gt;', '3.5-3.75м', '', '', '', ''),
(213, 1, 'Живая сосна обыкновенная срезанная', '&lt;h2&gt;Описание и характеристики:&lt;/h2&gt;&lt;p&gt;Живая лесная сосна для празднования Нового года и Рождества! Красивое вечнозеленое дерево, которое мы вырастили на территории экологически чистого питомника. Глубокий и максимально равномерный цвет, длинная хвоя и правильная форма кроны – основные особенности растения!&lt;/p&gt;&lt;p&gt;Размер сосны – 1,25 - 1,5 м, цена установлена на приемлемом уровне&lt;/p&gt;&lt;h2&gt;Преимущества:&lt;/h2&gt;&lt;ul&gt;&lt;li&gt;Ровнорастущее новогоднее дерево без дефектов ствола или кроны;&lt;/li&gt;&lt;li&gt;Компактный размер для эргономичного размещения в любом помещении;&lt;/li&gt;&lt;li&gt;Невероятный зеленый цвет, который держится более 20-25 дней после среза;&lt;/li&gt;&lt;li&gt;Прекрасный аромат свежего леса, наполненный нотками хвои и эфирных масел;&lt;/li&gt;&lt;li&gt;Доставка сосен по Москве, обязательное сопровождение сертификатами соответствия;&lt;/li&gt;&lt;li&gt;Поставка продукции оптом и в розницу!&lt;/li&gt;&lt;/ul&gt;&lt;h2&gt;Размещение:&lt;/h2&gt;&lt;p&gt;Срезанная сосна обыкновенная небольшого размера запросто помещается в пластиковом ведре или контейнере, которые можно установить на стол, тумбу или подвесить к потолку. В нашем интернет-магазине для удобства можно купить подставку под сосну!&lt;/p&gt;&lt;p&gt;Прекрасно смотрится на открытых площадках в качестве украшения входной группы, въезда на территорию!&lt;/p&gt;&lt;h2&gt;Применение:&lt;/h2&gt;&lt;p&gt;Сосна используется как декоративный элемент оформления в залах для празднования!&lt;/p&gt;', '1.25-1.5м', '', '', '', ''),
(156, 1, 'Живая голубая ель в горшке', '&lt;h2&gt;Описание и характеристики:&lt;/h2&gt;&lt;p&gt;Живая голубая ель – лучший вариант для Нового года и Рождества. Причин всего несколько – невероятно оригинальный внешний вид, основанный на пышности кроны и глубоком оттенке морской волны, стройность дерева, а также насыщенный лесной аромат!&lt;/p&gt;&lt;p&gt;Размер предложенной елки – 1,5 - 1,75 м, цена составляет 8 600 рублей!&lt;/p&gt;&lt;h2&gt;Преимущества:&lt;/h2&gt;&lt;ul&gt;&lt;li&gt;Новогоднее дерево среднего размера для наиболее удобного размещения и процесса украшения;&lt;/li&gt;&lt;li&gt;Сочетание со всеми видами новогодних игрушек;&lt;/li&gt;&lt;li&gt;Насыщенный и стойкий аромат хвои;&lt;/li&gt;&lt;li&gt;Равномерное разветвление и жесткие, колючие, но приятные на ощупь иголки;&lt;/li&gt;&lt;li&gt;Елки Сэйл предлагает доставку елок по любому адресу, оптом и в розницу!&lt;/li&gt;&lt;/ul&gt;&lt;h2&gt;Размещение:&lt;/h2&gt;&lt;p&gt;Установка производится на пол или невысокое основание. Дерево подходит для всех типов закрытых помещений, а также прекрасно смотрится на улице, хотя и требует для оформления дополнительной декоративной иллюминации!&lt;/p&gt;&lt;h2&gt;Применение:&lt;/h2&gt;&lt;p&gt;Голубая елка – одно из наиболее удачных решений! Растение легко использовать для украшения любого зала или холла, но также просто применить в ландшафтном дизайне по окончанию зимних праздников.&lt;/p&gt;&lt;p&gt;Елки Сэйл – интернет-магазин хвойных деревьев в Москве, где вы всегда можете купить самые красивые елки, сосны и пихты, срезанные и в горшках!&lt;/p&gt;', '1.5-1.75м', '', '', '', ''),
(157, 1, 'Живая датская ель в горшке', '&lt;h2&gt;Описание и характеристики:&lt;/h2&gt;&lt;p&gt;Елки Сэйл рекомендует приобретение живой датской ели в горшке. Это не срезанное растение, а новогоднее дерево для оформления дома или офиса, которое будет радовать вас десятки лет. Стройная елка с жесткой и изумрудно-зеленой хвоей, пышное и красивое на каждый Новый год и Рождество. Размер растения – 1,5 - 1,75 м.&lt;/p&gt;&lt;h2&gt;Преимущества:&lt;/h2&gt;&lt;ul&gt;&lt;li&gt;Адекватная цена новогоднего дерева;&lt;/li&gt;&lt;li&gt;Свежесть, пышность, неповторимый цвет и стойкий аромат на постоянной основе;&lt;/li&gt;&lt;li&gt;Подбор лучших растений из лесопитомника;&lt;/li&gt;&lt;li&gt;Сертификация, доставка по Москве и области!&lt;/li&gt;&lt;/ul&gt;&lt;h2&gt;Размещение:&lt;/h2&gt;&lt;p&gt;Елка в горшке данного размера устанавливается на тумбу или стол, на пол в углу или посередине помещения без использования специального основания. Подходит для жилых комнат, кабинетов, залов кафе, вестибюлей развлекательных комплексов!&lt;/p&gt;&lt;h2&gt;Применение:&lt;/h2&gt;&lt;p&gt;Ель в горшке используется не только для периодического оформления зоны празднования, но может быть высажена на участке или перемещена в более вместительный контейнер.&lt;/p&gt;&lt;p&gt;Наш интернет-магазин реализует пихты, сосны и елки, оптом и в розницу. Купить новогоднее растение можно по звонку, предварительно определив размер и соответствующую бюджету стоимость!&lt;/p&gt;', '1.5-1.75м', '', '', '', ''),
(232, 1, 'Живая русская ель срезанная', '&lt;h2&gt;Описание и характеристики:&lt;/h2&gt;&lt;p&gt;Высокая русская ель для установки на открытых площадках. Ровный ствол, высокая степень пышности, равномерный цвет и покрытие хвоей.&lt;/p&gt;&lt;p&gt;Размер новогодней елки – 6,0 - 7,0 м, цена соответствует параметрам растения!&lt;/p&gt;&lt;h2&gt;Преимущества:&lt;/h2&gt;&lt;ul&gt;&lt;li&gt;Высокорослое взрослое дерево, в выращивание которого вложено немало усилий профессионалов;&lt;/li&gt;&lt;li&gt;Красивая крона правильной пирамидальной формы;&lt;/li&gt;&lt;li&gt;Равномерное покрытие зеленой хвоей со средней жесткостью;&lt;/li&gt;&lt;li&gt;Настоящий природный запах;&lt;/li&gt;&lt;li&gt;Подбор дерева и срез после оформления заказа, что исключает проблемы с подсыханием и опаданием иголок;&lt;/li&gt;&lt;li&gt;Русские елки без дефектов – строгий контроль качества каждого отдельного экземпляра;&lt;/li&gt;&lt;li&gt;Сертификаты, доставка по Москве и области, реализация оптом и в розницу!&lt;/li&gt;&lt;/ul&gt;&lt;h2&gt;Размещение:&lt;/h2&gt;&lt;p&gt;Елка данного размера устанавливается на открытых площадках частных офисных и административных территорий, кафе и ресторанов, развлекательных комплексов, реже в холлах и вестибюлях, так как имеются особенные требования к параметрам.&lt;/p&gt;&lt;p&gt;Для установки требуется подставка, стальной каркас!&lt;/p&gt;&lt;h2&gt;Применение:&lt;/h2&gt;&lt;p&gt;Украшение открытых территорий перед празднованием Нового года и Рождества!&lt;/p&gt;&lt;p&gt;Интернет-магазин Елки Сэйл рекомендует потратить несколько минут на изучение ассортимента, так как у нас вы можете купить сосны, русские и датские ели!&lt;/p&gt;', '6-7м', '', '', '', ''),
(159, 1, 'Живая датская ель срезанная', '&lt;h2&gt;Описание и характеристики:&lt;/h2&gt;&lt;p&gt;Живая датская ель немного напоминает искусственную, но только своими точными линиями своей формы и пушистостью хвои. Этот вид выведен специально для покрытия спроса потребителей, но селекционеры вложили огромные силы в создание сорта ели, которая бы отвечала всем требованиям покупателя.&lt;/p&gt;&lt;p&gt;Специально под Новый год и Рождество, наш интернет-магазин рекомендует изучить ассортимент, и купить елки оптом и в розницу. Размер представленной на данной странице ели – 1,75 - 2 м, в наличии размеры от 0,8 м до 6 м!&lt;/p&gt;&lt;h2&gt;Преимущества:&lt;/h2&gt;&lt;ul&gt;&lt;li&gt;Средние размеры, идеальное новогоднее дерево для квартиры или дома;&lt;/li&gt;&lt;li&gt;Глубокий темно-зеленый цвет с отблесками;&lt;/li&gt;&lt;li&gt;Настоящий природный, лесной аромат сразу после заноса растения в помещение;&lt;/li&gt;&lt;li&gt;Сертифицированная продукция, елки Премиум класса!&lt;/li&gt;&lt;/ul&gt;&lt;h2&gt;Размещение:&lt;/h2&gt;&lt;p&gt;Новогодняя елка помещается в любой комнате, даже при установке на подставку. Рекомендуем выбрать специальное крепление для дерева в нашем каталоге – пластиковое или кованое!&lt;/p&gt;&lt;h2&gt;Применение:&lt;/h2&gt;&lt;p&gt;Датская живая елка используется для повышения эстетической ценности украшения праздничного интерьера.&lt;/p&gt;&lt;p&gt;Мы предлагаем большой ассортимент, приемлемые цены, доставку елок по Москве!&lt;/p&gt;', '1.75-2м', '', '', '', ''),
(240, 1, 'Живая русская ель срезанная', '&lt;h2&gt;Описание и характеристики&lt;/h2&gt;&lt;p&gt;Живые русские ели срезанные завоевали популярность в России и Европе благодаря декоративному внешнему виду, темно-зеленому окрасу, хвойному аромату, приемлемой цене. Традиционное украшение домов и офисов в канун Нового года и Рождества доставит много приятных эмоций взрослым и детям.&lt;/p&gt;&lt;h2&gt;Преимущества:&lt;/h2&gt;&lt;ul&gt;&lt;li&gt;стоимость живой русской ели срезанной доступна для семей с любым уровнем достатка;&lt;/li&gt;&lt;li&gt;верность старинному обычаю украшать дом на новогодние праздники;&lt;/li&gt;&lt;li&gt;безупречное качество, о чем свидетельствуют сертификаты из питомника;&lt;/li&gt;&lt;li&gt;освежающий хвойный запах богат полезными для здоровья фитонцидами и эфирными маслами;&lt;/li&gt;&lt;li&gt;налаженная доставка в любую точку Москвы.&lt;/li&gt;&lt;/ul&gt;&lt;h2&gt;Размещение:&lt;/h2&gt;&lt;p&gt;Чтобы установить живую елку в помещении, потребуется специальная подставка, емкость которой заполняется водой. Такое размещение – залог того, что дерево не сбросит хвою через несколько дней, а продержится все рождественские каникулы. Размер елки 3.5-4.0 м позволяет расположить ее в холе административного здания, в торговом комплексе, у входа в офис, в вестибюле учреждения.&lt;/p&gt;&lt;p&gt;Купить качественные хвойные деревья оптом и в розницу предлагает интернет-магазин Elki.sale. &lt;/p&gt;', '4-4.5м', '', '', '', ''),
(212, 1, 'Живая русская ель в горшке', '&lt;h2&gt;Описание и характеристики:&lt;/h2&gt;&lt;p&gt;Небольшая русская ель размером 0,75 - 1,0 м в горшке. Яркий зеленый цвет, правильная форма кроны, растение без дефектов и сломов.&lt;/p&gt;&lt;p&gt;Цена русской елки – 3 700 рублей!&lt;/p&gt;&lt;h2&gt;Преимущества:&lt;/h2&gt;&lt;ul&gt;&lt;li&gt;Предлагается большой ассортимент срезанных растений и в горшке: елки, пихты Фразера, сосны;&lt;/li&gt;&lt;li&gt;Выращивание на территории лесного питомника;&lt;/li&gt;&lt;li&gt;Продукция проходит строгий контроль и сертификацию;&lt;/li&gt;&lt;li&gt;Покупая новогоднее дерево в горшке, вы обеспечиваете себя символом Нового года и Рождества на много лет вперед;&lt;/li&gt;&lt;li&gt;Реализация оптом и в розницу по лучшей стоимости, большое количество предложений по типоразмеру, доставка по Москве и столичному региону!&lt;/li&gt;&lt;/ul&gt;&lt;h2&gt;Размещение:&lt;/h2&gt;&lt;p&gt;Метровая русская елка отлично помещается на тумбе, табурете или столе в удобном месте комнаты или офисного помещения, может участвовать в оформлении входной группы без дополнительных подставок или каркасов!&lt;/p&gt;&lt;h2&gt;Применение:&lt;/h2&gt;&lt;p&gt;Елка используется в качестве символического украшения помещений, где будет происходить празднование мероприятия.&lt;/p&gt;&lt;p&gt;Интернет-магазин строго следит за качеством продукции, и предлагает купить только лучшие образцы. Отправим вам ель, пихту или сосну любого размера по первому звонку!&lt;/p&gt;', '0.75-1м', '', '', '', ''),
(162, 1, 'Живая голубая ель в горшке', '&lt;h2&gt;Описание и характеристики:&lt;/h2&gt;&lt;p&gt;Высокая голубая елка в горшке для оформления вашего дома или офиса на Новый год и Рождество. Особенности праздничного дерева заключается в оригинальном окрасе и переливах оттенков на свету, пышности и корректности построения кроны, а также невероятно насыщенном аромате!&lt;/p&gt;&lt;p&gt;Размер новогодней елки – 1, 75 - 2,0 м, цена всего 9 500 рублей!&lt;/p&gt;&lt;h2&gt;Преимущества:&lt;/h2&gt;&lt;ul&gt;&lt;li&gt;Елка в кадке – и это первый плюс. Дерево не нужно выбрасывать, его можно высадить на участке, чтобы провести с ним еще не один новогодний праздник;&lt;/li&gt;&lt;li&gt;Великолепная раскидная и пушистая крона, колючая короткая хвоя голубого цвета, дерево без дефектов;&lt;/li&gt;&lt;li&gt;Лучшие предложения по елкам и пихтам в Москве;&lt;/li&gt;&lt;li&gt;Доставка от интернет-магазина по региону, опт и розница!&lt;/li&gt;&lt;/ul&gt;&lt;h2&gt;Размещение:&lt;/h2&gt;&lt;p&gt;Елка в кадке устанавливается в любом помещении, но также может размещаться на улице без обязательного использования дополнительного закрепления и подставок!&lt;/p&gt;&lt;h2&gt;Применение:&lt;/h2&gt;&lt;p&gt;Ель используется как основной элемент оформления любого зала для проведения новогодних мероприятий. В будущем может быть приспособлена в ландшафтном дизайне на собственном участке!&lt;/p&gt;&lt;p&gt;Предлагаем купить ели и сосны любых размеров, а также специальные жидкости для елок, подставки, обеспечивающие надежность установки!&lt;/p&gt;', '1.75-2м', '', '', '', ''),
(230, 1, 'Живая русская ель срезанная', '&lt;h2&gt;Описание и характеристики&lt;/h2&gt;&lt;p&gt;Живая русская ель срезанная отличается красивой кроной и бодрящим запахом смолы, без которого невозможно представить себе празднование Нового года и Рождества. Особый шарм и уникальность этому атрибуту новогоднего торжества придают изящные веточки и короткая хвоя.&lt;/p&gt;&lt;h2&gt;Преимущества:&lt;/h2&gt;&lt;ul&gt;&lt;li&gt;аромат свежести, который наполняет пространство праздничной атмосферой;&lt;/li&gt;&lt;li&gt;эфирные масла и фитонциды служат профилактикой от простуды;&lt;/li&gt;&lt;li&gt;цена доступна семьям с любым уровнем дохода;&lt;/li&gt;&lt;li&gt;дерево без физических дефектов, на что указывают сертификаты качества;&lt;/li&gt;&lt;li&gt;оперативная доставка по Москве и области.&lt;/li&gt;&lt;/ul&gt;&lt;h2&gt;Размещение&lt;/h2&gt;&lt;p&gt;Высокая живая русская ель срезанная размером 2.5-3.0 м – отличный выбор для установки в больших помещениях административного и муниципального назначения, в торговых, медицинских, спортивных и развлекательных центрах, в холлах офисных центров.&lt;/p&gt;&lt;h2&gt;Применение:&lt;/h2&gt;&lt;p&gt;Русская елка – это верность традициям. Именно такими деревьями украшали дома наши родители, именно о них говорится в детских песнях и стихах.&lt;/p&gt;&lt;p&gt;В интернет-магазине Elki.sale жители Москвы могут без лишних хлопот купить красивые хвойные деревья для встречи Нового года.  &lt;/p&gt;', '2.5-3м', '', '', '', ''),
(231, 1, 'Живая русская ель срезанная', '&lt;h2&gt;Описание и характеристики:&lt;/h2&gt;&lt;p&gt;Великолепная срезанная русская елка с правильной пирамидальной кроной, большой величиной, равномерным окрасом хвои и без физических дефектов ветвей. Елки Сэйл предлагает вечнозеленое новогоднее дерево размером 5,0 - 5,5 м, по вполне приемлемой цене для такого величественного растения – 20 100 рублей!&lt;/p&gt;&lt;h2&gt;Преимущества:&lt;/h2&gt;&lt;ul&gt;&lt;li&gt;Прямой ствол, округлая пирамидальная форма, корректное построение направления ветвей;&lt;/li&gt;&lt;li&gt;Равномерно окрашенная хвоя средней жесткости, без подсохших и опадающих колючек;&lt;/li&gt;&lt;li&gt;Настоящий лесной аромат на протяжении всего времени эксплуатации;&lt;/li&gt;&lt;li&gt;Приемлемая стоимость русской елки;&lt;/li&gt;&lt;li&gt;Дерево из природного лесопитомника, срезанное на заказ;&lt;/li&gt;&lt;li&gt;Сертифицированная продукция!&lt;/li&gt;&lt;/ul&gt;&lt;h2&gt;Размещение:&lt;/h2&gt;&lt;p&gt;Высокая елка устанавливается на открытых площадках, в скверах и на задних дворах, а также в холлах и вестибюлях с большой высотой потолка. Используется при этом стальное или кованое основание, дополнительная подвязка серединной части ствола!&lt;/p&gt;&lt;h2&gt;Применение:&lt;/h2&gt;&lt;p&gt;Срезанная ель используется как символическое украшение помещений и площадок под Новый год и Рождество!&lt;/p&gt;&lt;p&gt;Купить елку или сосну с доставкой вы всегда можете в нашем интернет-магазине. Опт и розница, отправка по Москве или самовывоз, большой ассортимент приятные цены!&lt;/p&gt;', '5-5.5м', '', '', '', '');
INSERT INTO `oc_product_description` (`product_id`, `language_id`, `name`, `description`, `tag`, `meta_title`, `meta_description`, `meta_keyword`, `meta_h1`) VALUES
(165, 1, 'Живая датская ель срезанная', '&lt;h2&gt;Описание и характеристики:&lt;/h2&gt;&lt;p&gt;Уникальная и универсальная живая датская елка давно завоевала рынок. Поэтому новогоднее дерево пользуется большой популярностью.&lt;/p&gt;&lt;p&gt;Это красивое, изящное и практически идеальное по своим внешним показателям растение: хвоя средней жесткости, равномерное распределение веток по стволу, правильная форма кроны. Размер живой ели – 2 - 2,25 м, цена сегодня ниже рыночной!&lt;/p&gt;&lt;h2&gt;Преимущества:&lt;/h2&gt;&lt;ul&gt;&lt;li&gt;Великолепные внешние показатели, обусловленные профессиональной селекцией;&lt;/li&gt;&lt;li&gt;Сертификат на каждое новогоднее дерево, приобретенное в нашем магазине;&lt;/li&gt;&lt;li&gt;Повышенная пышность кроны и хвои;&lt;/li&gt;&lt;li&gt;Глубокий цвет и отблеск, исключение пожелтевших фрагментов и осыпания хвои;&lt;/li&gt;&lt;li&gt;Приемлемая стоимость живой елки, возможность самовывоза со склада!&lt;/li&gt;&lt;/ul&gt;&lt;h2&gt;Размещение:&lt;/h2&gt;&lt;p&gt;Елка устанавливается на деревянную, пластиковую или кованую опору, стальные ножки, в ведро, ящик или контейнер. Размер до 2,25 м позволяет размещение в любом жилом помещении!&lt;/p&gt;&lt;h2&gt;Применение:&lt;/h2&gt;&lt;p&gt;По стандарту, живая елка внутри помещения служит украшением к Новому году и Рождеству.&lt;/p&gt;&lt;p&gt;Звоните или приезжайте, и вы сможете купить елки оптом и в розницу. Наш интернет-магазин предлагает доставку по Москве и большой ассортимент продукции!&lt;/p&gt;', '2-2.25м', '', '', '', ''),
(229, 1, 'Живая русская ель срезанная', '&lt;h2&gt;Описание и характеристики:&lt;/h2&gt;&lt;p&gt;Пышная русская елка размером 2,5 - 2,75 метра, выбор которой требует обязательных предварительных замеров высоты потолка в помещении. Равнонаправленные вверх ветви, пирамидальная форма, красивый зеленый цвет с ярким блеском! &lt;/p&gt;&lt;h2&gt;Преимущества:&lt;/h2&gt;&lt;ul&gt;&lt;li&gt;Рост стоимости новогоднего дерева искусственно сдержан интернет-магазином для повышения покупательской способности;&lt;/li&gt;&lt;li&gt;Натуральная ель срезается после оформления заказа;&lt;/li&gt;&lt;li&gt;Хвоя средней жесткости, не подсыхает и не осыпается, изначально строго зеленого цвета без желтых и коричневых фрагментов;&lt;/li&gt;&lt;li&gt;Насыщенный лесной запах от свежего растения;&lt;/li&gt;&lt;li&gt;На каждый отдельный экземпляр предоставляется сертификат соответствия!&lt;/li&gt;&lt;/ul&gt;&lt;h2&gt;Размещение:&lt;/h2&gt;&lt;p&gt;Установка в деревянный или ПВХ контейнер с песком или грунтом, более надежная установка на специальную подставку из ковки или пластика. В случае выбора крестовины в качестве основания, необходима подвязка верхушки!&lt;/p&gt;&lt;h2&gt;Применение:&lt;/h2&gt;&lt;p&gt;Классическое праздничное оформление помещений и открытых площадок перед Новым годом и Рождеством. Прекрасное сочетание со всеми видами украшений!&lt;/p&gt;&lt;p&gt;Елки Сэйл предлагает доставку елок оптом и в розницу. Спешите купить русскую ель в Москве по наиболее приемлемой цене!&lt;/p&gt;', '2.5-2.75м', '', '', '', ''),
(210, 1, 'Живая русская ель в горшке', '&lt;h2&gt;Описание и характеристики:&lt;/h2&gt;&lt;p&gt;Русская елка в горшке. Средний размер – 1,25 - 1,5 м, специально для домашнего размещения и небольших помещений, стройное дерево с ярко-зеленым окрасом и строгой формой.&lt;/p&gt;&lt;p&gt;Цена живого новогоднего дерева – 5 500 рублей!&lt;/p&gt;&lt;h2&gt;Преимущества:&lt;/h2&gt;&lt;ul&gt;&lt;li&gt;Пышная и очень красивая елочка на Новый год и Рождество;&lt;/li&gt;&lt;li&gt;Возможность использования в ландшафтном дизайне после празднования;&lt;/li&gt;&lt;li&gt;Идеальное построение ветвей на ровном стволе, равномерное распределение хвои на каждой веточке;&lt;/li&gt;&lt;li&gt;Большой ассортимент интернет-магазина предполагает облегчение выбора под любые требования: елки, пихты и сосны всех размеров;&lt;/li&gt;&lt;li&gt;Возможна доставка по Москве и региону!&lt;/li&gt;&lt;/ul&gt;&lt;h2&gt;Размещение:&lt;/h2&gt;&lt;p&gt;Ель небольшого размера соответствует помещению любой величины. Возможна установка в кабинетах, кафе, ресторанах, в дополнение к оформлению входной группы без применения дополнительных подставок!&lt;/p&gt;&lt;h2&gt;Применение:&lt;/h2&gt;&lt;p&gt;Елка используется для качественного оформления праздничных помещений. По истечению сроков новогоднего отпуска, растение можно перенести на участок, высадить в грунт!&lt;/p&gt;&lt;p&gt;Елки Сэйл предлагает купить елки и сосны нужного вам размера, а также оптом и в розницу. Обращайтесь для консультации и заказа!&lt;/p&gt;', '1.25-1.5м', '', '', '', ''),
(211, 1, 'Живая пихта Фразера срезанная', '&lt;h2&gt;Описание и характеристики:&lt;/h2&gt;&lt;p&gt;Пихта Фразера, пожалуй, самое пышное новогоднее растение, которое может стать альтернативой даже самой красивой сосне, русской елке. Поэтому сегодня все больше людей выбирают данный вариант для украшения помещения под Новый год и Рождество. Дополнительные особенности – ровный ствол, миниатюрность, общая оптимальная сложенность дерева. Размер пихты – 1,5 - 1,75 м, цена достаточно умеренная!&lt;/p&gt;&lt;h2&gt;Преимущества:&lt;/h2&gt;&lt;ul&gt;&lt;li&gt;Приемлемая стоимость, доступность растения на рынке, ассортимент размеров в каталоге нашего интернет-магазина;&lt;/li&gt;&lt;li&gt;Все образцы выращиваются на экологически безопасных территориях;&lt;/li&gt;&lt;li&gt;Растения с равнорастущими вверх ветками, густой зеленой хвоей;&lt;/li&gt;&lt;li&gt;Полное исключение прорех и залысин, физических дефектов;&lt;/li&gt;&lt;li&gt;Опт и розница на выбор покупателя, доставка по городу Москва и региону!&lt;/li&gt;&lt;/ul&gt;&lt;h2&gt;Размещение:&lt;/h2&gt;&lt;p&gt;Живая срезанная пихта устанавливается на специальное основание – это пластиковая или кованая надежная подставка. Растение подходит для жилых помещений, торговых и выставочных комплексов, холлов офисов и супермаркетов!&lt;/p&gt;&lt;h2&gt;Применение:&lt;/h2&gt;&lt;p&gt;Использование в качестве основного элемента декоративного оформления территории празднования. Купить пихту можно через заказ по телефону!&lt;/p&gt;', '1.5-1.75м', '', '', '', ''),
(169, 1, 'Живая датская ель срезанная', '&lt;h2&gt;Описание и характеристики:&lt;/h2&gt;&lt;p&gt;Датская ель – селекционное растение на базе кавказской пихты, пихты Нордмана. Это окультуренное растение с улучшенными внешними показателями, а также увеличенным сроком хранения в срезанном виде.&lt;/p&gt;&lt;p&gt;Крона идеальной формы, неизменно зелено-изумрудный цвет и исключение опадания хвоя – те преимущества, которые только повысят настроение на Новый год и Рождество! Размер живой елки – 2,25 - 2,5 м, цена в прайсе!&lt;/p&gt;&lt;h2&gt;Преимущества:&lt;/h2&gt;&lt;ul&gt;&lt;li&gt;Достаточно мягкая хвоя, которая полностью исключает возможность больно уколоться;&lt;/li&gt;&lt;li&gt;Насыщенный, глубокий и очень приятный цвет;&lt;/li&gt;&lt;li&gt;Лесной аромат настоящего дерева, выращенного в экологически чистом питомнике;&lt;/li&gt;&lt;li&gt;Сертификат на каждое новогоднее дерево, которое вы выбираете в нашем интернет-магазине!&lt;/li&gt;&lt;/ul&gt;&lt;h2&gt;Размещение:&lt;/h2&gt;&lt;p&gt;Новогодняя ель такого размера еще свободно помещается в жилых помещениях, холлах, гостиных и кабинетах. Поэтому дополнительным предложением будет только приобретение надежной подставки из пластика или ковки. Также рекомендуется дополнительно зафиксировать ель у основания и верхушки в случае необходимости!&lt;/p&gt;&lt;h2&gt;Применение:&lt;/h2&gt;&lt;p&gt;Высокая праздничная елка украсит любое помещение! Используется как неотъемлемая составляющая часть вашего праздника и настроения!&lt;/p&gt;&lt;p&gt;Мы предлагаем живые елки оптом и в розницу, купить которые можно уже сейчас. Оформите заказ на самовывоз, или с доставкой по Москве!&lt;/p&gt;', '2.25-2.5м', '', '', '', ''),
(170, 1, 'Живая датская ель срезанная', '&lt;h2&gt;Описание и характеристики:&lt;/h2&gt;&lt;p&gt;Высокая живая датская ель – природная красота для холла офиса или административного помещения, торгового или развлекательного центра. Новогоднее настроение поддержат идеальной формы крона растения, ее чисто-зеленый цвет без желтых фрагментов, а также неосыпающаяся хвоя. Размер срезанной елки – 2,5 - 2,75 м, цена более чем конкурентная!&lt;/p&gt;&lt;h2&gt;Преимущества:&lt;/h2&gt;&lt;ul&gt;&lt;li&gt;Высокое, статное дерево для украшения внутренних помещений, открытых площадок на Новый год и Рождество;&lt;/li&gt;&lt;li&gt;Идеальная крона, посадка веток и короткая, мягкая хвоя;&lt;/li&gt;&lt;li&gt;Великолепный лесной аромат и ничем неиспорченный цвет растения из экологически чистого питомника;&lt;/li&gt;&lt;li&gt;Документы на растение, самовывоз или доставка по Москве, опт и розница! &lt;/li&gt;&lt;/ul&gt;&lt;h2&gt;Размещение:&lt;/h2&gt;&lt;p&gt;Ель размещается в увеличенных ящиках или контейнерах, устанавливается с фиксаторами и дополнительным закреплением. Предлагаем купить в нашем интернет-магазине и надежные стойки под елки. В наличии пластиковые и кованые подставки под елки!&lt;/p&gt;&lt;h2&gt;Применение:&lt;/h2&gt;&lt;p&gt;Высокая датская елка может быть установлена в квартирах и домах с высокими потолками, холлах и залах для обеспечения праздничной обстановки и повышения настроения! Отлично сочетается с современными диодными гирляндами, чему располагает пышность растения!&lt;/p&gt;', '2.5-2.75м', '', '', '', ''),
(228, 1, 'Живая пихта Фразера срезанная', '&lt;h2&gt;Описание и характеристики:&lt;/h2&gt;&lt;p&gt;Срезанная пихта на Новый год и Рождество – хороший выбор. Причины – характерные особенности данного новогоднего дерева: насыщенный темно-зеленый равномерный цвет, плотное покрытие жесткой хвоей, стройность и пышность формы!&lt;/p&gt;&lt;p&gt;Сегодня Елки Сэйл предлагает пихту размером 3,0 - 3,25 м. Цена дерева – 31 000 рублей!&lt;/p&gt;&lt;h2&gt;Преимущества:&lt;/h2&gt;&lt;ul&gt;&lt;li&gt;Выращивание в экологически чистой зоне, под строгим присмотром профессиональных селекционеров;&lt;/li&gt;&lt;li&gt;Получение в результате наиболее качественных образцов в регионе;&lt;/li&gt;&lt;li&gt;Большой ассортимент размеров и форм, а также самих деревьев – пихты, елки, сосны;&lt;/li&gt;&lt;li&gt;Доставка по территории Москвы, поставки оптом и в розницу по области;&lt;/li&gt;&lt;li&gt;Обязательный сопроводительный сертификат!&lt;/li&gt;&lt;/ul&gt;&lt;h2&gt;Размещение:&lt;/h2&gt;&lt;p&gt;Высокая пихта Фразера удобно устанавливается в объемных помещениях. Это вестибюли, актовые залы, холлы. Большое дерево требует соответствующих методов для обеспечения надежности и безопасности размещения – стальное или кованое основание!&lt;/p&gt;&lt;h2&gt;Применение:&lt;/h2&gt;&lt;p&gt;Великолепное решение выбрать и купить пихту на новогодние даты. Но стоит украсить растение в соответствии с его параметрами и густотой кроны!&lt;/p&gt;&lt;p&gt;Интернет-магазин рекомендует внимательно изучить ассортимент перед оформлением заказа. Мы всегда готовы предложить более подходящий экземпляр!&lt;/p&gt;', '3-3.25м', '', '', '', ''),
(173, 1, 'Живая датская ель срезанная', '&lt;h2&gt;Описание и характеристики:&lt;/h2&gt;  &lt;p&gt;Натуральная датская елка из питомника, срезанная только после заказа покупателем! Идеальная крона, равномерная окраска, точные линии, неосыпающаяся хвоя. Размер новогоднего дерева – 5,0 - 5,5 м, цена устанавливается на конкурентном уровне!&lt;/p&gt;  &lt;h2&gt;Преимущества:&lt;/h2&gt;  &lt;ul&gt;   &lt;li&gt;Идеальное растение для украшения открытой площадки на Новый год и Рождество;&lt;/li&gt;   &lt;li&gt;Великолепные внешние данные живой ели – пышность, цвет, правильная и равномерная крона;&lt;/li&gt;   &lt;li&gt;Прекрасный аромат свежесрезанной лесной ели;&lt;/li&gt;   &lt;li&gt;Выращивание в соответствии с международными стандартами, качество подтверждено сопроводительным сертификатом!&lt;/li&gt; &lt;/ul&gt;  &lt;h2&gt;Размещение:&lt;/h2&gt;  &lt;p&gt;Высокая елка размещается на открытых площадках торговых и развлекательных центров или в их холлах, если высота помещения соответствует размеру. Установка производится в деревянный ящик с песком, пластиковый контейнер, на стальной каркас или специальное кованое основание, купить которое можно в нашем интернет-магазине!&lt;/p&gt;  &lt;h2&gt;Применение:&lt;/h2&gt;  &lt;p&gt;Украшение открытых территорий и соответствующих параметрам растения помещений на новогодние праздники.&lt;/p&gt;  &lt;p&gt;Доставка по Москве от любого количества. Наша компания предлагает только лучшие живые ели оптом и в розницу!&lt;/p&gt;', '5-5.5м', '', '', '', ''),
(226, 1, 'Живая русская ель срезанная', '&lt;h2&gt;Описание и характеристики:&lt;/h2&gt;&lt;p&gt;Живая русская елка средней высоты для размещения в жилых, административных и муниципальных помещениях. Замечательный равномерный цвет, равнорастущие ветви и хвоя средней жесткости. Размер свежесрезанного новогоднего дерева строго 2,25 - 2,5 м. Цена заморожена до конца декабря!&lt;/p&gt;&lt;h2&gt;Преимущества:&lt;/h2&gt;&lt;ul&gt;&lt;li&gt;Прекрасный образец прямиком из экологически чистого питомника;&lt;/li&gt;&lt;li&gt;Правильная пирамидальная крона без дефектов;&lt;/li&gt;&lt;li&gt;Исключение желтизны отдельных участков;&lt;/li&gt;&lt;li&gt;Отличная фиксация хвои, которая у некоторых других видов елей может подсыхать и опадать, превращаясь в мусор; &lt;/li&gt;&lt;li&gt;Легкий терпкий аромат натурального леса в вашем доме!&lt;/li&gt;&lt;/ul&gt;&lt;h2&gt;Размещение:&lt;/h2&gt;&lt;p&gt;Елка данного размера может быть размещена в любом удобном месте жилого или офисного помещения. Прекрасно подходит для оформления входной группы корпоративных зданий, вестибюлей развлекательных центров.&lt;/p&gt;&lt;h2&gt;Применение:&lt;/h2&gt;&lt;p&gt;Срезанная ель используется непосредственно для оформления помещений для празднования дат Нового года, Рождества, а также событий корпоративного уровня в период зимнего отпуска и каникул!&lt;/p&gt;&lt;p&gt;Елки Сэйл – интернет-магазин, предоставляющий возможность купить ели недорого, оптом и в розницу. Обязательная доставка заказов по Москве!&lt;/p&gt;', '2.25-2.5м', '', '', '', ''),
(227, 1, 'Живая сосна обыкновенная срезанная', '&lt;h2&gt;Описание и характеристики:&lt;/h2&gt;&lt;p&gt;Высокая живая сосна из экологически чистого лесопитомника. Лучшая замена дорогой елке, хвоя которой может осыпаться при неправильном уходе.&lt;/p&gt;&lt;p&gt;Красивое и статное новогоднее дерево размером 2,5 - 3,0 м, зеленое и ароматное, без дефектов и признаков подсыхания. Цена – 4 000 рублей!&lt;/p&gt;&lt;h2&gt;Преимущества:&lt;/h2&gt;&lt;ul&gt;&lt;li&gt;Свежесрезанная сосна на Новый год и Рождество;&lt;/li&gt;&lt;li&gt;Правильная форма, распределение ветвей;&lt;/li&gt;&lt;li&gt;Длинная зеленая и ароматная хвоя, которая на ощупь колется и является шершавой;&lt;/li&gt;&lt;li&gt;Пышная конусообразная крона, равномерное заполнение по стволу без залысин;&lt;/li&gt;&lt;li&gt;Изысканное растение с неповторимым терпким ароматом;&lt;/li&gt;&lt;li&gt;К каждому дереву сертификат качества!&lt;/li&gt;&lt;/ul&gt;&lt;h2&gt;Размещение:&lt;/h2&gt;&lt;p&gt;Сосна данного размера подходит для помещений увеличенной площади, вестибюлей, залов и холлов торговых комплексов, ресторанов, кинотеатров, офисных зданий. Закрепляется установкой на стальную крестовину, пластиковое или кованое основание с фиксацией!&lt;/p&gt;&lt;h2&gt;Применение:&lt;/h2&gt;&lt;p&gt;Сосна используется для новогоднего оформления залов, скверов, патио, зон въезда на закрытые территории, дополнительно украшается игрушками и световой декорацией.&lt;/p&gt;&lt;p&gt;Купить живую сосну можно в интернет-магазине Елки Сэйл. Опт и розница, доставка от 1 шт. по региону и самой Москве!&lt;/p&gt;', '2.5-3м', '', '', '', ''),
(175, 1, 'Живая датская ель срезанная', '&lt;h2&gt;Описание и характеристики:&lt;/h2&gt;&lt;p&gt;Красивое и статное растение, размер которого более чем вдвое превышает высоту стандартного помещения – 5,5 - 6,0 м. Цена на конкурентном уровне. &lt;/p&gt;&lt;p&gt;Великолепное новогоднее дерево с конусообразной кроной и глубоким зеленым равномерным цветом!&lt;/p&gt;&lt;h2&gt;Преимущества:&lt;/h2&gt;&lt;ul&gt;&lt;li&gt;Изумрудно-зеленый оттенок с постоянным блеском;&lt;/li&gt;&lt;li&gt;Мягкая хвоя, которая не осыпается и не желтеет, не подсыхает во время эксплуатации растения;&lt;/li&gt;&lt;li&gt;Насыщенный хвойный аромат, создающий природную атмосферу;&lt;/li&gt;&lt;li&gt;Исключение попадания дефектных образцов на рынок, постоянный контроль качества!&lt;/li&gt;&lt;/ul&gt;&lt;h2&gt;Размещение:&lt;/h2&gt;&lt;p&gt;Высокая датская ель устанавливается во дворах, открытых зонах частных территорий или внутри объемных холлов и залов, соответствующих размеру дерева. Требуется надежное закрепление основания в ящике или контейнере, или в специальной стальной подставке.&lt;/p&gt;&lt;h2&gt;Применение:&lt;/h2&gt;&lt;p&gt;Растение используется в качестве декоративного украшения на Новый год и Рождество. Прекрасно смотрится с гирляндами и другими приборами освещения, крупными новогодними игрушками!&lt;/p&gt;&lt;p&gt;Интернет-магазин Елки Сэйл в Москве – это большой выбор свежесрезанных елок, которые мы продаем оптом и в розницу. Купить новогоднее дерево можно с доставкой по столице и области!&lt;/p&gt;', '5.5-6м', '', '', '', ''),
(225, 1, 'Живая пихта Фразера срезанная', '&lt;h2&gt;Описание и характеристики:&lt;/h2&gt;&lt;p&gt;Живая пихта Фразера величиной 2,75 - 3,0 м – оптимальный вариант для украшения холла или вестибюля, комнаты в большом доме, кафе, ресторана. Красивое вечнозеленое дерево, которое мы срежем для вас под Новый год и Рождество. Высокое, очень стройное и величественное, что выражается пышностью растения. Цена – 25 000 рублей!&lt;/p&gt;&lt;h2&gt;Преимущества:&lt;/h2&gt;&lt;ul&gt;&lt;li&gt;Прекрасное новогоднее дерево, способное стать украшением любого праздничного зала;&lt;/li&gt;&lt;li&gt;Стандартные характеристики пихты Фразера – стройность дерева, равномерность прилегания направленных вверх ветвей, темно-зеленая и ароматная хвоя;&lt;/li&gt;&lt;li&gt;Каждое дерево выращено в лесопитомнике;&lt;/li&gt;&lt;li&gt;Предлагается опт и розница, а также доставка деревьев по территории Москвы, области!&lt;/li&gt;&lt;/ul&gt;&lt;h2&gt;Размещение:&lt;/h2&gt;&lt;p&gt;Где поставить пихту размером больше среднего? Если новогоднее дерево не входит в помещение, украсьте растение на улице. Установку следует провести на стальное основание. В ассортименте магазина также имеются надежные подставки под любой размер елки или пихты!&lt;/p&gt;&lt;h2&gt;Применение:&lt;/h2&gt;&lt;p&gt;Наш интернет-магазин рекомендует использовать срезанную пихту в качестве центрального элемента оформления праздничной территории.&lt;/p&gt;&lt;p&gt;Также вы можете купить елки и сосны, срезанные и в горшках. Звоните!&lt;/p&gt;', '2.75-3м', '', '', '', ''),
(224, 1, 'Живая русская ель срезанная', '&lt;h2&gt;Описание и характеристики:&lt;/h2&gt;&lt;p&gt;Великолепное живое новогоднее дерево для декоративного оформления помещений под празднование Нового года и Рождества. Светлый зеленый цвет, легкие переливы и отблески хвои, пышная и равномерная крона, а также приличный размер елки – 2,0 - 2,25 м!  Цена остается на уровне прошлого года, без изменений!&lt;/p&gt;&lt;h2&gt;Преимущества:&lt;/h2&gt;&lt;ul&gt;&lt;li&gt;Достаточно высокая елка, которая отлично подойдет для оформления помещения площадью 20-30 квадратных метров;&lt;/li&gt;&lt;li&gt;Непревзойденный натуральный аромат свежей хвои;&lt;/li&gt;&lt;li&gt;Каждое дерево срезается только после вашего заказа, по желанию, может быть оформлена доставка по Москве;&lt;/li&gt;&lt;li&gt;Возможна экономия средств, если удобно забрать ель самовывозом;&lt;/li&gt;&lt;li&gt;Сопроводительные документы к каждому экземпляру ели или сосны из нашего интернет-магазина!&lt;/li&gt;&lt;/ul&gt;&lt;h2&gt;Размещение:&lt;/h2&gt;&lt;p&gt;Величина новогоднего дерева позволяет установить его на стальную, пластиковую или кованую основу. В определенных случаях, потребуется дополнительная фиксация верхушки.&lt;/p&gt;&lt;h2&gt;Применение:&lt;/h2&gt;&lt;p&gt;Декоративное оформление любого типа помещений под новогодние праздники, а также установка на открытых площадках!&lt;/p&gt;&lt;p&gt;Купить русскую ель по лучшей цене можно только у нас! Предлагается опт и розница, большой ассортимент размеров!&lt;/p&gt;', '2-2.25м', '', '', '', ''),
(223, 1, 'Живая сосна обыкновенная срезанная', '&lt;h2&gt;Описание и характеристики:&lt;/h2&gt;&lt;p&gt;Обыкновенная сосна – один из лучших образцов новогодних деревьев для оформления помещений. Наш интернет-магазин предлагает живые срезанные сосны размером больше среднего – 2,25 - 2,5м, по приемлемой цене – 3 200 рублей!&lt;/p&gt;&lt;h2&gt;Преимущества:&lt;/h2&gt;&lt;ul&gt;&lt;li&gt;Большой ассортимент деревьев – живые сосны на Новый год и Рождество, датские и русские елки, новогодние деревья в горшках;&lt;/li&gt;&lt;li&gt;Выращивание только в лесопитомнике, никакого нарушения экологической обстановки;&lt;/li&gt;&lt;li&gt;Сосны с ровным стволом, без выраженных физических дефектов, с идентичными ветвями и зеленой хвоей;&lt;/li&gt;&lt;li&gt;Прекрасный вид и цвет, длительный аромат влажного осеннего леса;&lt;/li&gt;&lt;li&gt;Предоставляем сертификаты на продукцию!&lt;/li&gt;&lt;/ul&gt;&lt;h2&gt;Размещение:&lt;/h2&gt;&lt;p&gt;Крупная сосна устанавливается на стальную подставку, желательно с дополнительной фиксацией для обеспечения безопасности. Размещение возможно в любом помещении или открытой зоне – скверы, дворы, территории у кафе и ресторанов!&lt;/p&gt;&lt;h2&gt;Применение:&lt;/h2&gt;&lt;p&gt;Елки Сэйл предлагают купить елки в Москве по лучшей стоимости. Любой размер, опт и розница, доставка от 1 штуки, консультации по увеличению срока эксплуатации! Звоните и заказывайте елку для дома или корпоративной вечеринке в офисе!&lt;/p&gt;', '2.25-2.5м', '', '', '', ''),
(221, 1, 'Живая русская ель срезанная', '&lt;h2&gt;Описание и характеристики:&lt;/h2&gt;&lt;p&gt;Живая новогодняя русская елка для оформления помещения любого формата под Новый год и Рождество. Удобный размер – 1,75 - 2,0 м, равномерный цвет и отсутствие резких перепадов оттенков, равномерная пирамидальная крона с исключением сложных физических дефектов. Цена растения – 2 000 рублей!&lt;/p&gt;&lt;h2&gt;Преимущества:&lt;/h2&gt;&lt;ul&gt;&lt;li&gt;Главное положительное качество свежесрезанной ели – правильная форма кроны со всех сторон;&lt;/li&gt;&lt;li&gt;Идеальная цветовая гамма в одном цвете без резких перемен оттенков, отсутствие желтизны;&lt;/li&gt;&lt;li&gt;Елка гарантированно прослужит дольше всего периода праздничных дней, не высохнет и не осыплется;&lt;/li&gt;&lt;li&gt;Дерево насытит помещение приятным хвойным ароматом сразу после размещения;&lt;/li&gt;&lt;li&gt;Вы получите сертификат на продукцию после доставки на место!&lt;/li&gt;&lt;/ul&gt;&lt;h2&gt;Размещение:&lt;/h2&gt;&lt;p&gt;Стандартный и один из самых популярных размеров новогоднего дерева. Можно поместить елку в контейнер или ящик, а также установить на приобретенную в комплекте пластиковую основу. &lt;/p&gt;&lt;h2&gt;Применение:&lt;/h2&gt;&lt;p&gt;Украшение помещений и открытых площадок на улице, использование для оформления вестибюлей, холлов административных помещений.&lt;/p&gt;&lt;p&gt;Наш интернет-магазин работает с оптом и розницей, выполняет доставку по Москве и области, а также предлагает большой ассортимент, из которого вы можете выбрать и купить лучшую елку или сосну!&lt;/p&gt;', '1.75-2м', '', '', '', ''),
(222, 1, 'Живая пихта Фразера срезанная', '&lt;h2&gt;Описание и характеристики:&lt;/h2&gt;&lt;p&gt;Елки Сэйл рекомендуют выбрать из всего ассортимента интернет-магазина именно срезанную пихту Фразера размером 2,5 - 2,75 м, по специальной цене в 20 500 рублей! Идеальная величина, строгая стройность растения, равномерное покрытие ветвями и короткой жесткой хвоей, что повышает эстетическую ценность новогоднего дерева!&lt;/p&gt;&lt;h2&gt;Преимущества:&lt;/h2&gt;&lt;ul&gt;&lt;li&gt;Действительно красивый образец, который достоин вашего внимания;&lt;/li&gt;&lt;li&gt;Прекрасный выбор в плане сочетания качества и стоимости;&lt;/li&gt;&lt;li&gt;Срез пихты только после вашего звонка и указания вида и размера;&lt;/li&gt;&lt;li&gt;Бережная доставка без сломов в машине и нанесения прочих повреждений, по всей территории Москвы;&lt;/li&gt;&lt;li&gt;Возможность реализации оптом и в розницу!&lt;/li&gt;&lt;/ul&gt;&lt;h2&gt;Размещение:&lt;/h2&gt;&lt;p&gt;Размер пихты предполагает предварительный замер, точный расчет, так как дерево может не поместиться в стандартной комнате.&lt;/p&gt;&lt;p&gt;Установка проводится в любом соответствующем по размерам помещении, строго на надежное и прочное основание!&lt;/p&gt;&lt;h2&gt;Применение:&lt;/h2&gt;&lt;p&gt;Качественное дополнение, а точнее, центральный объект любого оформляемого на Новый год и Рождество помещения.&lt;/p&gt;&lt;p&gt;Мы рекомендуем заранее проконсультироваться с нашими специалистами, чтобы купить лучшую елку, пихту или сосну к праздникам!&lt;/p&gt;', '2.5-2.75м', '', '', '', ''),
(181, 1, 'Живая датская ель срезанная', '&lt;h2&gt;Описание и характеристики:&lt;/h2&gt;  &lt;p&gt;Живая елка в вашем доме на Новый год и Рождество – настоящий символ отличного настроения и живой дух праздника. Наш интернет-магазин предлагает изучить весь ассортимент, или сразу заказать датскую ель, срезанную специально для вас в экологически чистом питомнике.&lt;/p&gt;  &lt;p&gt;Живое красивое растение, размер которого составляет 2,75 - 3,0 м, можно купить по вполне приемлемой цене. Среди основных характеристик – правильная и равномерная крона, одинакового размера ветки, мягкая хвоя, которая не осыпается, а только подсыхает со временем!&lt;/p&gt;  &lt;h2&gt;Преимущества:&lt;/h2&gt;  &lt;ul&gt;   &lt;li&gt;Долгое хранение, сроки которого можно удвоить поливом со специальными составами;&lt;/li&gt;   &lt;li&gt;Датские елки выращиваются в промышленных масштабах специально под новогодние праздники, поэтому, покупая растение, вы не нарушаете экологический баланс;&lt;/li&gt;   &lt;li&gt;Прекрасные внешние показатели, рослое и статное растение;&lt;/li&gt;   &lt;li&gt;Непревзойденно свежий, специфический аромат леса сразу при заносе в помещение;&lt;/li&gt;   &lt;li&gt;Продажа оптом и в розницу, самовывозом или с заказом доставки по Москве!&lt;/li&gt; &lt;/ul&gt;  &lt;h2&gt;Размещение:&lt;/h2&gt;  &lt;p&gt;Высокие елки устанавливаются в стальные, кованые или пластиковые крестовины и дополнительно закрепляются!&lt;/p&gt;  &lt;h2&gt;Применение:&lt;/h2&gt;  &lt;p&gt;Дерево такого размера рационально использовать для украшения холлов с высокими потолками, открытых площадок на улице!&lt;/p&gt;', '2.75-3м', '', '', '', ''),
(219, 1, 'Живая пихта Фразера срезанная', '&lt;h2&gt;Описание и характеристики:&lt;/h2&gt;&lt;p&gt;Срезанная пихта Фразера размером 2,25 - 2,5 метра – новогоднее растение оптимальной величины для размещения в жилом помещении. Это красивое и стройное дерево с равномерным разветвлением и покрытием хвоей – оптимизированный вариант украшения на Новый год и Рождество!&lt;/p&gt;&lt;h2&gt;Преимущества:&lt;/h2&gt;&lt;ul&gt;&lt;li&gt;Приемлемая стоимость новогоднего растения со столь элегантными внешними данными;&lt;/li&gt;&lt;li&gt;Идеальная стройность и пышность, а также &quot;одетость&quot; дерева;&lt;/li&gt;&lt;li&gt;Сложная структура покрытия хвоей, исключение залысин и фрагментов, портящих эстетику;&lt;/li&gt;&lt;li&gt;Аккуратная доставка без сломов и нарушения физических данных;&lt;/li&gt;&lt;li&gt;Опт и розница по Москве и области!&lt;/li&gt;&lt;/ul&gt;&lt;h2&gt;Размещение:&lt;/h2&gt;&lt;p&gt;Пихта используется для украшения холлов крупных коммерческих организаций, комплексов отдыха, административных учреждений, жилых помещений. Установка производится с обязательным применением стального или кованого основания, обеспечивающего устойчивость!&lt;/p&gt;&lt;h2&gt;Применение:&lt;/h2&gt;&lt;p&gt;Живая пихта Фразера данного размера идеально подходит для украшения квартир, офисов, уютных кафе. Завершенности придает оформление новогоднего дерева иллюминацией!&lt;/p&gt;&lt;p&gt;Интернет-магазин Елки Сэйл предлагает купить пихты и елки по самой умеренной цене в регионе. Изучите ассортимент и сделайте заказ!&lt;/p&gt;', '2.25-2.5м', '', '', '', ''),
(220, 1, 'Живая сосна обыкновенная срезанная', '&lt;h2&gt;Описание и характеристики:&lt;/h2&gt;&lt;p&gt;Срезанная живая сосна величиной больше средней. Прекрасное ровнорастущее дерево без физических дефектов, ярко-зелено и ароматное – исключительно подходящее для празднования Нового года и Рождества!&lt;/p&gt;&lt;p&gt;Размер сосны – 2,0 - 2,25 м, цена составляет всего 2 600 рублей!&lt;/p&gt;&lt;h2&gt;Преимущества:&lt;/h2&gt;&lt;ul&gt;&lt;li&gt;Ровный ствол без дефектов, с естественным бурым окрасом;&lt;/li&gt;&lt;li&gt;Равномерное количество ветвей с каждой стороны, что обеспечивает правильную конусообразную форму;&lt;/li&gt;&lt;li&gt;Красивая длинная хвоя, иголки шершавые и колкие, не осыпаются и не подсыхают при условии использования специальных жидкостей;&lt;/li&gt;&lt;li&gt;Новогоднее дерево красивое и статное, чуть больше среднего размера, сразу после помещения в комнату или кабинет, наполняет всю площадь терпким ароматом леса!&lt;/li&gt;&lt;/ul&gt;&lt;h2&gt;Размещение:&lt;/h2&gt;&lt;p&gt;Сосна может быть установлена в углу или по центру помещения, что позволяет ее форма без дефектов. Способы установки – контейнер с песком, деревянная или пластиковая крестовина, стальная или кованая подставка от нашего интернет-магазина!&lt;/p&gt;&lt;h2&gt;Применение:&lt;/h2&gt;&lt;p&gt;Классическое оформление и дополнение символом праздника помещений и открытых площадок!&lt;/p&gt;&lt;p&gt;Купить свежесрезанную сосну с доставкой по Москве можно у нас. Отличные условия сотрудничества, отправка каждый день, опт и розница!&lt;/p&gt;', '2-2.25м', '', '', '', ''),
(184, 1, 'Живая датская ель срезанная', '&lt;h2&gt;Описание и характеристики:&lt;/h2&gt;&lt;p&gt;Наш интернет-магазин предоставляет возможность выбора новогодней елки высотой до 6 м. На данный момент, предлагается высокорослая срезанная датская ель, размер которой 3,0 – 3,5 м. Цена растения полностью оправдана, так как это многолетнее дерево со стройным стволом, равномерной конусообразной формой, ярким цветом и великолепной хвоей!&lt;/p&gt;&lt;h2&gt;Преимущества:&lt;/h2&gt;&lt;ul&gt;&lt;li&gt;Рослое, красивое, готовое к установке на праздничном мероприятии новогоднее дерево;&lt;/li&gt;&lt;li&gt;Увеличенный срок сохранения первоначального внешнего вида;&lt;/li&gt;&lt;li&gt;Короткая и неколючая хвоя средней жесткости;&lt;/li&gt;&lt;li&gt;На срезанной елке только зеленые колючки, никаких пожелтевших фрагментов;&lt;/li&gt;&lt;li&gt;Единый стандарт качества, сертифицированная продукция;&lt;/li&gt;&lt;li&gt;Опт и розница, лучшие условия для заказчиков, которые хотят купить растение, доставка по Москве!&lt;/li&gt;&lt;/ul&gt;&lt;h2&gt;Размещение:&lt;/h2&gt;&lt;p&gt;Установка требует наличия специальных стоек и креплений, пластиковых или стальных, возможно, кованых и усиленных. Возможен монтаж в деревянный или пластиковый контейнер. Есть необходимость дополнительного крепления верхушки и серединной части.&lt;/p&gt;&lt;h2&gt;Применение:&lt;/h2&gt;&lt;p&gt;Живая ель на Новый год и Рождество предназначена для размещения в торжественных залах административных, развлекательных центров, холлах домов!&lt;/p&gt;', '3-3.5м', '', '', '', ''),
(218, 1, 'Живая русская ель в горшке', '&lt;h2&gt;Описание и характеристики:&lt;/h2&gt;  &lt;p&gt;С приближение новогодних праздников люди начинают задумываться, какой символ Рождества купить на этот раз. Живая русская ель в горшке – прекрасный выбор и отсутствие необходимости в утилизации дерева после праздников. &lt;/p&gt;  &lt;p&gt;Зеленая красавица имеет тонкие изящные веточки и короткую хвою, источает прекрасный запах смолы, знакомый каждому из нас с детства. Фитонциды и эфирные масла, выделяемые иголками, служат профилактикой простудных заболеваний.&lt;/p&gt;  &lt;h2&gt;Преимущества:	&lt;/h2&gt;  &lt;ul&gt;   &lt;li&gt;доступность – невысокая цена обеспечивает популярность русских елей;&lt;/li&gt;   &lt;li&gt;верность традициям – именно такими деревьями украшали дома наши родители на Новый год;&lt;/li&gt;   &lt;li&gt;компактность – благодаря тонким веткам и коротким иголкам можно легко перевезти русскую елку, если используется самовывоз;&lt;/li&gt;   &lt;li&gt;сертификаты качества и экологической чистоты – выдаются в питомнике. &lt;/li&gt; &lt;/ul&gt;  &lt;h2&gt;Размещение:&lt;/h2&gt;  &lt;p&gt;Живую русскую ель в горшке размером 1.5-1.75 м можно поставить в гостиной загородного дома, в общественном заведении, в торговом центре, в помещении офиса. Главное – удалить ее от отопительных приборов. &lt;/p&gt;  &lt;h2&gt;Применение:&lt;/h2&gt;  &lt;p&gt;В декоративных целях для создания праздничного настроения, украшения дома, а в дальнейшем – для оформления приусадебного ландшафта.&lt;/p&gt;  &lt;p&gt;Интернет-магазин Elki.sale предлагает заказать елку с удобной доставкой по Москве и области. &lt;/p&gt;', '1.5-1.75м', '', '', '', ''),
(186, 1, 'Живая датская ель срезанная', '&lt;h2&gt;Описание и характеристики:&lt;/h2&gt;&lt;p&gt;Уникальная по своим внешним показателям живая датская ель – настоящий символ праздника на Новый год и Рождество! Если Сэйл предлагает только качественные и свежесрезанные деревья из питомника, со всеми необходимыми документами!&lt;/p&gt;&lt;p&gt;Размер елки – 3,5 - 4 м, цена полностью соответствует рынку!&lt;/p&gt;&lt;h2&gt;Преимущества:&lt;/h2&gt;&lt;ul&gt;&lt;li&gt;Короткая мягкая хвоя, которая не колется и не осыпается;&lt;/li&gt;&lt;li&gt;Максимально тщательный подбор растений без пожелтевших фрагментов и физических дефектов;&lt;/li&gt;&lt;li&gt;Красивая, правильной формы крона и равноприлегающие ветви;&lt;/li&gt;&lt;li&gt;Насыщенный зеленый цвет с глубоким блеском;&lt;/li&gt;&lt;li&gt;Приятный аромат хвойного леса в помещении!&lt;/li&gt;&lt;/ul&gt;&lt;h2&gt;Размещение:&lt;/h2&gt;&lt;p&gt;Датская ель данного размера удобно помещается в холлах офисных и административных помещений, торговых и развлекательных центров. Для установки требуется стальной или пластиковый каркас, ПВХ контейнер или деревянный ящик с песком.&lt;/p&gt;&lt;h2&gt;Применение:&lt;/h2&gt;&lt;p&gt;Срезанные елки используются для создания праздничного украшения в закрытых помещениях и на открытых площадках.&lt;/p&gt;&lt;p&gt;Наш интернет-магазин рекомендует обратить внимание на предложенный ассортимент, а также купить елку нужного размера с доставкой по Москве. Для вас лучшие новогодние деревья оптом и в розницу!&lt;/p&gt;', '3.5-3.75м', '', '', '', ''),
(217, 1, 'Живая русская ель срезанная', '&lt;h2&gt;Описание и характеристики:&lt;/h2&gt;&lt;p&gt;Живая, свежесрезанная русская ель наиболее популярного размера среди покупателей. Красивая, правильной формы, с равномерным распределением цвета и полумягкой хвоей. Как всегда в нашем интернет-магазине только лучшие цены! Высота елки – 1,5 - 1,75 м!&lt;/p&gt;&lt;h2&gt;Преимущества:&lt;/h2&gt;&lt;ul&gt;&lt;li&gt;Хвоя средней жесткости, о которую невозможно поранить руки;&lt;/li&gt;&lt;li&gt;Красивый и равномерный цвет без резкого контраста оттенков и желтизны;&lt;/li&gt;&lt;li&gt;Наиболее соответствующий требованиям комфортного размещения в жилых помещениях размер;&lt;/li&gt;&lt;li&gt;Приятный лесной аромат, отдающий терпкостью;&lt;/li&gt;&lt;li&gt;Сертификат на каждую единицу продукции, выращенную в природном питомнике!&lt;/li&gt;&lt;/ul&gt;&lt;h2&gt;Размещение:&lt;/h2&gt;&lt;p&gt;Стандартная установка новогоднего дерева на уже имеющуюся в доме деревянную или стальную крестовину. Если таковой нет, подойдет размещение в ящике с песком. В качестве альтернативы, предлагается купить эргономичную подставку из ковки или пластика.&lt;/p&gt;&lt;h2&gt;Применение:&lt;/h2&gt;&lt;p&gt;Наш магазин предлагает приобрести елки наиболее классического, популярного размера для украшения любого помещения, от жилого до офисного.&lt;/p&gt;&lt;p&gt;Гарантируем своевременную доставку по Москве и Московской области, а также всегда интересные предложения для опта и розницы! Празднуйте Новый год и Рождество красиво!&lt;/p&gt;', '1.5-1.75м', '', '', '', ''),
(188, 1, 'Живая датская ель срезанная', '&lt;h2&gt;Описание и характеристики:&lt;/h2&gt;&lt;p&gt;Высокое, статное дерево для украшения объемных помещений или открытых участков. Прекрасный выбор на Новый год и Рождество. Если Сэйл предлагает срезанную датскую ель размером 4,0 - 4,5 м, по вполне доступной для таких размеров цене. &lt;/p&gt;&lt;h2&gt;Преимущества:&lt;/h2&gt;&lt;ul&gt;&lt;li&gt;Великолепная датская ель большой высоты с красивой кроной и мягкой хвоей;&lt;/li&gt;&lt;li&gt;Искусственно выращенное дерево соответствует всем требованиям современного декора на новогодние праздники;&lt;/li&gt;&lt;li&gt;Органичный темно-зеленый цвет и натуральный лоск;&lt;/li&gt;&lt;li&gt;Исключение осыпания иголок, продление срока службы декоративного растения с использованием специальных жидкостей;&lt;/li&gt;&lt;li&gt;Приятный природный запах живого леса в помещении!&lt;/li&gt;&lt;/ul&gt;&lt;h2&gt;Размещение:&lt;/h2&gt;&lt;p&gt;Свежесрезанная живая елка может быть установлена в холле или торжественном зале любого соответствующего помещения, или на открытой площадке частной территории. Для безопасной установки необходим стальной каркас под соответствующий размер дерева, а также дополнительное закрепление. Возможно помещение ствола дерева в ящик с песком!&lt;/p&gt;&lt;h2&gt;Применение:&lt;/h2&gt;&lt;p&gt;Используется для украшения помещений с большой высотой потолка или открытых площадок в качестве декоративного новогоднего украшения.&lt;/p&gt;&lt;p&gt;Интернет-магазин Елки Сэйл рекомендует внимательное изучение каталога растений, а также предварительный заказ. Вы можете купить одну елку с доставкой по Москве, или рассмотреть предложения сотрудничества, так как мы реализуем ели оптом и в розницу!&lt;/p&gt;', '4-4.5м', '', '', '', ''),
(216, 1, 'Подставки для елки с водой', '&lt;p&gt;&lt;a href=&quot;/el/zhivaya-srezannaya/&quot;&gt;Новогодняя елка&lt;/a&gt; – вечный символ великолепного зимнего праздника. Но кроме трудностей по выбору елки или сосны к Новому году и Рождеству, вам также необходимо позаботиться о надежной и безопасной установке дерева в своем доме или кабинете.&lt;/p&gt;&lt;p&gt;Елки Сэйл – интернет-магазин, способный быстро и эффективно решить данные вопросы. Мы предлагаем срезанные живые елки и пихты для украшения территории празднования, а также надежные подставки под новогодние деревья, которые обеспечат устойчивость!&lt;/p&gt;&lt;h2&gt;Пластмассовая подставка под елку&lt;/h2&gt;&lt;p&gt;В нашем ассортименте несколько подставок, но на данной странице предлагается аксессуар из пластика – &quot;Космос&quot; по достаточно умеренной цене:&lt;/p&gt;&lt;ul&gt;&lt;li&gt;Подставка регулируемая с крепкими фиксаторами ствола. Установить в нее можно дерево до 2,5 метров высоты с соответствующим диаметром ствола;&lt;/li&gt;&lt;li&gt;Пластиковое основание не боится увлажнения, температурных изменений, механических повреждений;&lt;/li&gt;&lt;li&gt;Также внутри имеется резервуар, наполняемый водой со специальными химическими составами, подпитывающими срезанное дерево и продлевающими срок его службы;&lt;/li&gt;&lt;li&gt;Большая площадь опирания на пол обеспечивает высокую степень надежности и исключает опрокидывание!&lt;/li&gt;&lt;/ul&gt;&lt;p&gt;Купить подставку под ель или &lt;a href=&quot;/pikhta/zhivaya-pikhta-srezannaya/&quot;&gt;пихту в Москве&lt;/a&gt; можно по звонку. Набирайте номер и оформляйте заказ!&lt;/p&gt;', '', '', '', '', ''),
(190, 1, 'Живая датская ель срезанная', '&lt;h2&gt;Описание и характеристики:&lt;/h2&gt;&lt;p&gt;Свежесрезання ель специально для празднования Нового года и Рождества из экологически чистого питомника. Правильная форма, идеальная симметрия, конусообразная крона.&lt;/p&gt;&lt;p&gt;Размер елки – 4,5 - 5,0 м, цена - доступная для такой ели. &lt;/p&gt;&lt;h2&gt;Преимущества:&lt;/h2&gt;&lt;ul&gt;&lt;li&gt;Натуральная живая елка большого размера, которая срезается после вашего заказа;&lt;/li&gt;&lt;li&gt;Идеальная форма и большой рост, глубокий изумрудно-зеленый цвет без желтизны;&lt;/li&gt;&lt;li&gt;Длительный срок эксплуатации без подсыхания и опадания хвои;&lt;/li&gt;&lt;li&gt;Насыщенный лесной аромат, который долго держится;&lt;/li&gt;&lt;li&gt;Строгое соблюдение стандартов, что подтверждено сертификатом!&lt;/li&gt;&lt;/ul&gt;&lt;h2&gt;Размещение:&lt;/h2&gt;&lt;p&gt;Елка устанавливается на открытых площадках или в холлах и залах торговых, развлекательных центров. Для установки можно дополнительно приобрести кованую или пластиковую подставку, разместить дерево в деревянный ящик, наполненный песком. Требуется дополнительная фиксация!&lt;/p&gt;&lt;h2&gt;Применение:&lt;/h2&gt;&lt;p&gt;Новогоднее дерево предназначено для декоративного украшения и общего оформления залов для празднования новогодних праздников.&lt;/p&gt;&lt;p&gt;Интернет-магазин Елки Сэйл предлагает ели оптом и в розницу. Вы можете купить елку в Москве с доставкой по столице, выбрав из широкого ассортимента!&lt;/p&gt;', '4.5-5м', '', '', '', ''),
(215, 1, 'Живая пихта Фразера в горшке', '&lt;h2&gt;Описание и характеристики:&lt;/h2&gt;&lt;p&gt;Живое новогоднее растение для использования на будущий Новый год и Рождество. Высокое и статное хвойное дерево с полноценным развитием, равным распределением ветвей, красивыми иголками насыщенного цвета. Размер пихты Фразера – 1,75 - 2,0 м!&lt;/p&gt;&lt;h2&gt;Преимущества:&lt;/h2&gt;&lt;ul&gt;&lt;li&gt;Живое дерево в горшке – возможность применить его в качестве украшения и в следующем году, и через год, два, три...;&lt;/li&gt;&lt;li&gt;Правильная форма кроны, дерево без сломов веток, без залысин или фрагментов с сухой хвоей;&lt;/li&gt;&lt;li&gt;Растение в кадке не осыпается;&lt;/li&gt;&lt;li&gt;Размер пихты подходит под любую площадь и формат помещения;&lt;/li&gt;&lt;li&gt;Сертификат соответствия в комплекте, а также доставка по Москве и области!&lt;/li&gt;&lt;/ul&gt;&lt;h2&gt;Размещение:&lt;/h2&gt;&lt;p&gt;Пихта в горшке устанавливается в любом помещении – холлы, гостиные, кабинеты, вестибюли. Размещение в собственном горшке или на специальной прочной подставке!&lt;/p&gt;&lt;h2&gt;Применение:&lt;/h2&gt;&lt;p&gt;Новогодняя пихта используется для оформления залов, комнат, холлов и открытых территорий под будущие праздники. Для украшения можно взять любые игрушки. После праздников, пихта в горшке размещается на участке в качестве элемента оформления ландшафта территории!&lt;/p&gt;&lt;p&gt;Наш интернет-магазин елки и пихты в горшках и срезанном виде, по приемлемой цене. Купить с доставкой по региону можно любое понравившееся растение, оптом и в розницу!&lt;/p&gt;', '1.75-2м', '', '', '', ''),
(243, 1, 'Тестовий товар', '&lt;h2&gt;\r\n  Размещение:\r\n&lt;/h2&gt;\r\n&lt;p&gt;Срезанная сосна данного размера устанавливается в подставку из пластика или ковки, которую также можно заказать в нашем интернет-магазине. Растение прекрасно вписывается в жилые помещения, офисы, холлы различных учреждений.&lt;/p&gt;\r\n&lt;h2&gt;\r\n  Применение:\r\n&lt;/h2&gt;\r\n&lt;p&gt;\r\n  Новогоднее дерево используется для классического оформление закрытых зон празднования, а также площадок на улице, во дворе! Мы предлагает купить елки и сосны по приемлемой стоимости. Выбор практически неограничен!\r\n&lt;/p&gt;\r\n&lt;h2&gt;\r\n  Преимущества:\r\n&lt;/h2&gt;\r\n&lt;p&gt;  \r\n  Только свежие деревья, которые выращиваются строго на территории питомника, подготавливаются к отправке и сопровождаются необходимой\r\n  документацией; Яркий цвет и стойкий аромат, что наполняет помещение практически сразу; Равномерная хвоя, которая не подсыхает и не осыпается с веток;\r\n  Доставка от 1 шт. по Москве, а также региону, возможен опт и розница!\r\n&lt;/p&gt;', '1.5-1.75м, Хит', '', '', '', '');
